INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(6256, 1, 'SAS and R Data Management, Statistical Analysis, and Graphics', 'Kleinman, Ken and Horton, Nicholas J.', 2010, 'CRC Press', 'SAS and R: Data Management, Statistical Analysis, and Graphics presents an easy way to learn how to perform an analytical task in both SAS and R, without having to navigate through the extensive, idiosyncratic, and sometimes unwieldy software documentation. The book covers many common tasks, such as data management, descriptive summaries, inferential procedures, regression analysis, and the creation of graphics, along with more complex applications.', 1, NULL, NULL, 1293858000, 2011006, 2),
(6257, 1, 'Linear Causal Modeling With Structural Equations', 'Mulaik, Stanley A.', 2009, 'CRC Press', 'Emphasizing causation as a functional relationship between variables that describe objects, Linear Causal Modeling with Structural Equations integrates a general philosophical theory of causation with structural equation modeling (SEM) that concerns the special case of linear causal relations. In addition to describing how the functional relation concept may be generalized to treat probabilistic causation, the book reviews historical treatments of causation and explores recent developments in ex', 2, NULL, 'Chapman & Hall/Crc Statistics in the Social and Behavioral Sciences', 1293858000, 2011005, 2),
(6258, 1, 'Statistics in Human Genetics and Molecular Biology', 'Cavan Reilly', 2009, 'Chapman & Hall/CRC', 'Focusing on the roles of different segments of DNA, Statistics in Human Genetics and Molecular Biology provides a basic understanding of problems arising in the analysis of genetics and genomics. It presents statistical applications in genetic mapping, DNA/protein sequence alignment, and analyses of gene expression data from microarray experiments.\n\nThe text introduces a diverse set of problems and a number of approaches that have been used to address these problems. It discusses basic molecular', 3, NULL, '', 1293858000, 2011004, 2),
(6259, 1, 'Logistic Regression Models', 'Hilbe, Joseph M.', 2009, 'CRC Press', 'Logistic Regression Models presents an overview of the full range of logistic models, including binary, proportional, ordered, partially ordered, and unordered categorical response regression procedures. Other topics discussed include panel, survey, skewed, penalized, and exact logistic models. The text illustrates how to apply the various models to health, environmental, physical, and social science data.\n\nMany examples help explain the concepts and techniques of successful modeling\nThe text fi', 4, NULL, 'Texts in Statistical Science', 1293858000, 2011003, 2),
(6260, 1, 'Meta-analysis and Combining Information in Genetics and Genomics', 'Guerra, Rudy and Goldstein, Darlene R. (editors)', 2010, 'CRC Press', 'With the diversity of data and meta-data now available, there is increased interest in analyzing multiple studies beyond statistical approaches of formal meta-analysis. Covering an extensive range of quantitative information combination methods, Meta-analysis and Combining Information in Genetics and Genomics looks at how to analyze multiple studies from a broad perspective.\n\nAfter presenting the basic ideas and tools of meta-analysis, the book addresses the combination of similar data types: ge', 5, NULL, 'Chapman & Hall/CRC Mathematical and Computational Biology Series', 1293858000, 2011002, 2),
(6261, 2, 'A Handbook of Statistical Analyses using R (2nd edition)', 'Everitt, Brian S. and Hothorn, Torsten', 2010, 'CRC Press', 'Like its bestselling predecessor, A Handbook of Statistical Analyses Using R, Second Edition provides a guide to data analysis using the R system for statistical computing. Each chapter includes a brief account of the relevant statistical background, along with appropriate references.\n\nNew to the Second Edition\n\n    * New chapters on graphical displays, generalized additive models, and simultaneous inference\n    * A new section on generalized linear mixed models that completes the discussion on ', 6, NULL, '  No roman numeral pages so I counted 26 printed pages before page #1, including blank pages.', 1293858000, 2011001, 2),
(6262, 1, 'Hidden Markov Models for Time Series  An Introduction Using R', 'Zucchini, Walter and MacDonald, Iain L.', 2009, 'CRC Press', 'Reveals How HMMs Can Be Used as General-Purpose Time Series Models\n\nImplements all methods in R\nHidden Markov Models for Time Series: An Introduction Using R applies hidden Markov models (HMMs) to a wide range of time series types, from continuous-valued, circular, and multivariate series to binary data, bounded and unbounded counts, and categorical observations. It also discusses how to employ the freely available computing environment R to carry out computations for parameter estimation, model', 7, NULL, 'Monographs on Statistics and Applied Probability 110', 1293858000, 2011000, 2),
(15885, NULL, 'Introduction to Statistical Limit Theory', 'Alan M. Polansky', 2011, 'Taylor and Francis', 'Those moving on to advanced statistics typically lack the mathematical foundation that allows them to make full use of statistical limit theory. This accessible resource reviews approximation theory and limit theory for sequences of functions and basic notions of functional analysis. It provides detailed arguments that show how underlying mathematical and statistical theory work together. Among its unique qualities, the text covers expansion theory, which is becoming increasingly important in mo', 12434, NULL, NULL, 1293944400, 2011125, 2),
(12585, 4, 'Causal Inference Using Potential Outcomes: Design, Modeling, Decisions', 'Donald B. Rubin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, -411, 0),
(12586, 4, 'Statistical Methods for Eliciting Probability Distributions', 'Paul H. Garthwaite, Joseph B. Kadane, and Anthony O''Hagan', 2004, NULL, NULL, NULL, NULL, NULL, NULL, -407, 0),
(12587, 3, 'Simultaneous Modelling of the Cholesky Decomposition of Several Covariance Matrices with Applications', 'Mohsen Pourahmadi, Mike Daniels, and Trevor Park', 2004, NULL, NULL, NULL, NULL, NULL, NULL, -403, 0),
(12588, 3, 'Multilevel Modelling with Spatial Effects and Its Application to Social Sciences', 'Luisa Corrado', 2003, NULL, NULL, NULL, NULL, 'Proposal for paper submitted 6/6/03', NULL, -306, 0),
(12589, 3, 'On the Nautre of Statistical Evidence', 'Bill Thompson', NULL, NULL, NULL, NULL, NULL, NULL, NULL, -305, 0),
(12590, 3, 'To Model or Not to Model? Competing Modes of Inference for Finite Population Sampling', 'Roderick Little', NULL, NULL, NULL, NULL, NULL, NULL, NULL, -302, 0),
