(12677, 3, 'Current Topics in Computational Molecular Biology', 'Tao Jiang, Ying Xu, and Michael Q. Zhang (Eds.)', 2002, 'Cambridge, MA: MIT Press', '19 chapters by various authors invited to write overviews of their specialties. Three main parts on sequence and genome analysis, data mining, and computational structural biology. Includes a comprehensive index.', 9312, NULL, NULL, NULL, 2083, 0),
(12678, 3, 'Item Generation for Test Development', 'Sidney H. Irvine and Patrick Kyllonen (Eds.)', 2002, 'Mahwah, NJ : Lawrence Erlbaum Associates, Inc.', 'Papers from a conference sponsored by the Air Force Human Research Laboratory and Educational Testing Service. 14 chapters, plus discussions, in 4 parts: psychometrics, item generation, theory to implementation, and applications.  Includes integrated author and subject indexes.', 9313, NULL, NULL, NULL, 2084, 0),
(12679, 3, 'Advances in Neural Information Processing Systems\r\nProceedings of the First 12 Conferences', 'Michael I. Jordan, Yann LeCun and Sara A. Solla (Eds.)', 2001, 'Cambridge, MA : MIT Press', NULL, 9314, NULL, 'see also # 3021', NULL, 2085, 0),
(12680, 3, 'Predictions in Time Series Using Regression Models', 'Frantisek Stulajter', 2002, 'New York: Springer-Verlag', 'Emphasis on nonstationary time series. Linear and nonlinear regression models for modeling trends and oscillations of time-correlated data. Chapters on Hilbert spaces, random processes, estimation, and prediction.', 9315, NULL, NULL, NULL, 2086, 0),
(12681, 3, 'Statistical Tables, Explained and Applied', 'Louis Laurencelle and Francois-A Dupuis', 2002, 'Singapore: World Scientific Publishing Co. Pte. Ltd.', 'Large-print tables of 15 distributions--the ones you''d expect, plus one for the E-bar-square distribution. Each table is supplemented with examples and mathematical foundations.', 9316, NULL, NULL, NULL, 2087, 0),
(12682, 3, 'Large-Scale Assessment Programs for All Students: Validitiy, Technical Adequacy, and Implementation', 'Gerald Tindal and Thomas M. Haladyna (Eds.)', 2002, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'Outgrowth of the work of an advisory panel to the Oregon Statewide Assessment. 20 chapters organized in 3 main parts: validity, technical issues, and implementation issues. Thorough integrated index.', 9317, NULL, NULL, NULL, 2088, 0),
(12683, 3, 'Growth and Convergence in Metropolitan America', 'Janet Rothenberg Pack', 2002, 'Washington, DC: The Brookings Institution', 'Numerous tables, graphs, and analyses based on two national data sets. Studies regional variations and relationships between regional growth and socioeconomic vitality.', 9318, NULL, NULL, NULL, 2089, 0),
(12684, 3, 'Simplicity, Inference and Modelling: Keeping it Sophisticatedly Simple', 'Arnold Zellner, Hugo A. Keuzenkamp, and Michael McAleer (Eds.)', 2001, 'New York: Cambridge University Press', '17 chapters by 21 contributors, including philosophers, mathematicians, econometricians, and economists. Focus is on simplicity versus complexity, in philosophy, theory, modeling, inference, and communication. Integrated index.', 9319, NULL, NULL, NULL, 2090, 0),
(12685, 3, 'Mathematical and Statistical Methods for Genetic Analysis (2nd ed.)', 'Kenneth Lange', 2002, 'New York: Springer', 'EM, Newton, scoring algorithms; genetic identity coeffiecients; Mendelian likelihoods; polygenic models; descent graphs; phylogeny; hybrid mapping; recombination; sequence analysis; Poisson approximations; diffusion processes. Includes numerous problems suitable for a graduate-level course.', 9320, NULL, NULL, NULL, 2091, 0),
(12686, 3, 'Stochastic Models with Applications to Genetics, Cancers, AIDS and Other Biomedical Systems', 'Tan Wai-Yuan', 2002, 'Singapore : World Scientific Publishing Co. Pte. Ltd.', 'MCMC methods (including multilevel Gibbs sampling) and state-space models. Book claims to be the first to develop many state-space models in genetics and other areas.', 9321, NULL, NULL, NULL, 2092, 0),
(12687, 3, 'Hyperstat (2nd ed.)', 'David Lane', 2002, 'Cincinnati: Atomic Dog Publishing', 'Standard topics for an introductory course, through factorial ANOVA. The online version is the same as the printed version, with hyperlinks added, e.g., to definitions of technical terms. While the purpose is instructional, no exercises are provided.', 9322, NULL, 'To the reviewer from Russ: If you feel that you need full access to the online version to write your review, contact our office (jasa-reviews@uiowa.edu) and we will try to get the publisher''s cooperation.', NULL, 2093, 0),
(12688, 3, 'The Statistical Sleuth (2nd ed.)', 'Fred L. Ramsey and Daniel W. Schafer', 2002, 'Belmont, California: Duxbury', 'Aimed at people who need to collect and analyze data in their research. Tries not to be too much of a cookbook. Chapters on basics, t-based inference, assumptions, nonparametrics, one-way anova, regression, model checking, variable selection, multi-factor experiments, multivariate methods, proportions and odds, contingency tables, logistic regression, and experimental design.', 9323, NULL, 'Johannes Ledolter may review.  Requested copy from publisher via email 6/4/02\r\n\r\n1st ed. reviewed in TAS ''00?', NULL, 2094, 0),
(12689, 3, 'The Subjectivity of Scientists and the Bayesian Approach', 'S. James Press and Judith M. Tanur', 2001, 'New York, NY: John C. Wiley and Sons, Inc.', 'This book examines issues of objectivity and subjectivity in science by exploring the lives and work of great scientists. There is also a chapter on the Bayesian approach in modern practice, and an appendix that gives literature references to Bayesian science by field of application.', 9324, NULL, 'Press and Tanur are former JASA editors. SNAFU in getting the book when it was published.', NULL, 2095, 0),
(12690, 3, 'What are the Chances? Voodoo Deaths, Office Gossip, and Other Adventures in Probability', 'Bart K. Holland', 2002, 'Baltimore, MD: The Johns Hopkins University Press', 'This book is aimed at a popular audience, and it covers a number of examples of how probabilities affect our lives. Scenarios include insurance law, sports, medical research, engineering, climatology, etc.', 9325, NULL, 'Cleary suggests joint w/2127', NULL, 2096, 0),
(12691, 3, 'Fractals, Graphics, & Mathematics Education', 'Michael Frame and Benoit Mandelbrot (Eds.)', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9326, NULL, 'The book description on the webpage is slightly differenct from this one, taken from the physical object', NULL, 2097, 0),
(12692, 3, 'Probability Models for DNA Sequence Evolution', 'Rick Durrett', 2002, 'New York, NY: Springer-Verlag', 'Basic models, e.g., Wright-Fisher, Ewens, infinite and finite sites. Neutral combinations, recombination, population subdivision. Natural selection: directional, balancing, background, hitchhiking. Tests: Tajiwa''s D, Fu and Li''s D, HKA, MacDonald-Kreitman. Genome rearrangement: chromosome size, inversion, translocation, duplication.', 9327, NULL, NULL, NULL, 2098, 0),
(12693, 3, 'Plane Answers to Complex Questions: The Theory of Linear Models (3rd ed.)', 'Ronald Christensen', 2002, 'New York, NY: Springer-Verlag', 'New material on identifiability and estimability, generalized linear models, additional approaches to testing parametric functions, models for factorial structures and homologous factors, and an appendix on interpreting small F ratios.', 9328, NULL, '1st Ed reviewed by Alan Fenech in JASA vol 84, 1989;\r\n2nd Ed rev. by Russ Lenth in JASA vol 92, 1997.', NULL, 2099, 0),
(12694, 3, 'First Steps in Statistics', 'Daniel B. Wright', 2002, 'Thousand Oaks, CA: Sage Publishers, Ltd.', 'Designed for a 10- or 15-week module on research methods in social sciences. Brief introductions to descriptive statistics, sampling and allocation, confidence intervals, tests for independent and paired data, ANOVA, regression and correlation, rank procedures, and contingency tables. Includes exercises; an answer guide is available to instructors.', 9329, NULL, NULL, NULL, 2100, 0),
(12695, 3, 'Biostatistical Genetics and Genetic Epidemiology', 'Robert Elston, Jane Olson, and Lyle Palmer (Eds.)', 2002, 'New York, NY: John Wiley', 'This is the third volume in the Wiley Reference Series in Biostatistics (the first two volumes are on epidemiologic methods and clinical trials). The format is encyclopedic, from admixtures to zygosity. Many of the articles are extracted from Wiley''s Encyclopedia of Biostatistics. Many of the approximately 200 contributors are prominent, and most articles include useful bibliographies.', 9330, NULL, NULL, NULL, 2101, 0),
(12696, 3, 'Ordinary Differential Equations: A Brief Eclectic Tour', 'David A. Sánchez', 2002, 'Washington, DC: Mathematical Association of America', NULL, NULL, NULL, NULL, NULL, 2102, 0),
(12697, 3, 'Mathematical Evolutions', 'Abe Shenitzer and John Stillwell (Eds.)', 2002, 'Washinton, DC: Mathematical Association of America', 'Various authors give accounts of the historical developments of ideas in analysis, algebra and number theory, geometry/topology, logic, and applications. Includes an essay by J.L. Doob on the development of rigor in mathematical probability.', 9331, NULL, NULL, NULL, 2103, 0),
(12698, 3, 'Inequalities from Complex Analysis', 'John P. D''Angelo', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9332, NULL, NULL, NULL, 2104, 0),
(12699, 3, 'Mathematical Olympiads: Problems and Solutions from Around the World 1999-2000', 'Titu Andreescu and Zuming Feng (Eds.)', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9333, NULL, NULL, NULL, 2105, 0),
(12700, 3, 'Innovations in Teaching Abstract Algebra', 'Allen Hibbard and Ellen Maycock', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9334, NULL, NULL, NULL, 2106, 0),
(12701, 3, 'Multilevel Analysis: Techniques and Applications', 'Joop Hox', 2002, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'Concerns hierarchical or nested data structures. Chapters include two-level and multilevel regression; longitudinal data; logistic and cross-classified models; meta-analysis; multivariate methods; sample size and power; advanced methods; factor, path, and latent-curve models.', 9335, NULL, NULL, NULL, 2107, 0),
(12702, 3, 'Introduction to Lattices and Order (2nd ed.)', 'B. A. Davey and  H. A. Priestley', 2002, 'New York, NY: Cambridge University Press', NULL, 9336, NULL, NULL, NULL, 2108, 0),
(12703, 3, 'Weighted Empirical Processes in Dynamic Nonlinear Models (2nd ed.)', 'Hira L. Koul', 2002, 'New York: Springer-Verlag', 'Unified approach for obtaining the limiting distributions of M and R estimators in dynamic nonlinear models; classes of goodness-of-fit tests; fitting regression and autoregressive functions.', 9337, NULL, NULL, NULL, 2109, 0),
(12704, 3, 'Convexity and Optimization in Rn', 'Leonard D. Berkovitz', 2001, 'New York, NY: Wiley', 'Presents the mathematics of finite-dimensional constrained-optimization problems. Includes a review of real analysis, convex sets and functions, optimization problems, convex programming, duality, the simplex method, and numerical methods.', 9338, NULL, NULL, NULL, 2110, 0),
(12705, 3, 'Statistical Modeling for Biomedical Researchers: a Simple Introduction to the Analysis of Complex Data', 'William D. Dupont', 2003, 'New York, NY: Cambridge University Press', 'Goes straight to regression methods after an introductory chapter. Linear, logistic, multiple logistic models, survival analysis, hazard functions, Poisson regression, fixed effects and repeated-measures ANOVA. Emphasizes STATA.', 9339, NULL, 'requested 7/16/02; rec''d March 2003', NULL, 2111, 0),
(12706, 3, 'Game Theory and Decision-making', 'Kelly', 2002, 'New York, NY: Cambridge University Press', NULL, 9340, NULL, NULL, NULL, 2112, 0),
(12707, 3, 'DNA Microarrays and Gene Expression: From Experiments to Data Analysis and Modeling', 'Pierre Baldi and G. Wesley Hatfield', 2002, 'New York, NY: Cambridge University Press', 'Chapters on DNA array formats and readout methods, gene expression profiling, inferring changes, dimension reduction, design, and systems biology. Aimed at an interdisciplinary audience: ``it takes a village to do genomics'''' (p. xii).', 9341, NULL, NULL, NULL, 2113, 0),
(12708, 3, 'Power Analysis', 'Bausell', 2002, 'New York, NY: Cambridge University Press', NULL, 9342, NULL, 'duplicate entry for 2228', NULL, 2114, 0),
(12709, 3, 'Social Choice', 'Taylor', 2002, 'New York, NY: Cambridge University Press', NULL, 9343, NULL, NULL, NULL, 2115, 0),
(12710, 3, 'Probabalistic Reasoning in Multiagent Systems: A Graphical Models Approach', 'Yang  Xiang', 2002, 'New York, NY: Cambridge University Press', 'Topics include Bayesian networks, belief updating and cluster graphs, junction trees, linked junction forests, distributed multiagent inference, and model construction/verification.', 9344, NULL, '11/7/03, Gentleman reports he has no record of this book.', NULL, 2116, 0),
(12711, 3, 'Parallel Scientific Computing in C++ and MPI: A Seamless Approach to Parallel Algorithms and their Implementation', 'George Em Karniadakis and Robert M. Kirby II', 2003, 'New York, NY: Cambridge University Press', NULL, 9345, NULL, 'arrived June, 03', NULL, 2117, 0),
(12712, 3, 'Evolution of Presidential Polling', 'Eisinger', NULL, NULL, NULL, 9346, NULL, NULL, NULL, 2118, 0),
(12713, 3, 'Analysis of Panel Data (2nd ed.)', 'Cheng Hsiao', 2003, 'New York, NY: Cambridge University Press', 'Introductory chapters, simultaneous-equations models, variable coefficients, discrete data, truncated/censored data, incomplete data, misc. topics. Aimed at grad. students and advanced researchers.', 9347, NULL, '1st ed. rev. by Gary Solon, JASA 82, 400, Dec, 1987, pp 1185', NULL, 2119, 0),
(12714, 3, 'Meaning, medicine, and the "Placebo Effect"', 'Moerman', 2002, 'New York, NY: Cambridge University Press', NULL, 9348, NULL, NULL, NULL, 2120, 0),
(12715, 3, 'Risk and Reason: Safety, Law, and the Environment', 'Cass R. Sunstein', 2002, 'New York, NY: Cambridge University Press', NULL, 9349, NULL, NULL, NULL, 2121, 0),
(12716, 3, 'Mathematics of Oz', 'Pickover', 2002, 'New York, NY: Cambridge University Press', NULL, NULL, NULL, NULL, NULL, 2122, 0),
(12717, 3, 'Cambridge Dictionary of Statistics (2nd ed.)', 'Brian S. Everitt', 2002, 'New York, NY: Cambridge University Press', 'Everything from Aalen''s linear regression model to Zygosity determination.', 9350, NULL, '1st edition reviewed by Jammalamadaka in JASA, June ''99.\r\nJoint w/2161', NULL, 2123, 0),
(12718, 3, 'An Elementary Introduction to Mathematical Finance: Options and other Topics (2nd ed.)', 'Sheldon M. Ross', 2003, 'New York, NY: Cambridge University Press', 'Mathematically elementary introduction to the Black-Scholes theory of options and related topics.', 9351, NULL, NULL, NULL, 2124, 0),
(12719, 3, 'Remarkable Mathematicians: from Euler to von Neumann', 'Ioan James', 2002, 'New York, NY: Cambridge University Press', '60 mathematicians, several (Gauss, Poisson, Dirichlet,...) of particular interest to statisticians.', 9352, NULL, NULL, NULL, 2125, 0),
(12720, 3, 'A First Course in Linear Model Theory', 'Nalini Ravishanker and Dipak K. Dey', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Designed for a 2-semester graduate course. Chapters on matrix algebra, the general linear model, multivariate normal, fixed-,random-, and mixed-effects models, and various special topics.', 9353, NULL, 'Russ suggests reassigning this review to JASA. Note to reviewer and AE 3/17/03.', NULL, 2126, 0),
(12721, 3, 'Duelling Idiots and Other Probability Puzzlers', 'Paul J. Nahin', 2000, 'Princeton, NJ: Princeton University Press', '21 probability puzzles, ranging from randomized-response surveys to critical-path analysis. Separate chapter gives solutions. Emphasis on simulations; there is an appendix on random-number generation, and another one with Matlab programs related to the puzzles.', 9354, NULL, 'Cleary suggests joint w/2096', NULL, 2127, 0),
(12722, 3, 'Nonlinear Dynamics: A Primer', 'Alfredo Medio and Marji Lines', 2001, 'New York, NY: Cambridge University Press', 'Nonlinear dynamical systems in discrete and continuous time. The first eight chapters cover geometric aspects; statisticians may be more interested in the last two chapters on the ergodic approach and stochastic processes.', 9355, NULL, NULL, NULL, 2128, 0);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(12723, 3, 'Stochastic Integration with Jumps', 'Klaus Bichteler', 2002, 'New York, NY: Cambridge University Press', 'Develops the theory of stochastic integration for both integrators (semimartingales) and random measures. Provides a rigorous treatment aimed at serious students and researchers in fields where stochastic differential equations are used.', 9356, NULL, NULL, NULL, 2129, 0),
(12724, 3, 'Finite Markov Chains and Algorithmic Applications', 'Olle Häggström', 2002, 'New York, NY: Cambridge University Press', 'Lecture notes at advanced undergraduate or graduate level. Theory of Markov chains, and applications including MCMC, simulated annealing, and the Propp-Wilson algorithm.', 9357, NULL, NULL, NULL, 2130, 0),
(12725, 3, 'Hadrons and Quark-Gluon Plasma', 'Jean Letessier and Johann Rafelski', 2002, 'New York, NY: Cambridge University Press', NULL, 9358, NULL, NULL, NULL, 2131, 0),
(12726, 3, 'Data Analysis for the Behavioral Sciences Using SPSS', 'Sharon Lawner Weinberg and Sarah Knapp Abramowitz', 2002, 'New York, NY: Cambridge University Press', 'Introductory text that emphasizes SPSS. In addition to standard topics (through multiple regression and two-way ANOVA), there seems to be more than the usual amount of emphasis on transformation and sampling. Sizable data sets are included on the floppy disk.', 9359, NULL, NULL, NULL, 2132, 0),
(12727, 3, 'Randomization in Clinical Trials: Theory and Practice', 'William F. Rosenberger and  John M. Lachin', 2002, 'New York, NY: Wiley', 'Claims to be the first all-encompassing sourcebook on randomization and randomization-based inference in clinical trials. Includes covariate-adaptive and response-adaptive methods, bias reduction, and philosophical discussion. Each chapter includes exercises and references.', 9360, NULL, 'Randomization in Clinical Trials Rosenberger', NULL, 2133, 0),
(12728, 3, 'Statistical Methods for the Analysis of Biomedical Data (2nd ed.)', 'Robert F. Woolson and William R. Clarke', 2002, 'New York, NY: Wiley', 'Standard statistical methods including t tests and CIS, contingency tables, rank methods, and survival analysis. Second edition cones 15 years after the first, with an additional author. Main changes from 1st edition are more exercises, SAS appendices for each chapter, diagnostics, and multiple linear and logistic regression.', 9361, NULL, '1st ed. Review author[s]: Richard G. Cornell\r\nJournal of the American Statistical Association, Vol. 84, No. 408. (Dec., 1989), p. 1097.', NULL, 2134, 0),
(12729, 3, 'Methods of Multivariate Statistics', 'M. S. Srivastava', 2002, 'New York, NY: Wiley', 'Standard multivariate normal-theory methods such as Hotelling t^2 and MANOVA, Principal components and discrimination. Also claims additional coverage not found in other texts of missing data, growth curves, bootstrap methods, predictions, outliers, and singular covariance matrices.', 9362, NULL, NULL, NULL, 2135, 0),
(12730, 3, 'Statistical Computing: An Introduction to Data Analysis using S-Plus', 'Michael J. Crawley', 2002, 'New York, NY: Wiley', 'Touts itself as an introductory statistics book, but contains no exercises and discusses many topics not usually considered at an introductory level, including split-plots, nonlinear regression, tree models, and mixed models. Looks most useful as an S-Plus supplement to some other text.', 9363, NULL, NULL, NULL, 2136, 0),
(12731, 3, 'Statistical Process Control: The Deming Paradigm and Beyond (2nd ed.)', 'J. R Thompson and J. Koronacki', 2001, 'Boca Raton, FL: CRC Press', 'About 25% longer than the first edition. The title is changed. There are new materials on management response to process variability, capability, Pareto and cause-effect diagrams, Bayesian methods, bootstrap, the seven tools, and multivariate SPC.', 9364, NULL, NULL, NULL, 2137, 0),
(12732, 3, 'Multivariate Dispersion, Central Regions and Depth: The Lift Zonoid Approach', 'Karl Mosler', 2002, 'New York : Springer-Verlag', 'This book concerns a new representation of probability measures. It is claimed to be useful in describing multivariate empirical distributions, stochastic orders, and nonparametric tests. There are two introductory chapters and seven on methods and applications. Chapter 5 is written by Rainer Dyckerhoff; it is a mystery why he is not named as a co-author of the book.', 9365, NULL, NULL, NULL, 2138, 0),
(12733, 3, 'Applied Functional Data Analysis: Methods and Case Studies', 'J. O. Ramsay and B. W. Silverman', 2002, 'New York: Springer-Verlag', 'These authors wrote the book on FDA in 1997. This book presents a number of case studies where FDA is used. Applications include criminology, economics, human biology and health, handwriting analysis, speech, and juggling.', 9366, NULL, 'Retired 11/12/08 per Dalene', NULL, 2139, 0),
(12734, 3, 'Applied Multivariate Analysis', 'Neil H. Timm', 2002, 'New York: Springer-Verlag', 'Textbook having as a prerequisite courses in methods, regression, and experimental design. Emphasis on SAS. Chapters on matrix theory, multivariate regression, SUR, random and mixed models, discrimination, principal components and factor analysis, clustering, and structural equation models. There are exercises in just about every section.', 9367, NULL, NULL, NULL, 2140, 0),
(12735, 3, 'The Basics of S-PLUS (3rd ed.)', 'Andreas Krause and Melvin Olson', 2002, 'New York: Springer-Verlag', 'Updates the previous editions to cover S-Plus version 6. More emphasis on trellis graphics, GUIs, export formats, and also new developments in R.', 9368, NULL, NULL, NULL, 2141, 0),
(12736, 3, 'The Analysis and Interpretation of Multivariate Data for Social Scientists', 'David J Bartholomew, Fiona Steele, Irini Moustaki, and J. I. Galbraith (Eds.)', 2002, 'Boca Raton, FL: Chapman & Hall/CRC', NULL, 9369, NULL, NULL, NULL, 2142, 0),
(12737, 3, 'Introduction to Nonparametric Item Response Theory', 'Klaas Sijtsma and Ivo W. Molenaar', 2002, 'Thousand Oaks, CA : Sage Publications', 'Chapters on models for mental measurement, IRT philosophy, the monotone homogeneity model, automated item selection, double monotonicity model, and polytomous item scores. Uses the MSP software. Each chapter has exercises.', 9370, NULL, 'Lund wants to ask Brian Habing at South Carolina to review it.', NULL, 2143, 0),
(12738, 3, 'An R and S-Plus Companion to Applied Regression', 'John Fox', 2002, 'Thousand Oaks, CA: Sage Publications', 'Designed as a companion to a regression text of given choice. Covers R version 1.3 and S4 (S-Plus 6.0). Methods for data manipulation, exploring, linear models, diagnostics, graphics, and programming.', 9371, NULL, NULL, NULL, 2144, 0),
(12739, 3, 'Doing Statistics With SPSS', 'Alistair W. Kerr, Howard K. Hall, and Stephen A. Kozub', 2002, 'Thousand Oaks, CA: Sage Publications', 'I’m not sure what this is. It doesn’t seem to be an SPSS supplement to an introductory statistics course. It doesn’t have enough exposition or problems to be a textbook. Chapters on standard topics through ANOVA and multiple regression.', 9372, NULL, NULL, NULL, 2145, 0),
(12740, 3, 'Interpreting Quantitative Data', 'David Byrne', 2002, 'Thousand Oaks, CA: Sage Publications', 'Sociology emphasis. Topics include measurement, using official statistics, social surveys, probabilistic reasoning, exploration and description, linear models (incl. path analysis, latent variables, and log-linear models), neural nets, and issues of meaning and cause.', 9373, NULL, NULL, NULL, 2146, 0),
(12741, 3, 'Health Science Research: A Handbook of Quantitative Methods', 'Jennifer Peat', 2002, 'Thousand Oaks, CA: Sage Publications', 'Strong emphasis on planning. Chapter topics are literature review, study design, measurements, sample size, conducting the study, analysis, reporting, and appraising. There are nine contributors, some of their roles are unclear.', 9374, NULL, NULL, NULL, 2147, 0),
(12742, 3, 'Hierarchical Linear Models: Applications and Data Analysis Methods', 'Stephen W. Raudenbush and Anthony S. Bryk', 2001, 'Thousand Oaks, CA: Sage Publications', 'This second edition adds 5 new chapters on hierarchical generalized linear models, latent variables, cross-classified random effects, Bayesian inference, and estimation theory.', 9375, NULL, NULL, NULL, 2148, 0),
(12743, 3, 'Logit and Probit: Ordered and Multinomial Models', 'Vani Kant Borooah', 2002, 'Thousand Oaks, CA: Sage Publications', 'Estimation, simulation, and interpretation of multiple-outcome models, ordered and unordered. Primary application emphasis is on socioeconomic inequality.', 9376, NULL, NULL, NULL, 2149, 0),
(12744, 3, 'Metropolitics: A Regional Agenda for Community and Stability (rev.)', 'Myron Orfield', 1997, 'Washington, DC: The Brookings Institution', NULL, 9377, NULL, NULL, NULL, 2150, 0),
(12745, 3, 'Clinical Drug Trials and Tribulations (2nd ed., rev. and expanded)', 'Allen Cato, Lynda Sutton, and Allen Cato, III (Eds.)', 2002, 'New York: Marcel Dekker', 'Articles relating to issues with drug development, from preclinical drug discovery to drug withdrawals. Some articles look interesting for their statistical content, but perhaps its best benefit for a statistician in the pharmaceutical industry is its overview of the whole process.', 9378, NULL, NULL, NULL, 2151, 0),
(12746, 3, 'Visualizing Statistical Models and Concepts', 'R. W. Farebrother', 2002, 'New York, NY: Marcel Dekker', 'This is not a book on statistical graphics. Instead, it presents geometric or visual interpretations of various statistical methods, including least squares, least absolute values, minimax absolute deviation, least median of squared deviations, etc.', 9379, NULL, NULL, NULL, 2152, 0),
(12747, 3, 'Categorical Data Analysis (2nd ed.)', 'Alan Agresti', 2002, 'Hoboken, NJ: Wiley', 'Over 10 years since the first edition. Changes include a new introductory chapter. Use of generalized linear models as a unifying concept, more emphasis on logistic regression and fits extensions, three new chapters on clustered, correlated categorical data, historical developments, and more material on exact methods.', 9380, NULL, '1st ed rev by Joseph Fleiss in JASA 86, 1991.', NULL, 2153, 0),
(12748, 3, 'Consumer Panels (2d ed.)', 'Seymour Sudman and Brian Wansink', 2001, 'Chicago: American Marketing Association', 'Chapters on leveraging a panel, uses of consumer panels, bias, data collection, improving accuracy and reporting, accidental conditioning of a panel (the Hawthorne effect), processing the data, costs, choosing a service, convenience panels, and the future.', 9381, NULL, NULL, NULL, 2154, 0),
(12749, 3, 'The Topology of Chaos: Alice in Stretch and Squeezeland', 'Robert Gilmore, Marc Lefranc', 2002, 'New York: John Wiley', NULL, 9382, NULL, NULL, NULL, 2155, 0),
(12750, 3, 'The Inquisitive Problem Solver', 'Paul Vaderlind, Richard Guy, and Loren Larson', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9383, NULL, NULL, NULL, 2156, 0),
(12751, 3, 'Model Selection and Multimodel Inference: A Practical Information-Theoretic Approach (2nd ed.)', 'Kenneth P. Burnham and David R. Anderson', 2002, 'New York : Springer-Verlag', 'First edition was published in 1998. Changes include cosmetic ones; re-organization of topics; new technical material in chapters 5 and 6 (they don’t say what in the preface); and about 100 new literature references.', 9384, NULL, NULL, NULL, 2157, 0),
(12752, 3, 'Matrix Calculus and Zero-One Matrices: Statistical and Econometric Applications', 'Darrell A. Turkington', 2002, 'New York, NY: Cambridge University Press', 'The author has worked out a view of classical statistical methods on econometrics that involves what he calls a shifting matrix. There are chapters on the matrix theory required, and on the use of it in linear regression, seemingly unrelated regression equations, and linear simultaneous equations models.', 9385, NULL, NULL, NULL, 2158, 0),
(12753, 3, 'Applied Latent Class Analysis', 'Jacques A. Hagenaars, Allan L. McCutcheon (Eds.)', 2002, 'New York, NY: Cambridge University Press', '15 chapters by 24 contributors. Two introductory chapters by Leo Goodman and Allan McCutcheon. Remaining chapters are organized in three sections: Classification and Measurement, causal analysis and dynamic models, and unobserved heterogeneity and non-response. Includes integrated indexes of notation, authors, and subjects, and web resources for data sets and other materials.', 9386, NULL, NULL, NULL, 2159, 0),
(12754, 3, 'Panel Data Econometrics: Methods-of-Moments and Limited Dependent Variable', 'Myoung-jae Lee', 2002, 'San Diego, CA: Academic Press', 'Highlights semiparametric approaches for panel data. Chapters on method of moments, panel linear models, binary responses, limited responses, and sample selection. Included floppy disk contains data sets and GAUSS program', 9387, NULL, NULL, NULL, 2160, 0),
(12755, 3, 'The A to Z of Mathematics: A Basic Guide', 'Thomas H. Sidebotham', 2002, 'New York, NY: John Wiley', 'This is kind of a dictionary of mathematics. It includes entries for some statistical terms such as "standard deviation," "frequency polygon," and "normal distribution."', 9388, NULL, 'Joint with 2123; changed to separate reviews', NULL, 2161, 0),
(12756, 3, 'Regression Models for Time Series Analysis', 'Benjamin Kedem and Konstantinos Fokianos', 2002, 'New York, NY: John Wiley', 'Emphasis is on extending the theory of generalized linear models to time series where the response and/or predictors are dependent. Chapter topics include binary and categorical time series, count time series, alternative approaches such as integer autoregressive models, state-space models, and prediction.', 9389, NULL, NULL, NULL, 2162, 0),
(12757, 3, 'The Millenium Problems: The Greatest Unsolved Mathematical Puzzles of Our Time', 'Keith Devlin', 2002, 'New York, NY: Basic Books', NULL, 9390, NULL, 'We were sent an advance uncorrected proof copy.\r\nPublished copy arrived in October 2002', NULL, 2163, 0),
(12758, 3, 'SAS for Linear Models (4th ed.)', 'Ramon C. Littell, Walter W. Stroup, and Rudolf J. Freund', 2002, 'Cary, NC: SAS Institute', 'Additions since the third edition (over 10 years ago) obviously include a list of material on PROC MIXED and PROC GENMOD. Chapter topics include regression, ANOVA (balanced data), random effect, unbalanced data, linear models, covariate, repeated measures, multivariate models, generalized linear models, and special examples.', 9391, NULL, '3rd ed. reviewed by Berk, JASA 87, 1992', NULL, 2164, 0),
(12759, 3, 'Applied Multiple Regression/Correlation Analysis for the Behavioral Sciences (3rd ed.)', 'Jacob Cohen, Patricia Cohen, Stephen G. West, and Leona S. Aiken', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'This comes 19 years after the second edition, with two new authors (and the death of the first). The selling points are supposed to be an emphasis on regression as a more general tool than ANOVA, and a more descriptive approach than has been the case in the social sciences of the past. There are standard topics in linear regression, transformation, categorical predictions, colinearity and diagnostics, causal models, generalized linear models, generalized linear models, random coefficients, longi', 9392, NULL, '2nd ed reviewed by Geoffrey T. Fong, JASA 80, 1985.', NULL, 2165, 0),
(12760, 3, 'Configural Frequency Analysis: Methods, Models, and Applications', 'Alexander von Eye', 2002, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'CFA is a method for comparing categorical or longitudinal data with expectations. It claims to be the only method that allows inferences for empty areas of the data space. The book contains chapters on basic models and tests, longitudinal models, the CFA specialty file, and computational issues.', 9393, NULL, 'We were sent the paperback edition.', NULL, 2166, 0),
(12761, 3, 'A Manager''s Guide to the Design and Conduct of Clinical Trials', 'Phillip I. Good', 2002, 'New York, NY: John Wiley', 'Claims to be the first practical guide to the subject that avoids technical jargon. Includes step-by-step guidance with checklists and extracts of protocols. The three basic sections--"Plan," "Do," and "Check," include materials on staffing, sample size, budgeting, handling exceptions, recruiting subjects, data management, monitoring, analysis, and review.', 9394, NULL, 'A Manager''s Guide to the Design and Conduct of Clinical Trials', NULL, 2167, 0),
(12762, 3, 'Likelihood, Bayesian and MCMC Methods in Quantitative Genetics', 'Daniel Sorensen and Daniel Gianola', 2002, 'New York, NY: Springer-Verlag', 'This book is directed towards "numerate biologists and applied statisticians."  It covers a review of distribution theory, likelihood and Bayesian inference and the EM algorothm, and the foundations of MCMC methods.  Applications in quantitative genetics including Gaussian and thick-tailed linear models, threshhold models for categorical responses, longitudinal data, and segregation and quantitative trait loci analysis.', 9395, NULL, 'reassigned as 7038', NULL, 2168, 0),
(12763, 3, 'Elements of Computational Statistics', 'James E. Gentle', 2002, 'New York, NY: Springer-Verlag', 'This volume is the third in a series of computation-related books by this author.  Topics include Monte Carlo, randomization and data partitioning, bootstrap, data mining, graphical methods, density estimation, multivariate methods, and models for dependency.', 9396, NULL, NULL, NULL, 2169, 0),
(12764, 3, 'Growth Curve Models With Statistical Diagnostics', 'Jian-Xin Pan and Kai-Tai Fang', 2002, 'New York, NY: Springer-Verlag', 'Growth-curve models are useful in modeling longitudinal data.  Book includes comprehensive theory of these models, diagnostics, estimation, inference, and outlier detection.  Intended audience is postgraduate level.', 9397, NULL, 'As of 11/29/04, Gentleman has gotten no response from reviewer', NULL, 2170, 0),
(12765, 3, 'Statistical Matching: A Frequentist Theory, Practical Applications and Alternative Bayesian Approaches', 'Susanne Rässler', 2002, 'New York: Springer', 'This is a revised version of the author''s habilitation thesis.  It concerns problems that occur when no single data source contains all the information of interest; hence, respondents in one survey are matched with to those in another, based on common characteristics.  A theoretical framework is developed, the history and applications are discussed, and alternatives are proposed.', 9398, NULL, NULL, NULL, 2171, 0),
(12766, 3, 'Statistical Analysis With Missing Data (2nd ed.)', 'Roderick J. A. Little and Donald B. Rubin', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'This comes 15 years after the first edition.  There are new materials, especially in Bayesian analysis.  There is also more emphasis on multiple imputation. The authors kindly provide a road map showing where to find topics from the first edition.', 9399, NULL, NULL, NULL, 2172, 0),
(12767, 3, 'Recurrent Events Data Analysis for Product Repairs, Disease Recurrences, and Other Applications', 'Wayne B. Nelson', 2003, 'Philadelphia, PA: SIAM', 'Traditional reliability models concern simple life distributions where each sample unit has a single lifetime. This book is about recurrent events, such as repairs on machines. Topics include models and MCFs, estimates and confidence limits for exact and interval age data, analysis of a mix of events, and comparison of samples.', 9400, NULL, 'Reviewer suggested by SIAM editor: Gordon Johnston at SAS Inst. We received 1st proofs in 2002, the book Feb. 11, 2003.', NULL, 2173, 0),
(12768, 3, 'Statistical Analysis of Designed Experiments (2nd ed.)', 'Helge Toutenburg, with contributions by Thomas Nittner', 2002, 'New York, NY: Springer-Verlag', 'Chapter topics include two-sample comparisons, linear regression, single-factor experiments (fixed and random effects), blocking, multifactor experiments, categorical responses, repeated measures, crossovers, incomplete data, and appendices on matrix algebra and proofs.  Not very many excercises compared with most textbooks at this level.', 9401, NULL, NULL, NULL, 2174, 0),
(12769, 3, 'Logistic Regression: A Self-Learning Text (2nd ed.)', 'David G. Kleinbaum and Mitchel Klein', 2002, 'New York, NY: Springer-Verlag', 'Expanded from the first (1994) edition by the addition of chapters on polytomous logistic regression, ordinal regression, GEEs, and other approaches for correlated data.', 9402, NULL, '1st edition reviewed in JASA , Vol. 91, No. 433., by Steve Selvin', NULL, 2175, 0),
(12770, 3, 'Estimating Animal Abundance: Closed Populations', 'David Borchers, Stephen T. Buckland,  and Walter Zucchini', 2002, 'New York, NY: Springer-Verlag', 'Presents a new approach that unifies the many closed- and open-population methods within a general framework. All but one chapter is devoted to closed populations. Topics include likelihood-based methods, plot sampling, removal, recapture, and distance sampling, plus advanced methods involving spatial/temporal models and dynamic models. Accompanying R-based software is available on the Web.', 9403, NULL, NULL, NULL, 2176, 0),
(12771, 3, 'A Distribution-Free Theory of Nonparametric Regression', 'László Gyoerfi, Michael Kohler, Adam Krzyzak, and Harro Walk', 2002, 'New York, NY: Springer-Verlag', 'In-depth coverage of nonparametric regression with random design, including local averaging, splines, neural networks, radial basis functions, kernel estimates, and orthogonal series estimates.', 9404, NULL, NULL, NULL, 2177, 0),
(12772, 3, 'Case Studies in Bayesian Statistics, Volume VI (Lecture Notes in Statistics, no. 167)', 'Constantine Gatsonis, Robert E. Kass,  Alicia Carriquiry, Andrew Gelman, David Higdon, Donna K. Pauler, and Isabella Verdinelli (Eds.)', 2002, 'New York, NY: Springer-Verlag', 'Collected papers from the 6th Workshop on Case Studies in Bayesian Statistics, held at Carnegie-Mellon University in September, 2001. Three invited papers (with discussion) and 16 contributed papers.', 9405, NULL, NULL, NULL, 2178, 0),
(12773, 3, 'Modern Applied Statistics with S (4th ed.)', 'W. N. Venables and B. D. Ripley', 2002, 'New York, NY: Springer-Verlag', 'This is the fourth edition of a book that originally appeared in 1994.  The title is shortened from "S-Plus" to "S" reflecting a more general emphasis on all flavors of S (including R).', 9406, NULL, NULL, NULL, 2179, 0),
(12774, 3, 'Algorithms for Worst-Case Design and Applications to Risk Management', 'Berç Rustem and Melendres Howe', 2002, 'Princeton, NJ: The Princeton University Press', 'Topics include minimax, saddlepoint algorithms, quasi Newton algorithms, numerical experiments, discrete rival scenarios, options hedging, asset-allocation problems, asset/liability management, and currency management.', 9407, NULL, NULL, NULL, 2180, 0),
(12775, 3, 'The Statistical Analysis of Failure Time Data (2nd ed.)', 'John D. Kalbfleisch and Ross L. Prentice', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'It has been over two decades since the publication of the first edition of this classic book. The new edition develops results in multivariate failure-time data, extends the material on Markov and semi Markov formulations, and expands and updates the chapter on special topics and examples.', 9408, NULL, '1st edition reviewed in JASA in 1982', NULL, 2181, 0),
(12776, 3, 'Elements of Applied Stochastic Processes (3rd ed.)', 'U. Narayan Bhat and Gregory K. Miller', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Nearly 20 years since the second edition, this new edition has an additional author.  Includes two chapters devoted to applications published in journal articles, plus new materials on inference, queues, simulation, and Markov chain Monte Carlo.', 9409, NULL, NULL, NULL, 2182, 0),
(12777, 3, 'The Politics of Large Numbers: A History of Statistical Reasoning', 'Alain Desrosières, translated by Camille Naish', 2002, 'Cambridge, MA: Harvard University Press', 'Originally published in French in 1993. Desrosières expounds on the impact of governments on the evolution of modern statistics.', 9410, NULL, NULL, NULL, 2183, 0),
(12778, 3, 'USA and International Mathematical Olympiads 2001', 'Titu Andreescu and Zuming Feng (Eds.)', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9411, NULL, NULL, NULL, 2184, 0),
(12779, 3, 'Mathematical Apocrypha: Stories and Anecdotes of Mathematicians and the Mathematical', 'Steven G. Krantz', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9412, NULL, NULL, NULL, 2185, 0),
(12780, 3, 'Green, Brown, and Probability & Brownian Motion on the Line', 'Kai Lai Chung', 2002, 'River Edge, NJ: World Scientific Publishing Co., Inc.', 'This is a combination of two books.  The first part is a secind edition of Chung''s 1995 work.  The second comprises lecture notes based on a short course on Brownian motion that the author gave at Stanford University.  Includes exercises.', 9413, NULL, NULL, NULL, 2186, 0),
(12781, 3, 'Cause and Correlation in Biology: A User''s Guide to Path Analysis, Structural Equations and Causal Inference', 'Bill Shipey', 2002, 'New York, NY: Cambridge University Press', NULL, 9414, NULL, 'paperback with corrections of 8918', NULL, 2187, 0),
(12782, 3, 'Matrix Algebra and Its Applications to Statistics and Econometrics', 'C. Radhakrishna Rao and M. Bhaskara Rao', 1998, 'River Edge, NJ: World Scientific Publishing Co., Inc.', NULL, 9415, NULL, 'Unsolicited review. We didn''t have the book.', NULL, 2188, 0),
(12783, 3, 'Ergodic Theory of Numbers', 'Karma Dajani and Cor Kraaikamp', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9416, NULL, NULL, NULL, 2189, 0),
(12784, 3, 'Cross-over Trials in Clinical Research (2nd ed.)', 'Stephen Senn', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'First ed. not reviewed in JASA.  Materials on the AB/BA design and designs for three or more treatments - normal theory, nonparametric, and categorical models; special designs such as incomplete blocks; graphical and tabular presentation; design issues; and estimating carry-over effects.', 9417, NULL, NULL, NULL, 2190, 0),
(12785, 3, 'Basic Statistics and Data Analysis (with InfoTrac and CD-ROM) (1st ed.)', 'Larry J. Kitchens', 2003, 'Pacific Grove, CA: Brooks/Cole Publishing Company', 'One of 3 intro stats texts from Duxbury', 9418, NULL, 'Joint review of 2191, 2195, 2196', NULL, 2191, 0),
(12786, 3, 'Data Monitoring Committees in Clinical Trials: A Practical Perspective', 'Susan S. Ellenberg, Thomas R. Fleming, and David L. DeMets', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Intended to be an authoritative guide to the establishment, purpose, and responsibilities of data-monitoring committees for clinical trials and other human-subjects studies.  Chaper topics include responsibilities, composition, independence, confidentiality, meetings and interactions, statistical and ethical issues, determining when a committee is needed, and regulatory issues.', 9419, NULL, NULL, NULL, 2192, 0),
(12787, 3, 'A Course in Financial Calculus', 'Alison Etheridge', 2002, 'Cambridge, UK : Cambridge University Press', 'Self-contained text covers martingales, Brownian motion, stochastic calculus, the Black-Scholes pricing formula, and several advanced topics.  Includes exercises.', 9420, NULL, 'We received paperback.', NULL, 2193, 0),
(12788, 3, 'Data Mining: Concepts, Models, Methods, and Algorithms', 'Mehmed Kantardzic', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Chapter topics include concepts, data preparation, data reduction, learning from data, statistical methods (e.g., regression, discrimination, Bayesian methods), clustering, trees, association rules, neural networks, genetic algorithms, fuzzy logic, visualization; plus appendices on software and applications.', 9421, NULL, NULL, NULL, 2194, 0),
(12789, 3, 'Introduction to Probability and Statistics (11th ed.)', 'William Mendenhall, Robert Beaver, and Barbara Beaver', 2003, 'Pacific Grove, CA: Brooks/Cole Publishing Company', 'One of 3 intro stats texts from Duxbury', 9422, NULL, 'Joint review of 2191, 2195, 2196', NULL, 2195, 0),
(12790, 3, 'Just the Essentials of Elementary Statistics (3rd ed.)', 'Robert Johnson and Patricia Kuby', 2003, 'Pacific Grove, CA: Brooks/Cole Publishing Company', 'One of 3 intro stats texts from Duxbury', 9423, NULL, 'Joint review of 2191, 2195, 2196', NULL, 2196, 0),
(12791, 3, 'Bayesian Methods: A Social and Behavioral Sciences Approach', 'Jeff Gill', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Aimed at graduate students in the social sciences.  Chapters on modeling, normal models, priors, assessing model quality, Bayesian hypothesis testing, Monte Carlo and MCMC methods, Bayesian hierarchical models, and other issues such as convergence assessment.  Emphasizes the computer programs R and BUGS.', 9424, NULL, NULL, NULL, 2197, 0),
(12792, 3, 'Data Analysis & Decision Making with Microsoft Excel (2nd ed.)', 'S. Christian Albright, Wayne Winston, Christopher J. Zappe', 2003, 'Pacific Grove, CA: Brooks/Cole Publishing Company', NULL, 9425, NULL, 'Cleary may do this joint with other business/econ books\r\njoint with 2199?', NULL, 2198, 0),
(12793, 3, 'Statistics for Management and Economics (6th ed.)', 'Gerald Keller and Brian Warrack', 2003, 'Pacific Grove, CA: Brooks/Cole Publishing Company', NULL, 9426, NULL, 'Joint with 2198?', NULL, 2199, 0),
(12794, 3, 'Spatial Cluster Modelling', 'Andrew B. Lawson and David G. T. Denison (Eds.)', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Fourteen chapters by invited authors; organized in 2 main parts: point process cluster modelling and spatial process cluster modelling. Integrated bibliography, author index, and subject index.', 9427, NULL, NULL, NULL, 2200, 0),
(12795, 3, 'Topics in Modelling of Clustered Data', 'Marc Aerts, Helea Geys, Geert Molenberghs, and Louise M. Ryan (Eds.)', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Fifteen chapters and an appendix by 12 invited contributors.  Focus is on modeling of data from toxicological experiments and developmental toxicity studies.  Includes integrated bibliography and index.', 9428, NULL, NULL, NULL, 2201, 0),
(12796, 3, 'Design and Analysis of Quality of Life Studies in Clinical Trials', 'Diane L. Fairclough', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Focuses on the unique measurement and analysis issues associated with health-related quality-of-life studies.  Chapters on study design, longitudinal studies, missing data (including ignorable missingness, simple imputation, and multiple imputation), pattern mixture models, random-effects models, summary measures, multiple endpoints, and analysis plans.', 9429, NULL, NULL, NULL, 2202, 0),
(12797, 3, 'Subset Selection in Regression (2nd ed.)', 'Alan Miller', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Emphasizes model selection for linear models and understanding and correcting bias. Chapters on least-squares computations, algorithms, testing, stopping rules, estimation, and Bayesian methods.', 9430, NULL, NULL, NULL, 2203, 0),
(12798, 3, 'Martingales and Markov Chains: Solved Exercises and Elements of Theory', 'Paolo Baldi, Laurent Mazliak, and Pierre Priouret', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'This book is aimed at senior undergraduates and graduate students.  It contains about 100 exercises, along with detailed solutions.  They are organized in four sections: conditional expectations, stochastic processes, martingales, and Markov chains.', 9431, NULL, 'reassigned to JASA per Embrechts 12/13/02', NULL, 2204, 0),
(12799, 3, 'Multilevel Modeling: Methodological Advances, Issues, and Applications', 'Steven P. Reise and Naihua Duan (Eds.)', 2002, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'Consists of 13 chapters from invited authors on new approaches to such topics as nonlinear multilevel models, meta-analysis, and outliers in longitudinal growth models. Includes integrated author and subject indexes.', 9432, NULL, NULL, NULL, 2205, 0),
(12800, 3, 'Cross-Cultural Survey Methods', 'Janet A. Harkness, Fons J. R. Van de Vijver, and Peter Ph. Mohler (Eds.)', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Collection of papers presented at the third ZUMA Symposium on Cross-Cultural Survey Methods. 21 articles organized in 5 parts.  Includes integrated bibliography (40 pages), author index, and subject index.', 9433, NULL, NULL, NULL, 2206, 0),
(12801, 3, 'Usa-I, Forum for Interdisciplinary Mathematics Proceeding on Statistics, Combinatorics, and Related Areas ( Vol. I of Proceedings of Univ. of South Alabama)', 'Satya N. Mishra', 2001, 'Syracuse, NY: American Sciences Press', NULL, 9434, NULL, 'we got the journal version, but there is also a cloth book', NULL, 2207, 0),
(12802, 3, 'The William Lowell Putnam Mathematical Competition 1985-2000: Problems, Solutions, and Commentary', 'Keran S. Kedlaya, Bjorn Poonen, and Ravi Vakil', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9435, NULL, NULL, NULL, 2208, 0),
(12803, 3, 'Principal Component Analysis (2nd ed.)', 'I. T. Jolliffe', 2002, 'New York, NY: Springer-Verlag', 'Intended as a comprehensive text that requires knowledge of matrix algebra as a prerequisite. Topics include properties of population and sample PCs, interpretation, graphical representation, choosing a subset, relation to factor analysis and other multivariate techniques, use in regression analysis, outliers and robustness, special cases such as time-series data or discrete data, and generalizations.', 9436, NULL, NULL, NULL, 2209, 0),
(12804, 3, 'Changing Core Mathematics', 'Chris Arney and Donald Small (Eds.)', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9437, NULL, NULL, NULL, 2210, 0),
(12805, 3, 'Exact Expressions of Expectations for the Statistics by Random  Subsamples from a Finite Population', 'Yoshiaki Funatsu', 2002, 'Tokyo: Self-published', NULL, NULL, NULL, NULL, NULL, 2211, 0),
(12806, 3, 'Usa-I, Forum for Interdisciplinary Mathematics Proceeding on Statistics, Combinatorics, and Related Areas ( Vol. 2 of Proceedings of Univ. of South Alabama Conf.)', 'Satya N. Mishra (Ed.)', 2002, 'Syracuse, NY: American Sciences Press', NULL, 9438, NULL, 'we got the journal version, but there is also a cloth book', NULL, 2212, 0),
(12807, 3, 'Generalized, Linear, and Mixed Models', 'Charles E. McCulloch and Shayle R. Searle', 2001, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Late arrival; no synopsis available at this time.', 9439, NULL, NULL, NULL, 2213, 0),
(12808, 3, 'Marketing to Moms: Getting Your Share of the Trillion-Dollar Market', 'Maria T. Bailey', 2002, 'Roseville, CA: Prima Publishing', NULL, 9440, NULL, NULL, NULL, 2214, 0),
(12809, 3, 'Essays in Econometrics: Collected Papers of Clive W. J. Granger (vol. 1)', 'Eric Ghysels, Norman R. Swanson, and Mark W. Watson (Eds.)', 2001, 'New York, NY: Cambridge University Press', 'Two papers on spectral analysis, 2 on seasonality, 5 on nonlinearity, 6 on methodology, 10 on forecasting. Separate bibliographies, integrated index (for each volume).', 9441, NULL, 'vol. 1 of 2. Joint with 2216 (vol 2)', NULL, 2215, 0),
(12810, 3, 'Essays in Econometrics: Collected Papers of Clive W. J. Granger (vol. 2)', 'Eric Ghysels, Norman R. Swanson, and Mark W. Watson (Eds.)', 2001, 'New York, NY: Cambridge University Press', 'Four papers on causality, 12 on integration and cointegration, 3 on long memory. Separate bibliographies, integrated index (for each volume).', 9442, NULL, 'vol. 2 of 2. Joint with 2215 (vol. 1)', NULL, 2216, 0),
(12811, 3, 'Real Analysis and Probability', 'R. M. Dudley', 2002, 'New York, NY: Cambridge University Press', NULL, 9443, NULL, NULL, NULL, 2217, 0),
