(12813, 3, 'Advances on Theoretical and Methodological Aspects of Probability and Statistics', '	N. Balakrisha (Ed.)', 2002, 'New York, NY: Taylor & Francis', 'Invited papers presented at the International Indian Statistical Association Conference, Oct. 10-11, 1998, McMaster University. 32 papers in 7 parts. There are integrated lists of tables and figures, but no combined bibliography or index.', 9445, NULL, 'Joint with 2218', NULL, 2219, 0),
(12814, 3, 'Geographically Weighted Regression: the Anaysis of Spatially Varying Relationships', 'A. Stewart Fotheringham, Chris Brusdon, Martin Chalton', 2002, 'Chichester, UK: Wiley', NULL, 9446, NULL, NULL, NULL, 2220, 0),
(12815, 3, 'Fifty Fathoms: Statistics Demonstrations for Deeper Understanding', 'Tim Erickson', 2002, 'Oakland, CA: eeps media', 'Fifty dynamic illustrations of statistical concepts such as sampling distributions, power, and the law of large numbers.  The underlying software, Fathom, is included on the accompanying CD-ROM.', 9447, NULL, 'Anderson-Cook suggests joint w/ 3004.', NULL, 2221, 0),
(12816, 3, 'A New Kind of Science', 'Stephen Wolfram', 2002, 'Champaign, IL: Wolfram Media, Inc.', 'A tome with lots of pictures that the author thinks will change the world.', 9448, NULL, 'with 2243 (Explorer)', NULL, 2222, 0),
(12817, 3, 'Ordinal Measurement in the Behavioral Science', 'Norman Cliff and John A. Keats', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', NULL, 9449, NULL, NULL, NULL, 2223, 0),
(12818, 3, 'Studying Individual Development in an Interindividual Context: A Person-Oriented Approach', 'Lars R. Bergman, David Magnusson, and Bassam M. El Khouri', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'Builds on work begun in 1988 by David Magnussen.  The idea is that studies of development that focus on variables and relationships tend to yield models that the authors claim ignore individuals.  They propose constructs and methods that focus on personal attributes.  Makes extensive reference to and use of a free computer package named SLEIPNER.', 9450, NULL, NULL, NULL, 2224, 0),
(12819, 3, 'ActivEpi 1.1 (2nd ed.)', 'David G. Kleinbaum', 2004, 'New York: Springer', 'A multimedia presentation of material commonly found in an introductory epidemiology course.  15 lessons and 50 hours of content.', 9451, NULL, 'Per email from MP 3/28/04, he has gotten a copy of the book from the publisher and they will also send him an updated copy of the CD.  Watch for changes in ISBN, etc.', NULL, 2225, 0),
(12820, 3, 'Nonparametric Goodness-of-Fit Testing Under Gaussian Models', 'Yu. I. Ingster and Irina A. Suslina', 2003, 'New York, NY: Springer-Verlag', 'Develops a modern theory of nonparametric goodness-of-fit tests, based on an asymptotic version of the minimax approach and asymptotically least-favorable priors.', 9452, NULL, 'assigned to Karr, but sent to Gentleman by mistake', NULL, 2226, 0),
(12821, 3, 'Block Designs: A Randomization Approach.  Volume II: Design', 'Tadeusz Calinski and Sanpei Kageyama', 2003, 'New York, NY: Springer-Verlag', NULL, 9453, NULL, NULL, NULL, 2227, 0),
(12822, 3, 'Power Analysis for Experimental Research: A Practical Guide for the Biological, Medical and Social Sciences', 'R. Barker Bausell and Yu-Fang Li', 2002, 'New York, NY: Cambridge University Press', 'Covers basic concepts, and methods for many standard t tests, simple ANOVA and ANCOVA models, and more complex designs.  Unfortunately, stress is placed on Cohen''s effect-size concepts, which lack scientific justification.', 9454, NULL, NULL, NULL, 2228, 0),
(12823, 3, 'Models for Investors in Real World Markets', 'James R. Thompson, Edward E. Williams, and M. Chapman Findlay, III', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Provides a new, antiefficient markets approach to investment theory and management.  Chapters on conventional building blocks, diversification and portfolio selection, equilibrium theories, the neoclassical fantasy, realistic paradigms, security analysis, empirical forecasting, real-world markets, and common stock options.  Appendices on statistical topics.', 9455, NULL, NULL, NULL, 2229, 0),
(12824, 3, 'Statistical Models and Methods for Lifetime Data (2nd ed.)', 'Jerald F. Lawless', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Expanded coverage of observation schemes, multiple failure modes, counting process tools, software, mixture models, interval-censored and truncated data, multivariate cases, and resampling.', 9456, NULL, '1st ed. reviewed by Asit Basu, JASA 80', NULL, 2230, 0),
(12825, 3, 'Random Probability Measures on Polish Spaces', 'Hans Crauel', 2002, 'New York: Taylor & Francis', 'The narrow topology of random probability measures on Polish spaces is investigated in a thorough and comprehensive way.  The results are applied to random dynamical systems.', 9457, NULL, NULL, NULL, 2231, 0),
(12826, 3, 'Stochastic Processes and Related Topics (proceedings of the 12th winter school, Siegmundsburg, Germany, February 27--March 4, 2000)', 'Rainer Buckdahn, Hans-Jurgen Engelbert, and Marc Yor (Eds.)', 2002, 'New York: Taylor & Francis', '13 articles on topics such as stochastic differential equations, integral functionals of martingales, diffusions, portfolio optimization, first passage times, and pricing options.  Integrated index.', 9458, NULL, NULL, NULL, 2232, 0),
(12827, 3, 'Mathematical Foundations of Classical Statistical Mechanics: Continuous Systems (2nd ed.)', 'D. Ya. Petrina, V. I. Gerasimenko, P. V. Malyshev', 2002, 'New York, NY: Taylor & Francis', NULL, 9459, NULL, NULL, NULL, 2233, 0),
(12828, 3, 'Stochastic Processes and Their Applications', 'Frank E. Beichelt, L. Paul Fatti', 2002, 'New York, NY: Taylor & Francis', 'Introductory text on stochastic processes.  Chapter topics include probability, Poisson processes, renewal processes, discrete- and continuous-time Markov chains, Wiener processes, and spectral analysis.  Many exercises, but selected answers in back take up 5 pages and omit two chapters.  Evidently a solutions manual is also available.', 9460, NULL, NULL, NULL, 2234, 0),
(12829, 3, 'Generalized Estimating Equations', 'James W. Hardin and Joseph M. Hilbe', 2002, 'Boca Raton, FL: CRC Press', 'Offers a complete treatment of GEE methods including GEE2, EGEE, ALR, and missing-value problems.  Additional topics include residual analysis and goodness of fit.  Software examples using SAS, Stata, SUDAAN, and S-Plus.', 9461, NULL, NULL, NULL, 2235, 0),
(12830, 3, 'Sample Survey Theory: Some Pythagorean Perspectives', 'Paul Knottnerus', 2003, 'New York: Springer', 'Describes a novel approach to the theory of sampling from finite populations, based on the sampling autocorrelation coefficient.  Organized in three main parts: sampling theory and autocorrelations, variance estimation in complex surveys, and minimum-variance estimators.', 9462, NULL, NULL, NULL, 2236, 0),
(12831, 3, 'Performance Optimization of Numerically Intensive Codes', 'Stephan Goedeker and Adolfy Hoisie', 2001, 'Philadelphia: SIAM', 'Tutorial-style treatment of all the essential ingredients for achieving high-performance computations on modern serial and parallel computers.', 9463, NULL, NULL, NULL, 2237, 0),
