(12833, 3, 'Wavelets: Tools for Science & Technology (2nd ed.)', 'Stéphanie Jaffard, Yves Meyer, and Robert D. Ryan', 2001, 'Philadelphia, PA: SIAM', NULL, 9465, NULL, 'see #8064', NULL, 2239, 0),
(12834, 3, 'Principles of Computerized Tomographic Imaging', 'Avinash C. Kak and Malcolm Slaney', 2001, 'Philadelphia, PA: SIAM', NULL, 9466, NULL, 'Copyright page notes that this "edition is an abridged republication of the work first published by IEEE...1988."', NULL, 2240, 0),
(12835, 3, 'Numerical Computing with IEEE Floating Point Arithmetic: Including One Theorem, One Rule of Thumb, and One Hundred and One Exercises', 'Michael L. Overton', 2001, 'Philadelphia: SIAM', 'Topics such as computer representation of real numbers, rounding, exceptions, Intel processors, conditioning, stability, and programming implications of all of these.  Intended to be accessible to students at all levels, but does not have exercises.', 9467, NULL, NULL, NULL, 2241, 0),
(12836, 3, 'Wonders of Numbers: Adventures in Mathematics, Mind, and Meaning', 'Clifford A. Pickover', 2001, 'New York, NY: Oxford University Press', NULL, 9468, NULL, NULL, NULL, 2242, 0),
(12837, 3, 'A New Kind of Science Explorer', 'Stephen Wolfram', 2002, 'Champaign, IL: Wolfram Media, Inc.', NULL, NULL, NULL, 'with 2222 (the book)', NULL, 2243, 0),
(12838, 3, 'Mathematics for the Imagination', 'Peter M. Higgins', 2002, 'New York: Oxford University Press', NULL, 9469, NULL, NULL, NULL, 2244, 0),
(12839, 3, 'Introductory Statistics with R', 'Peter Dalgaard', 2002, 'New York: Springer-Verlag', 'An introductory text by one of the main developers of R.  Chapters on using R, probability and distributions, one- and two-sample tests, regression and correlation, ANOVA, tabular data, power and sample size, multiple regression, linear models, logistic regression, and survival analysis.  There are a few exercises in each chapter.', 9470, NULL, NULL, NULL, 2245, 0),
(12840, 3, 'Applied Computational Economics and Finance', 'Mario J. Miranda and Paul L. Fackler', 2002, 'Cambridge, MA: MIT Press', 'First few chapters focus on numerical methods--linear and nonlinear systems of equations, optimization, quadrature, approximation.  Then there are chapters on (discrete|continuous)-time, (discrete|continuous)-state dynamic models and methods that form the substantive core of the book.  Computational emphasis is on Matlab.', 9471, NULL, NULL, NULL, 2246, 0),
(12841, 3, 'The Vehicle Routing Problem', 'Paolo Toth and Daniele Vigo (Eds.)', 2001, 'Philadelphia: SIAM', NULL, 9472, NULL, NULL, NULL, 2247, 0),
(12842, 3, 'More Games of No Chance', 'Richard J. Nowakowski (Ed.)', 2002, 'New York, NY: Cambridge University Press', NULL, 9473, NULL, NULL, NULL, 3000, 0),
(12843, 3, 'Foundations of Statistical Analysis and Applications with SAS', 'Michael Falk, Frank Marohn, and Bernward Tewes', 2002, 'Basel, Switzerland : Birkhauser Publishing Ltd.', 'Translation of text originally published in German in 1995.  Cover notes say that the book "addresses the students of statistics and mathematics in the first place."  Generally, the flavor is mathematical statistics plus application examples.', 9474, NULL, NULL, NULL, 3001, 0),
(12844, 3, 'Computational Statistics Handbook with MATLAB', 'Wendy Martinez and Angel R. Martinez', 2002, 'Boca Raton, FL: CRC Press', 'Intended as a supplement to upper-level statistics courses.  Computational topics in probability, sampling, random-variate generation, exploratory data analysis, Monte Carlo-based inference, jackknife and bootstrap, density estimation, pattern recognition, nonparametric regression, MCMC, and spatial statistics.  Several supporting appendices.', 9475, NULL, 'JASA June 2004', NULL, 3002, 0),
(12845, 3, '101 Special Practice Problems in Probability and Statistics', 'Paul D. Berger, Samuel C. Hanna, and Robert E. Maurer', 2003, 'Lombard, IL: Marsh Publications', 'Contains drill problems on various topics commonly studied in an introductory (not calculus-based) course--probability, standard distributions, central-limit theorem, confidence intervals, tests, regression (simple and multiple), chi-square tests.  Includes a "QuikData" floppy disk and "QuikRevu" flash cards.  Apparently the book''s goals do not extend to improving one''s spelling.', 9476, NULL, NULL, NULL, 3003, 0),
(12846, 3, 'CAST (Computer-Assisted Statistics Teaching)', 'W. Douglas Stirling', 2002, 'Palmerston North, New Zealand: Self', 'This is an interactive computer-based textbook that is accessed via a web browser.  It is claimed that every diagram is interactive.  The CD contains versions for general interest, biometrics, or business audiences.  A slightly different version is also available for Internet download.', NULL, NULL, NULL, NULL, 3004, 0),
(12847, 3, 'Modeling Financial Time Series with S-Plus', 'Eric Zivot and Jiahui Wang', 2003, 'New York, NY: Springer-Verlag', 'Aimed at individuals who work or study in financial econometrics.  Emphasizes the S+FinMetrics module for S-Plus.  Topics include S-Plus language, time-series concepts, extreme values, univariate and multivariate GARCH models, long-memory time series, vector autoregressive modelsstate-space models, change detection, and several others.  Intended as both a guide to the subject and to the software.', 9477, NULL, NULL, NULL, 3005, 0),
(12848, 3, 'Prediction in Forensic and Neuropsychology: Sound Statistical Practices', 'Ronald D. Franklin (Ed.)', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', '10 chapters by various authors, aimed primarily at practicing professionals in neuropsychology.  Attempts to establish a base of scientific methods for establishing diagnosis and predicting performance.', 9478, NULL, NULL, NULL, 3006, 0),
(12849, 3, 'Micro-Ã©conomie expÃ©rimentale', 'Aurelio Mattei', 2002, 'Genève, Switzerland: Librairie Droz', NULL, 9479, NULL, 'In French', NULL, 3007, 0),
(12850, 3, 'Essays in Panel Data Econometrics', 'Marc Nerlove', 2002, 'New York, NY: Cambridge University Press', 'This is a collection of seven previously published essays by Marc Nerlove, plus a history of the subject.', 9480, NULL, NULL, NULL, 3008, 0);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(12851, 3, 'Advanced Calculus with Applications in Statistics (2nd ed.)', 'André I. Khuri', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'This edition has expanded material on basic topological concepts and new chapters on orthogonal polynomials, Fourier series, and approximation of integrals.  It now also includes an appendix with solutions to selected exercises.', 9481, NULL, '1st ed. reviewed in JASA 89, Sept., 1994 by R. Bruce Lind\r\n\r\nChanged from tele to JASA per Lund, 6/12/03', NULL, 3009, 0),
(12852, 3, 'Subjective and Objective Bayesian Statistics: Principles, Models, and Applications (2nd ed.)', 'S. James Press', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', '16 chapters in 4 parts: foundations; numerical methods (MCMC and large-sample approximations); inference (estimation, testing, predictivism, decision theory); modes and applications (e.g., linear models, BMA, hierarchical models). Includes chapter exercises and solutions. Some portions contributed by S. Chib, M. Clyde, G. Woodworth, and A. Zaslavsky.', 9482, NULL, NULL, NULL, 3010, 0),
(12853, 3, 'Research Design and Statistical Analysis (2nd ed.)', 'Jerome L. Myers and Arnold D. Well', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', NULL, 9483, NULL, 'No record of 1st edition review in JStor', NULL, 3011, 0),
(12854, 3, 'Probability, Statistics, and Reliability for Engineers and Scientists', 'Bilal M. Ayyub and Richard H. McCuen', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Textbook at a fairly elementary level covering basic statistical concepts and methods of importance to engineers. Each chapter has problems and simulation projects.', 9484, NULL, 'see entry #6299.1st ed. reviewed by Mary Richardson in JASA 93, 1998', NULL, 3012, 0),
(12855, 3, 'Medical Statistics from Scratch', 'David Bowers', 2002, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'A somewhat jokey approach to standard topics including descriptive statistics, study design, estimation ("the informed guess"), testing, correlation, and regression ("getting into a relationship").  Some of the material is an amalgam of two of the author''s previous books.', 9485, NULL, NULL, NULL, 3013, 0),
(12856, 3, 'Stochastic Approximation and Its Applications', 'Han-Fu Chen', 2002, 'Dordrecht, Netherlands: Kluwer', 'Aimed at students, engineers, and researchers.  Chapters on Robbins-Monro algorithm, SA algorithms with expanding truncations, asymptotics, optimization, signal processing, and applications to systems and control.  Several appendices.', 9486, NULL, NULL, NULL, 3014, 0),
(12857, 3, 'Case Studies in Reliability and Maintenance', 'Wallace R. Blischke and D. N. Prabhakar Murthy (Eds.)', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Introduction and 26 case studies by 60 contributors.  Organized in 6 parts: product design (3), development and testing (7), defects and failure analysis (4), maintenance and maintainability (6), optimization and re-engineering (4), and product warranty (2).  Intended audience is practitioners, researchers, graduate and advanced undergraduate students.', 9487, NULL, NULL, NULL, 3015, 0),
(12858, 3, 'The Optimal Design of Blocked and Split-Plot Experiments', 'Peter Goos', 2002, 'New York, NY: Springer-Verlag', 'Aimed at applied statisticians and academics, with a quality and business emphasis (author is a recent PhD in applied economics).  Discusses theory, algorithms, and applications.', 9488, NULL, NULL, NULL, 3016, 0),
(12859, 3, '2D Object Detection and Recognition: Models, Algorithms, and Networks', 'Yali Amit', 2002, 'Cambridge, MA: MIT Press', 'Statistical model construction, computation, and parallel implementations in biologically plausible neural network architectures.', 9489, NULL, NULL, NULL, 3017, 0),
(12860, 3, 'The American Economic Review', 'Ben S. Bernanke (Ed.)', 2002, 'Nashville, TN: American Economic Association', NULL, NULL, NULL, NULL, NULL, 3018, 0),
(12861, 3, 'Uncertainty and Optimality: Probability, Statistics and Operations Research', 'J. C. Misra (Ed.)', 2002, 'River Edge, NJ: World Scientific Publishing Co., Inc.', '18 articles, many by prominent authors.', 9490, NULL, NULL, NULL, 3019, 0),
(12862, 3, 'Sample Survey: Principles & Methods (3rd ed.)', 'Vic Barnett', 2002, 'London, UK: Arnold', 'New edition with more breadth in terms of areas of application, use of the Internet, and newer methods for studying rare or sensitive events.', 9491, NULL, NULL, NULL, 3020, 0),
(12863, 3, 'Advances in Neural Information Processing Systems 14: \r\nProceedings of the 2002 Conference (December, 2001)', 'Thomas G. Dietterich, Susanna Becker, and Zoubin Ghahramani, (Eds.)', 2002, 'Cambridge, MA: MIT Press', NULL, 9492, NULL, 'See also #2085 and 4034', NULL, 3021, 0),
(12864, 3, 'Understanding Research in Clinical and Counseling Psychology', 'Jay C. Thomas and Michel Hersen (Eds.)', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', NULL, 9493, NULL, NULL, NULL, 3022, 0),
(12865, 3, 'Data Mining Using SAS Applications', 'George Fernandez', 2003, 'Boca Raton, FL: CRC Press', 'Mostly software instructions, but with some introduction to concepts and methods', 9494, NULL, NULL, NULL, 3023, 0),
(12866, 3, 'Combined Survey Sampling Inference: Weighing Basu''s Elephants', 'Ken Brewer', 2002, 'London: Arnold', 'This is an introductory text on survey sampling, but it also has a purpose of contrasting and discussing randomization-based versus model-based inference.', 9495, NULL, '[but maybe TAS]]', NULL, 3024, 0),
(12867, 3, 'Six Sigma Deployment', 'Cary W. Adams, Praveen Gupta, and Charles E. Wilson, Jr', 2003, 'Burlington, MA: Butterworth Heineman', 'Overview stressing management systems.', 9496, NULL, NULL, NULL, 3025, 0),
(12868, 3, 'The Structural Theory of Probability: New Ideas from Computer Science on the Ancient Problem of Probability Interpretation', 'Paolo Rocchi', 2002, 'New York, NY: Kluwer Academic/Plenum Publishers', 'A computer scientist''s philosophical view of probability.', 9497, NULL, 'I think Rick was sent this book as part of dist list 5, but ask him, ljy 8/15.', NULL, 3026, 0),
(12869, 3, 'Automated Essay Scoring: A Cross-Disciplinary Perspective', 'Mark D. Shermis and Jill C. Burstein (Eds.)', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', 'Articles by several authors; some on educational topics, others on psychometric concerns.', 9498, NULL, 'Russ notes to Cleary: telegraphic, if at all.', NULL, 3027, 0),
(12870, 3, 'Testing Statistical Hypotheses of Equivalence', 'Stefan Wellek', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Intended to serve as a coherent reference on the subject for both theory and practical methods.  Chapters on general approaches, selected one-parameter problems, paired data, two samples, multi-sample tests, goodness of fit, and bioequivalence.', 9499, NULL, 'Russ claimed the freebie (2nd copy); if he ends up doing the review, make sure to add the first copy back into the freebie list.', NULL, 3028, 0),
(12871, 3, 'Exploratory Analysis and Data Modeling in Functional Neuroimaging', 'Friedrich T. Sommer and Andrzej Wichert', 2003, 'Cambridge, MA: MIT Press', '13 articles by participants in the annual Neural Information Processing Systems (NIPS) workshops', 9500, NULL, NULL, NULL, 3029, 0),
(12872, 3, 'Multivariate Bayesian Statistics: Models for Source Separation and Signal Unmixing', 'Daniel B. Rowe', 2002, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'From back cover: Real-world source-separation problems ... are more difficult than they appear.  ... fundamental statistical material and up-to-date research results that enable readers to understand and apply Bayesian methods to help solve the many "cocktail party" problems they may confront in practice.', 9501, NULL, 'a short to medium length review per RBLund  11/30/05', NULL, 3030, 0),
(12873, 3, 'Statistics with Applications in Biology and Geology', 'Preben Blæsild and Jørgen Granfeldt', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Mathematical statistics plus applications text with many standard topics plus a few unusual ones such as directional data.  Emphasis on SAS.', NULL, NULL, NULL, NULL, 3031, 0),
(12874, 3, 'Components of Variance', 'D. R. Cox and P. J. Solomon', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Concepts; One-way balanced case; More general balanced cases; Unbalanced situations; Non-normal problems; Model extensions and criticisms.', 9502, NULL, 'Additional book requested from CRC 6/16/03 was received by Lund', NULL, 3032, 0),
(12875, 3, 'Small Area Estimation', 'J. N. K. Rao', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Terminology; survey design methods and analysis based on implicit linking; linear and generalized linear mixed models; empirical BLUP, empirical Bayes, and hierarchical Bayes; diagnostics; various extensions.', 9503, NULL, 'Lund suggests Gauri Datta for reviewer', NULL, 3033, 0),
(12876, 3, 'Finite Element Methods with B-Splines', 'Klaus Höllig', 2003, 'Philadelphia, PA: SIAM', 'Concepts; B-splines and various extensions; approximation with weighted splines; boundary-value problems; multigrid methods; implementation.', 9504, NULL, NULL, NULL, 3034, 0),
(12877, 3, 'Statistical Methods in Agricultural and Experimental Biology (3rd Ed.)', 'Roger Mead, Robert N. Curnow, and Anne M. Hasted', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'New chapter on multivariate analysis; more material on computer packages and graphics; wider discussion of data types; analysis of mixed cropping and on-farm experiments.', 9505, NULL, '1st and 2nd editions were reviewed in JASA', NULL, 3035, 0),
(12878, 3, 'Modelling Binary Data (2nd Ed.)', 'David Collett', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Additional material on new computational methods that have emerged, e.g., mixed models for binary data and an exact version of logistic regression.', 9506, NULL, '1st edition reviewed in JASA 88, #422 by Chang', NULL, 3036, 0),
(12879, 3, 'Proceedings of the Fourteen Annual ACM-SIAM Symposium on Discrete Algorithms, Baltimore, 2003', NULL, 2003, 'New York, NY: Association for Computing Machinery and Philadelphia: SIAM', NULL, 9507, NULL, NULL, NULL, 3037, 0),
(12880, 3, '777 Mathematical Conversation Starters', 'John dePillis', 2002, 'Washington, DC: Mathematical Association of America', NULL, 9508, NULL, NULL, NULL, 3038, 0),
(12881, 3, 'Teaching Statistics: A Bag of Tricks', 'Andrew Gelman and Deborah Nolan', 2002, 'New York, NY: Oxford University Press', 'A resource for use in teaching using an activity-based approach.  Part I has activities for introductory statistics courses -- description, inferential concepts, and methods.  Part II has topics on what works and what doesn''t, and on course planning.  Part III has more advanced material.', 9509, NULL, NULL, NULL, 3039, 0),
(12882, 3, 'Nonlinear Estimation and Classification', 'David D. Denison, Mark H. Hansen, Christopher C. Holmes, Bani Mallick, and Bin Yu (Eds.)', 2003, 'New York, NY: Springer-Verlag', 'Papers from a workshop held in 1999 at MSRI, Berkeley.  Contains 11 "longer papers" and 20 "shorter papers."  There is no integrated index or bibliography.', 9510, NULL, 'Karr down as AE, but book apparently sent to Gentleman, who sent it out.', NULL, 3040, 0),
(12883, 3, 'Unified Methods for Censored Longitudinal Data and Causuality', 'Mark J. van der Laan and James M. Robins', 2003, 'New York, NY: Springer-Verlag', 'Claims to provide "the first comprehensive description of optimal estimation techniques based on time-dependent data structures subject to uniform censoring and treatment assignment in so-called semiparametric models."  Directed to researchers and Master''s and PhD students in statistics.', 9511, NULL, 'Retire per Dalene 6/25/08', NULL, 3041, 0),
(12884, 3, 'Parametric and Nonparametric Inference from Record-Breaking Data', 'Sneh Gulati and William J. Padgett', 2003, 'New York, NY: Springer-Verlag', 'Parametric and nonparametric inference, smooth-function estimation, Bayesian models, and models for records with trend.', 9512, NULL, NULL, NULL, 3042, 0),
(12885, 3, 'A Crash Course in SPSS for Windows Versions 10 and 11 (2nd ed.)', 'Rod Corston and Andrew Colman', 2003, 'Malden, MA: Blackwell Publishing', 'Brief background information for methods, but no exercises or such to make this very usable as primary teaching material.', 9513, NULL, 'no record of 1st ed in db', NULL, 3043, 0),
(12886, 3, 'Introductory Biostatistics for the Health Sciences: modern applications including bootstrap', 'Michael R. Chernick and Robert H. Friis', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Undergraduate text for health science majors. Standard topics in the usual order, including one-way ANOVA, nonparametrics, and survival analysis.', 9514, NULL, NULL, NULL, 3044, 0),
(12887, 3, 'Introduction to Stochastic Search and Optimization: Estimation, Simulation, and Control', 'James C. Spall', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Topics include random search, recursive estimation, stochastic approximation. Includes many exercises, making this a possibility as a text as well as a reference.', 9515, NULL, NULL, NULL, 3045, 0),
(12888, 3, 'Leslie Kish: Selected Papers', 'Graham Kalton and Steven Heeringa (Eds.)', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', '17 papers on sampling, inference issues, nonsampling errors, domain estimation, and the statistics profession, with a preface by Rhea Kish. Includes an integrated bibliography and index.', 9516, NULL, NULL, NULL, 3046, 0),
(12889, 3, 'Introductory Biostatistics', 'Chap T. Le', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Fairly standard text for professional students in health sciences. Chapters on descriptive statistics, probability, estimation, tests, comparisons of proportions and of means, linear and logistic regression, survival data, and clinical study designs.', 9517, NULL, 'Russ reviewed in TasBriefs; sent to Cowles to consider for full review.', NULL, 3047, 0),
(12890, 3, 'Structural Bioinformatics', 'Philip E. Bourne and Helge Weissig (Eds.)', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'Introductory chapter on protein structure and theory. Sections on data representation, comparative features, structures and function, protein interactions, drug discovery, and structure prediction.', 9518, NULL, 'possible joint short with 3050', NULL, 3048, 0),
(12891, 3, 'Structural Equation Modeling: Applications in Ecological and Evolutionary Biology', 'Bruce H. Pugesek, Adrian Tomer, and Alexander von Eye (Eds.)', 2003, 'New York: Cambridge University Press', '14 articles in 3 parts: Theory, Applications, and Computing. Integrated index.', 9519, NULL, NULL, NULL, 3049, 0),
(12892, 3, 'Genomic Perl: From Bioinformatics Basics to Working Code', 'Rex A. Dwyer', 2003, 'New York, NY: Cambridge University Press', 'An introduction to computational molecular biology, with a focus on Perl implementations. Emphasis is on one or two practical approaches for each type of problem.', 9520, NULL, 'possible joint short review with 3048', NULL, 3050, 0),
(12893, 3, 'A Mathematician Plays the Stock Market', 'John Allen Paulos', 2003, 'New York, NY: Basic Books', 'Book for the popular audience by the author of _Innumerancy_. Touches on topics such as data mining, moving averages, random walks, the rule of 72, expected values, and risk. Most intriguing section title: "What''s Normal? Not Six Sigma."', 9521, NULL, 'We received uncorrected proof copy and hardcover', NULL, 3051, 0),
(12894, 3, 'Introductory Econometrics for Finance', 'Chris Brooks', 2002, 'Cambridge, UK: Cambridge University Press', 'Aimed at finance majors. Chapters on regression, time series, multivariate models, nonlinear time series (e.g., GARCH models), and simulation methods.', 9522, NULL, NULL, NULL, 3052, 0),
(12895, 3, 'The Analysis of Gene Expression Data: Methods and Software', 'Giovanni Parmigiani, Elizabeth S. Garrett, Ragael A. Irizarry, and Scott L. Zeger (Eds.)', 2003, 'New York, NY: Springer-Verlag', '19 articles with integrated index, by authors of free software for microarray data analysis. Covers annotation, filtering, clustering, and classification.', 9523, NULL, NULL, NULL, 3053, 0),
(12896, 3, 'Bayesian Nonparametrics', 'J. K. Ghosh and R. V. Ramamoorthi', 2003, 'New York: Springer', 'Chapters on the finite-dimensional case, measure spaces and priors on them, Dirichlet and Polya tree process, consistency, density estimation, inference for location parameters, regression, infinite-dimensional Jeffreys priors, survival analysis, and neutral-to-the-right priors.', NULL, NULL, NULL, NULL, 3054, 0),
(12897, 3, 'Modeling and Inverse Problems in Image Analysis', 'Bernard Chalmond', 2003, 'New York, NY: Springer-Verlag', 'Energy-based models, spline approaches, and random fields. Applications such as robot vision, tomography, and deformation learning.', 9524, NULL, NULL, NULL, 3055, 0),
(12898, 3, 'Nonlinear Time Series: Nonparametric and Parametric Methods', 'Jianqing Fan and Qiwei Yao', 2003, 'New York, NY: Springer-Verlag', 'Principal focus on recent nonparametric and semiparametric methods, plus up-to-date exposure of parametric methods such as ARCH/GARCH and threshold models.', 9525, NULL, NULL, NULL, 3056, 0),
(12899, 3, 'Statistics on Special Manifolds', 'Yasuko Chikuse', 2003, 'New York, NY: Springer-Verlag', 'Concerns statistical analysis on Stiefel and Grassmann manifolds, treated as sample spaces of matrices.', 9526, NULL, NULL, NULL, 3057, 0),
(12900, 3, 'Spatial Statistics and Computational Methods', 'Jesper Møller (Ed.)', 2003, 'New York, NY: Springer-Verlag', '4 chapters by 10 contributors on MCMC (for which some of the earliest applications are in spatial statistics), model-based geostatistics, image analysis, and simulation-based inference for spatial point processes. Based on the course material for a conference held at Aalborg University, Denmark, in August 2001. Integrated bibliography and index.', 9527, NULL, NULL, NULL, 3058, 0),
(12901, 1, 'Applied Probability', 'Kenneth Lange', 2003, 'New York, NY: Springer-Verlag', 'Aimed at graduate students in diverse (but technical) fields, having background in multivariable calculus, linear algebra, and differential equations. Chapters on calculus of expectations, convexity, combinatorics, Poisson processes, Markov chains, branching processes, martingales, diffusion processes, Poisson approximation, and number theory.', NULL, NULL, NULL, NULL, 3059, 0),
(12902, 3, 'The Art of the Infinite: the Pleasures of Mathematics', 'Robert Kaplan and Ellen Kaplan', 2003, 'New York, NY: Oxford University Press', NULL, 9528, NULL, NULL, NULL, 3060, 0),
(12903, 3, 'Applied Longitudinal Data Analysis: Modeling Change and Event Occurrence', 'Judith D. Singer and John B. Willett', 2003, 'New York: Oxford University Press', 'Aimed at researchers and students in the behavioral sciences, focusing on multilevel models for change, and survival analysis. Does not include exercises.', 9529, NULL, NULL, NULL, 3061, 0),
(12904, 3, 'Linear Regression Analysis (2nd ed.)', 'George A. F. Seber and Alan J. Lee', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'First edition was 1977. Chapter topics include the multivariate normal, linear regression, testing, estimation, ANOVA, departures from assumptions, algorithms, and prediction and model selection. Emphasis is on theory. Includes exercises and solutions.', 9530, NULL, 'No record of review of 1st ed. in CIS or Stors', NULL, 3062, 0),
(12905, 3, 'Statistical Design and Analysis of Experiments: with Applications to Engineering and Science', 'Robert L. Mason, Richard F. Gunst, and James L. Hess', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', 'New or expanded materials on distinguishing populations and processes and modeling issues. Less introductory material so that readers get to design topics sooner.', 9531, NULL, '1st edition reviewed in JASA 85', NULL, 3063, 0),
(12906, 3, 'Design and Analysis of Cross-over Trials (2nd ed.)', 'Byron Jones and Michael G. Kenward', 2003, 'Boca Raton, FL: Chapman & Hall/CRC Press', 'Enhancements from the first edition include a new chapter on bioequivalence, new methods for longitudinal and categorical data, SAS examples, and downloadable datasets.', 9532, NULL, '1st ed rev. JASA #86', NULL, 3064, 0),
(12907, 3, 'Elementary Probability Theory: With Stochastic Processes and an Introduction to Mathematical Finance (4th ed.)', 'Kai Lai Chung and Farid AitSahlia', 2003, 'New York, NY: Springer-Verlag', 'Apparently no edition of Chung has ever been reviewed in JASA or TAS. The expected chapters on sets, concepts, counting, random variables, etc.; this new edition has new chapters on pricing models and option pricing theory. Appendices are inconveniently interspersed among chapters.', 9533, NULL, 'No previous review in jstor or cis', NULL, 3065, 0),
(12908, 3, 'CRC Standard Mathematical Tables and Formulae', 'Daniel Zwillinger', 2003, 'Boca Raton, FL: Chapman & Hall/CRC', NULL, 9534, NULL, 'Previous edition reviewed', NULL, 3066, 0),
(12909, 3, 'Survival Analysis: Techniques for Censored and Truncated Data (2nd ed.)', 'John P. Klein and Melvin L. Moeschberger', 2003, 'New York, NY: Springer-Verlag', 'Graduate-level text directed to a health-science audience. Chapters on censoring/truncation, nonparametric methods, estimation, testing, semiparametric hazards regression, diagnostics, and multivariate methods.', 9535, NULL, NULL, NULL, 3067, 0),
(12910, 3, 'Levine''s Guide to SPSS for Analysis of Variance (2nd ed.)', 'Melanie C. Page, Sanford L Braver, and David P. MacKinnon', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', NULL, 9536, NULL, 'No previous review in jstor or cis', NULL, 3068, 0),
(12911, 3, 'Methods and Applications of Linear Models: Regression and the Analysis of Variance (2nd ed.)', 'Ronald R. Hocking', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', '18 chapters in 3 parts: regression models (incl. topics in transformations, collinarity, influence); analysis of variance models (fixed and mixed models, balanced and unbalanced); theory of linear models. Poor print quality detracts from the usability of the book.', 9537, NULL, 'No previous review in jstor or cis', NULL, 3069, 0),
(12912, 3, 'Statistical Methods for Survival Data Analysis (3rd ed.)', 'Elisa T. Lee and John Wenyu Wang', 2003, 'Hoboken, NJ: John Wiley & Sons, Inc.', NULL, 9538, NULL, '1st ed reviewed in JASA 80, 2nd reviewed in JASA 88.', NULL, 3070, 0),
(12913, 3, 'SPSS for Psychololgists: A Guide to Data Analysis using SPSS for Windows (2nd ed., rev. and expanded)', 'Nicola Brace, Richard Kemp, and Rosemary Snelgar', 2003, 'Mahwah, NJ: Lawrence Erlbaum Associates, Inc.', NULL, 9539, NULL, 'no previous review in jstor or cis', NULL, 3071, 0),
