(15807, 2, 'Robust Nonparametric Statistical Methods (2nd Edition)', 'Thomas P. Hettmansperger, Joseph W. McKean', 2010, 'Taylor &amp; Francis', 'Often referred to as distribution-free methods, nonparametric methods do not rely on assumptions that the data are drawn from a given probability distribution. With an emphasis on Wilcoxon rank methods that enable a unified approach to data analysis, this book presents a unique overview of robust nonparametric statistical methods. Drawing on examples from various disciplines, the relevant R code for these examples, as well as numerous exercises for self-study, the text covers location models, re', 12354, NULL, 'Ulrike Genschel as possible reviewer in January 2012.', 1293944400, 2011045, 1),
