(13873, 4, 'Complex Social Networks', 'Fernando Vega-Redondo', 2007, 'New York, NY: Cambridge University Press', 'JASA Tele or Short', 10484, NULL, 'From CAC\r\nI have now had time to look at the "Complex Social Networks" book (#7072) that you sent along a while back. After reading some sections and talking to a networking guy in our group here, it does not seem that this is a book\r\nthat we should be reviewing: the models all seem to be treated as deterministic with no associated uncertainty, and it has minimal statistical content. So I would recommend that we don''t review it.', NULL, 7072, 0),
