(15691, NULL, 'Multidimensional Stochastic Processes as Rough Paths: Theory and Applications', 'Peter K. Friz and Nicolas B. Victoir', 2010, 'New York, NY: Cambridge University Press', 'Rough path analysis provides a fresh perspective on Ito''s important theory of stochastic differential equations. Key theorems of modern stochastic analysis (existence and limit theorems for stochastic flows, Freidlin-Wentzell theory, the Stroock-Varadhan support description) can be obtained with dramatic simplifications. Classical approximation results and their limitations (Wong-Zakai, McShane''s counterexample) receive ''obvious'' rough path explanations. Evidence is building that rough paths wil', 12261, NULL, 'Dalene has', 1262466266, 2010074, 2),
