(15934, NULL, 'Controversial Issues in Clinical Trials', 'Shein-Chung Chow', 2011, 'CRC Press', 'Covering a number of controversial issues that are commonly encountered when conducting clinical trials, this book serves as a useful desk reference and an assessment of the current state of the art. It discusses the appropriateness of traditional statistical hypotheses (which primarily focus on efficacy) for clinical evaluation of both efficacy and safety, instability of classical sample size calculation based on information from a small pilot study, and integrity of randomization and blinding.', 12481, NULL, NULL, 1293944400, 2011172, 2),
(15990, NULL, 'Applied Time Series Analysis', 'Wayne A. Woodward, Henry L. Gray, Alan C. Elliot', 2012, 'Taylor and Francis', 'Virtually any random process developing chronologically can be viewed as a time series. In economics, closing prices of stocks, the cost of money, the jobless rate, and retail sales are just a few examples of many. Developed from course notes and extensively classroom-tested, Applied Time Series Analysis includes examples across a variety of fields, develops theory, and provides software to address time series problems in a broad spectrum of fields. The authors organize the information in such a', 12536, NULL, NULL, 1320267750, 2011227, 1),
(15706, 1, 'GARCH Models: Structure, Statistical Inference and Financial Applications', 'Christian Francq and Jean-Michel Zakoian', 2010, 'Hoboken, NJ: Wiley', 'This book provides a comprehensive and systematic approach to understanding GARCH time series models and their applications whilst presenting the most advanced results concerning the theory and practical aspects of GARCH. The probability structure of standard GARCH models is studied in detail as well as statistical inference such as identification, estimation and tests. The book also provides coverage of several extensions such as asymmetric and multivariate models and looks at financial applica', 12276, NULL, 'For Alyson', 1262466266, 2010089, 1),
(15707, 4, 'IBM SPSS for Introductory Statistics: Use and Interpretation, (4th ed.)', 'George A. Morgan, Nancy L. Leech, Gene W. Gloeckner, and Karen C. Barrett', 2011, 'New York, NY: Routledge', 'Designed to help students analyze and interpret research data using IBM SPSS, this book describes the use of statistics in user-friendly, non-technical language to show readers how to choose the appropriate statistic based on the design, interpret output, and write about the results. The authors prepare readers for all of the steps in the research process, from design and data collection, to writing about the results. Discussions of writing about outputs, data entry and checking, reliability ass', 12277, NULL, 'The titles of our books have changed somewhat over time, especially at first. You can see the progression of titles and publishers for my attached cv, under books starting on page 3. What Erlbaum later considered the 1st edition was published in 1998 as Easy Use and Interpretation of SPSS for Windows. It included both introductory and intermediate statistics. I decided that was too much to cover well so in 2001 we published a somewhat shorter book that only covered introductory statistics, calle', 1262466266, 2010090, 2),
(15708, 1, 'Multilevel and Longitudinal Modeling with IBM SPSS', ' Ronald H. Heck, Scott L. Thomas, and Lynn N. Tabata', 2010, 'New York, NY: Routledge', NULL, 12278, NULL, '', 1262466266, 2010091, 2),
