(15838, NULL, 'Transportation Statistics and Microsimulation', 'Cliff Spiegelman, Eun Sug Park, Laurence R. Rilett', 2011, 'CRC Press', 'By discussing statistical concepts in the context of transportation planning and operations, Transportation Statistics and Microsimulation provides the necessary background for making informed transportation-related decisions. It explains the why behind standard methods and uses real-world transportation examples and problems to illustrate key concepts.The Tools and Methods to Solve Transportation Problems Classroom-tested at Texas A&M University, the text covers the statistical techniques most ', 12387, NULL, 'For Alyson. Found specifics on Amazon.', 1293944400, 2011078, 1),
