(15825, 3, 'Principles and Practice of Structural Equation Modeling, Third Edition', 'Rex B. Kline', 2011, 'Guilford Press, New York, NY', ' This bestselling text provides a balance between the technical and practical aspects of structural equation modeling (SEM). Using clear and accessible language, Rex B. Kline covers core techniques, potential pitfalls, and applications across the behavioral and social sciences. Some more advanced topics are also covered, including estimation of interactive effects of latent variables and multilevel SEM. The companion Web page offers downloadable syntax, data, and output files for each detailed e', 12372, NULL, 'Laura Hildreth?', 1293944400, 2011063, 2),
(15719, NULL, 'Pattern Theory: The Stochastic Analysis of Real-World Signals', 'David Mumford and AgnÃ¨s Desolneux', 2010, 'Natick, MA: A.K. Peters, Ltd.', NULL, 12289, NULL, 'For Alyson', 1262466266, 2010102, 1),
(15720, 1, 'Methods Matter: Improving Causal Inference in Educational and Social Science Research', 'Richard J. Murnane and John B. Willett', 2011, 'New York, NY: Oxford University Press', 'Educational policy-makers around the world constantly make decisions about how to use scarce resources to improve the education of children. Unfortunately, their decisions are rarely informed by evidence on the consequences of these initiatives in other settings. Nor are decisions typically accompanied by well-formulated plans to evaluate their causal impacts. As a result, knowledge about what works in different situations has been very slow to accumulate.\n\nOver the last several decades, advance', 12290, NULL, 'For Alyson', 1262466266, 2010103, 0),
(15839, NULL, 'Handbook of Adaptive Designs in Pharmaceutical and Clinical Development', 'Annpey Pong, Shein-Chung Chow', 2011, 'Taylor &amp; Francis', 'In response to the US FDA''s Critical Path Initiative , innovative adaptive designs are being used more and more in clinical trials due to their flexibility and efficiency, especially during early phase development. Handbook of Adaptive Designs in Pharmaceutical and Clinical Development provides a comprehensive and unified presentation of the principles and latest statistical methodologies used when modifying trial procedures based on accrued data of ongoing clinical trials. The book also gives a', 12388, NULL, '19+8+19+20+25+25+16+13+19+23+16+23+8+17+13+13+19+14+15+25+9+11+14+18+16+14+12+22=466\nEach chapter is numbered separately!!!!!!!', 1293944400, 2011079, 2),
