(15898, 10, 'Introduction to Probability Models, 10th edition', 'Sheldon M. Ross', 2010, 'Academic Press', 'Ross''s classic bestseller, Introduction to Probability Models, has been used extensively by professionals and as the primary text for a first undergraduate course in applied probability. It provides an introduction to elementary probability theory and stochastic processes, and shows how probability theory can be applied to the study of phenomena in fields such as engineering, computer science, management science, the physical and social sciences, and operations research. With the addition of sev', 12447, NULL, NULL, 1293944400, 2011138, 1),
(15728, NULL, 'Applied Bayesian Hierarchical Methods', 'Peter D. Congdon', 2010, 'Boca Raton, FL: Chapman & Hall/CRC', NULL, 12298, NULL, NULL, 1262466266, 2010111, 2),
(15729, 1, 'Bayesian Ideas and Data Analysis: An Introduction for Scientists and Statisticians', 'Ronald Christensen, Wesley O. Johnson, Adam J. Branscum, and Timothy E. Hanson', 2011, 'Boca Raton, FL: Chapman & Hall/CRC', NULL, 12299, NULL, 'For Alyson', 1262466266, 2010112, 0),
(15834, NULL, 'Modeling Survival Data Using Frailty Models', 'David D. Hanagal', 2011, 'Taylor &amp; Francis', 'The term "frailty" is used to represent an unobservable random effect shared by subjects with similar risks. Frailty models have been introduced into the statistical literature to account for the existence of unmeasured attributes, such as genotypes that introduce heterogeneity into a study population. Including inference results, applications, and references, this book presents the basic concepts of frailty models in survival analysis. The author also addresses advanced topics in frailty models', 12379, NULL, NULL, 1293944400, 2011070, 2),
(15731, 1, 'Bayesian Model Selection and Statistical Modeling', 'Tomohiro Ando', 2010, 'Boca Raton, FL: Chapman & Hall/CRC', NULL, 12301, NULL, 'For Alyson', 1262466266, 2010114, 2),
(16189, NULL, 'Hurricane Climatology', 'James B. Elsner and Thomas H. Jagger', 2013, 'Oxford University Press', 'Hurricanes are nature''s most destructive storms and they are becoming more powerful as the globe warms. Hurricane Climatology explains how to analyze and model hurricane data to better understand and predict present and future hurricane activity. It uses the open-source and now widely used R software for statistical computing to create a tutorial-style manual for independent study, review, and reference. The text is written around the code that when copied will reproduce the graphs, tables, and ', 12728, NULL, NULL, 1364244069, 2013021, 1),
(15733, 1, 'Using SAS for Data Management, Statistical Analysis, and Graphics', 'Ken Kleinman and Nicholas J. Horton', 2011, 'Boca Raton, FL: Chapman & Hall/CRC', 'Quick and Easy Access to Key Elements of Documentation\n\nIncludes worked examples across a wide variety of applications, tasks, and graphics\n\nA unique companion for statistical coders, Using SAS for Data Management, Statistical Analysis, and Graphics presents an easy way to learn how to perform an analytical task in SAS, without having to navigate through the extensive, idiosyncratic, and sometimes unwieldy software documentation. Organized by short, clear descriptive entries, the book covers man', 12303, NULL, '', 1262466266, 2010116, 2),
