(15774, NULL, 'Elements of Adaptive Testing', 'Wim J. van der Linden', 2010, 'Springer', 'The arrival of the computer in educational and psychological testing has led to the current popularity of adaptive testing---a testing format in which the computer uses statistical information about the test items to automatically adapt their selection to a real-time update of the test takers ability estimate. This book covers such key features of adaptive testing as item selection and ability estimation, adaptive testing with multidimensional abilities, sequencing adaptive test batteries, multi', 12321, NULL, 'For Alyson', 1262466266, 2011012, 2),
(15775, NULL, 'Exploratory Multivariate Analysis by Example Using R', 'Francois Husson, Sebastien Le, Jerome Pages', 2010, 'Taylor &amp; Francis', 'An introduction to exploratory techniques for multivariate data analysis, this book covers the key methodology, including principal components analysis, correspondence analysis, mixed models and multiple factor analysis. The authors take a practical approach, with examples leading the discussion of the methods and lots of graphics to emphasize visualization. They present the concepts in the most intuitive way possible, keeping mathematical content to a minimum or relegating it to the appendices.', 12322, NULL, NULL, 1325394000, 2011013, 0),
(15779, NULL, 'Introduction to WinBUGS for Ecologists: Bayesian Approach to Regression ...', 'Marc Kery', 2010, 'Elsevier Science &amp; Technology', 'Bayesian statistics has exploded into biology and its sub-disciplines such as ecology over the past decade. The free software program WinBUGS and its open-source sister OpenBugs is currently the only flexible and general-purpose program available with which the average ecologist can conduct their own standard and non-standard Bayesian statistics. Introduction to WINBUGS for Ecologists goes right to the heart of the matter by providing ecologists with a comprehensive, yet concise, guide to applyi', 12326, NULL, NULL, 1325394000, 2011017, 0),
(15777, NULL, 'Exercises and Solutions in Biostatistical Theory', 'Lawrence L. Kupper, Sean M. O''Brien, Brian H. Neelon', 2011, 'CRC PRESS', 'Problems and Solutions in Biostatistical Theory', 12324, NULL, 'Actual title of book is Exercises and Solutions in Biostatistical Theory.', 1325394000, 2011015, 1),
(15776, NULL, 'Introduction to General and Generalized Linear Models', 'Poul Thyregod, Henrik Madsen', 2009, 'Taylor and Francis', 'Since the mathematics behind generalized linear models is often difficult to follow while the mathematics behind general linear models is well understood, this text describes the methodology behind both models in a parallel setup. After introducing a likelihood framework that is sufficient to cover both approaches, the authors present general linear models, including analysis of covariance, before moving on to more complicated generalized linear models using the same likelihood-based approach. N', 12323, NULL, '1/27/12 Jim Albert will contact reviewer to move this along. ', 1325394000, 2011014, 0),
(15778, NULL, 'Simultaneous Inference in Regression', 'Wei Liu', 2011, 'CRC Press', 'Simultaneous confidence bands enable more intuitive and detailed inference of regression analysis than the standard inferential methods of parameter estimation and hypothesis testing. Simultaneous Inference in Regression provides a thorough overview of the construction methods and applications of simultaneous confidence bands for various inferential purposes. It supplies examples and MATLAB  programs that make it easy to apply the methods to your own data analysis. The MATLAB programs, along wit', 12325, NULL, NULL, 1325394000, 2011016, NULL),
(15884, NULL, 'On the Brink: Inside the Race to Stop the Collapse of the Global Financial ...', 'Henry M. Paulson', 2011, 'Grand Central Publishing', 'When Hank Paulson, the former CEO of Goldman Sachs, was appointed in 2006 to become the nation''s next Secretary of the Treasury, he knew that his move from Wall Street to Washington would be daunting and challenging. But Paulson had no idea that a year later, he would find himself at the very epicenter of the world''s most cataclysmic financial crisis since the Great Depression. Major institutions including Bear Stearns, Fannie Mae, Freddie Mac, Lehman Brothers, AIG, Merrill Lynch, and Citigroup,', 12433, NULL, NULL, 1293944400, 2011124, 0),
(15842, NULL, 'Bayesian Modeling in Bioinformatics', 'Dipak K. Dey, Samiran Ghosh, Bani K. Mallick', 2011, 'CRC Press', 'Bayesian Modeling in Bioinformatics discusses the development and application of Bayesian statistical methods for the analysis of high-throughput bioinformatics data arising from problems in molecular and structural biology and disease-related medical research, such as cancer. It presents a broad overview of statistical inference, clustering, and classification problems in two main high-throughput platforms: microarray gene expression and phylogenic analysis. The book explores Bayesian technique', 12391, NULL, NULL, 1293944400, 2011082, 2),
(15841, 2, 'Exploratory Data Analysis With Matlab (2nd Edition)', 'Wendy L. Martinez, Angel Martinez, Jeffrey Solka', 2011, 'Taylor &amp; Francis', 'From the First Edition... Exploratory data analysis (EDA) was conceived at a time when computers were not widely used, and thus computational ability was rather limited. As computational sophistication has increased, EDA has become an even more powerful process for visualizing and summarizing data before making model assumptions to generate hypotheses, encompassing larger and more complex data sets. There are many resources for those interested in the theory of EDA, but this is the first book to', 12390, NULL, NULL, 1293944400, 2011081, 1),
(15780, NULL, 'Practical Computing for Biologists', 'Steven H. D. Haddock, Casey W. Dunn', 2011, 'Sinauer Associates Inc', 'Practical Computing for Biologists', 12327, NULL, 'No prices on Sinauer website', 1293944400, 2011018, 1),
(15769, NULL, 'Large Sample Techniques for Statistics', 'Jiming Jiang', 2010, 'Springer', 'This book offers a comprehensive guide to large sample techniques in statistics. More importantly, it focuses on thinking skills rather than just what formulae to use; it provides motivations, and intuition, rather than detailed proofs; it begins with very simple techniques, and connects theory and applications in entertaining ways. The first five chapters review some of the basic techniques, such as the fundamental epsilon-delta arguments, Taylor expansion, different types of convergence, and i', 12316, NULL, 'For Alyson', 1262466266, 2011007, 0),
(16185, NULL, 'Performance Modeling and Design of Computer Systems: Queueing Theory in Action', 'Mor Harchol-Balter', 2013, 'Cambridge University Press', '', 12724, NULL, 'Computer systems design is full of conundrums: \n\nâ€¢Given a choice between a single machine with speed s, or n machines each with speed s/n, which should we choose?\n\nâ€¢If both the arrival rate and service rate double, will the mean response time stay the same?\n\nâ€¢Should systems really aim to balance load, or is this a convenient myth? \nâ€¢If a scheduling policy favors one set of jobs, does it necessarily hurt some other jobs, or are these "conservation laws" being misinterpreted?\n\nâ€¢Do greedy', 1362770843, 2013017, 1),
(15771, NULL, 'Large-Scale Inference: Empirical Bayes Methods for Estimation, Testing, and Prediction', 'Bradley Efron', 2010, 'Cambridge University Press', 'We live in a new age for statistical inference, where modern scientific technology such as microarrays and fMRI machines routinely produce thousands and sometimes millions of parallel data sets, each with its own estimation or testing problem. Doing thousands of problems at once is more than repeated application of classical methods. Taking an empirical Bayes approach, Bradley Efron, inventor of the bootstrap, shows how information accrues across problems in a way that combines Bayesian and freq', 12318, NULL, 'For Alyson', 1262466266, 2011009, 1),
(15772, 4, 'The Cambridge Dictionary of Statistics, 4th edition', 'B. S. Everitt, A. Skrondal', 2010, 'Cambridge University Press', 'If you work with data and need easy access to clear, reliable definitions and explanations of modern statistical and statistics-related concepts, then look no further than this dictionary. Nearly 4000 terms are defined, covering medical, survey, theoretical, and applied statistics, including computational and graphical aspects. Entries are provided for standard and specialized statistical software. In addition, short biographies of over 100 important statisticians are given. Definitions provide ', 12319, NULL, 'For Alyson', 1262466266, 2011010, 0),
(15773, NULL, 'Econophysics and Companies: Statistical Life and Death in Complex Business ...', 'Hideaki Aoyama, Yoshi Fujiwara, Yuichi Ikeda, Hiroshi Iyetomi, Wataru Souma', 2010, 'Cambridge University Press', '"Econophysics is an emerging interdisciplinary field that takes advantage of the concepts and methods of statistical physics to analyse economic phenomena. This book expands the explanatory scope of econophysics to the real economy by using methods from statistical physics to analyse the success and failure of companies. Using large data sets of companies and income-earners in Japan and Europe, a distinguished team of researchers show how these methods allow us to analyse companies, from huge co', 12320, NULL, 'Per review (no book on hand): xxv+234 pp. ', 1262466266, 2011011, 0),
(15831, 2, 'Data Mining for Business Intelligence: Concepts, Techniques, and Applications in Microsoft Office Excel with XLMiner, 2nd edition', 'Galit Shmueli, Nitin R. Patel, Peter C. Bruce', 2010, 'John Wiley and Sons', 'Data Mining for Business Intelligence, Second Edition uses real data and actual cases to illustrate the applicability of data mining (DM) intelligence in the development of successful business models. Featuring complimentary access to XLMinerreg;, the Microsoft Office Excelreg; add-in, this book allows readers to follow along and implement algorithms at their own speed, with a minimal learning curve. In addition, students and practitioners of DM techniques are presented with hands-on, business-o', 12377, NULL, 'For Alyson', 1293944400, 2011068, 0),
(15782, NULL, 'Bayesian Decision Analysis: Principles and Practice', 'Jim Q. Smith', 2010, 'Cambridge University Press', '"Bayesian decision analysis supports principled decision making in complex domains. This textbook takes the reader from a formal analysis of simple decision problems to a careful analysis of the sometimes very complex and data rich structures confronted by practitioners. The book contains basic material on subjective probability theory and multi-attribute utility theory, event and decision trees, Bayesian networks, influence diagrams and causal Bayesian networks. The author demonstrates when and', 12329, NULL, NULL, 1293944400, 2011020, 2),
(16184, NULL, 'Age-Period-Cohort Analysis: New Models, Methods, and Empirical Applications', 'Yang Yang, Kenneth C. Land', 2013, 'CRC Press', '', 12723, NULL, 'based on a decade of the authorsâ€™ collaborative work in age-period-cohort (APC) analysis. Within a single, consistent HAPC-GLMM statistical modeling framework, the authors synthesize APC models and methods for three research designs: age-by-time period tables of population rates or proportions, repeated cross-section sample surveys, and accelerated longitudinal panel studies. The authors show how the empirical application of the models to various problems leads to many fascinating findings on ', 1362770694, 2013016, 2),
(15784, NULL, 'Bayesian Artificial Intelligence', 'Kevin B. Korb, Ann E. Nicholson', 2010, 'Taylor &amp; Francis', 'Updated and expanded, Bayesian Artificial Intelligence, Second Edition provides a practical and accessible introduction to the main concepts, foundation, and applications of Bayesian networks. It focuses on both the causal discovery of networks and Bayesian inference procedures. Adopting a causal interpretation of Bayesian networks, the authors discuss the use of Bayesian networks for causal modeling. They also draw on their own applied research to illustrate various applications of the technolo', 12331, NULL, 'Promised by end of 01/2012.\nPromised mid-March 2012 on 2/15/2012 (email)', 1293944400, 2011022, 0),
(15810, NULL, 'The Psychologist''s Companion: A Guide to Writing Scientific Papers for ...', 'Robert J. Sternberg, Karin Sternberg', 2010, 'Cambridge University Press', '"The Psychologist''s Companion is intended for students as well as young professionals and writers at all stages of their careers seeking inspiration and guidelines for better scientific writing. This book is also a resource for researchers in related fields. It has been comprehensively updated, revised, and extended for its fifth edition and includes the latest style guidelines of the American Psychological Association''s Publication Manual (sixth edition, 2009) as well as chapters encompassing t', 12357, NULL, 'For Alyson', 1293944400, 2011048, 0),
(15786, NULL, 'Multiple Comparisons Using R', 'Frank Bretz, Torsten Hothorn, Peter Westfall', 2011, 'CRC Press', 'Adopting a unifying theme based on maximum statistics, Multiple Comparisons Using R describes the common underlying theory of multiple comparison procedures through numerous examples. It also presents a detailed description of available software implementations in R. The R packages and source code for the analyses are available at http://CRAN.R-project.orgAfter giving examples of multiplicity problems, the book covers general concepts and basic multiple comparisons procedures, including the Bonf', 12333, NULL, 'For Alyson', 1293944400, 2011024, 2),
(15787, NULL, 'Choice-Based Conjoint Analysis: Models and Designs', 'Damaraju Raghavarao, James B. Wiley, Pallavi Chitturi', 2010, 'Taylor and Francis', 'Conjoint analysis (CA) and discrete choice experimentation (DCE) are tools used in marketing, economics, transportation, health, tourism, and other areas to develop and modify products, services, policies, and programs, specifically ones that can be described in terms of attributes. A specific combination of attributes is called a concept profile. Building on the authors'' significant work in the field, Choice-Based Conjoint Analysis: Models and Designs explores the design of experiment (DOE) iss', 12334, NULL, 'For Alyson', 1293944400, 2011025, NULL),
(15788, NULL, 'Random Walk: A Modern Introduction', 'Gregory F. Lawler, Vlada Limic', 2010, 'Cambridge University Press', 'Random walks are stochastic processes formed by successive summation of independent, identically distributed random variables and are one of the most studied topics in probability theory. This contemporary introduction evolved from courses taught at Cornell University and the University of Chicago by the first author, who is one of the most highly regarded researchers in the field of stochastic processes. This text meets the need for a modern reference to the detailed properties of an important ', 12335, NULL, 'For Alyson', 1293944400, 2011026, 0),
(15840, NULL, 'Handbook of Empirical Economics and Finance', 'Aman Ullah, David E. Giles', 2011, 'Taylor and Francis', 'This handbook provides an up-to-date reference source of cutting-edge developments in applied econometrics and the modeling of special types of economic and financial data. Leading researchers in the field contribute state-of-the-art, previously unpublished chapters that address these developments. The book covers major themes in the areas of microeconometrics, macroeconometrics, financial econometrics, panel and spatial data, time-series analysis, semiparametric and nonparametric methods, and t', 12389, NULL, NULL, 1293944400, 2011080, 2),
(15790, NULL, 'Nonlinear Markov Processes and Kinetic Equations', 'Vassili N. Kolokoltsov', 2010, 'Cambridge University Press', 'A nonlinear Markov evolution is a dynamical system generated by a measure-valued ordinary differential equation with the specific feature of preserving positivity. This feature distinguishes it from general vector-valued differential equations and yields a natural link with probability, both in interpreting results and in the tools of analysis. This brilliant book, the first devoted to the area, develops this interplay between probability and analysis. After systematically presenting both analyt', 12337, NULL, 'For Alyson', 1293944400, 2011028, 2),
(16050, NULL, 'Statistical Analysis for Business Using JMP: A Student''s Guide', 'Willbann D. Terpening', 2011, 'Sas Inst', 'Statistical Analysis for Business Using JMP: A Student''s Guide by Willbann D. Terpening is a complete and thorough introduction to business statistics using JMP. While the book is designed for introductory business statistics courses at the undergraduate or MBA level, industry professionals wanting to brush up on their knowledge of statistics and those wanting an introduction to using JMP for statistical analysis will also find it useful. The book starts with an introduction to using JMP in stat', 12595, NULL, NULL, 1328904517, 2011283, 2),
(15811, NULL, 'Probability, Statistics, & Financial Math', 'Peter Caithamer', 2010, 'Peter Caithamer', NULL, 12358, NULL, 'For Alyson', 1293944400, 2011049, 0),
(16183, 2, 'Introduction to Statistics Through Resampling Methods and R, 2nd edition', 'Phillip I. Good', 2013, 'Wiley', 'A highly accessible alternative approach to basic statistics Praise for the First Edition:  "Certainly one of the most impressive little paperback 200-page introductory statistics books that I will ever see . . . it would make a good nightstand book for every statistician."â€”Technometrics  \n\nWritten in a highly accessible style, Introduction to Statistics through Resampling Methods and R, Second Edition guides students in the understanding of descriptive statistics, estimation, hypothesis testi', 12722, NULL, NULL, 1361989791, 2013015, 1),
(15794, NULL, 'Introduction to Statistical Data Analysis for the Life Sciences', 'Claus Thorn Ekstrom, Helle Sorensen', 2011, 'CRC Press', 'Any practical introduction to statistics in the life sciences requires a focus on applications and computational statistics combined with a reasonable level of mathematical rigor. It must offer the right combination of data examples, statistical theory, and computing required for analysis today. And it should involve R software, the lingua franca of statistical computing.Introduction to Statistical Data Analysis for the Life Sciences covers all the usual material but goes further than other text', 12341, NULL, 'For Alyson', 1293944400, 2011032, 1),
(15837, 2, 'Measures of Interobserver Agreement and Reliability, Second Edition', 'Mohamed M. Shoukri', 2010, 'Taylor &amp; Francis', 'From the First Edition:Agreement among at least two evaluators is an issue of prime importance to statisticians, clinicians, epidemiologists, psychologists, and many other scientists. Measuring interobserver agreement is a method used to evaluate inconsistencies in findings from different evaluators who collect the same or similar information. Highlighting applications over theory, Measure of Interobserver Agreement provides a comprehensive survey of this method and includes standards and direct', 12385, NULL, NULL, 1293944400, 2011076, 2),
(15796, NULL, 'Introduction to Psychometric Theory', 'Tenko Raykov, George A. Marcoulides', 2010, 'Taylor &amp; Francis', 'This new text provides a state-of the-art introduction to educational and psychological testing and measurement theory that reflects many intellectual developments of the past two decades. The book introduces psychometric theory using a latent variable modeling (LVM) framework and emphasizes interval estimation throughout, so as to better prepare readers for studying more advanced topics later in their careers. Featuring numerous examples, it presents an applied approach to conducting testing an', 12343, NULL, 'For Alyson', 1293944400, 2011034, 1),
(15797, NULL, 'Statistical Graphics in SAS: An Introduction to the Graph Template Language and the Statistical Graphics Procedures', 'Warren F. Kuhfeld', 2010, 'SAS Publishing', 'The Graph Template Language (GTL) and the Statistical Graphics (SG) procedures are powerful new additions to SAS for creating high-quality statistical graphics. Warren F. Kuhfeld''s Statistical Graphics in SAS: An Introduction to the Graph Template Language and the Statistical Graphics Procedures provides a parallel and example-driven introduction to the SG procedures and the GTL. Most graphs in the book are produced in at least two ways. Each example provides prototype code for getting started w', 12344, NULL, 'For Alyson', 1293944400, 2011035, 2),
(15843, NULL, 'Randomized Response and Indirect Questioning Techniques in Surveys', 'Arijit Chaudhuri', 2011, 'Taylor &amp; Francis', 'A long-standing problem in survey research is that respondents are often reluctant to give truthful answers to sensitive questions. The randomized response technique (RRT) addresses this problem by guaranteeing respondents'' anonymity and minimizing their discomfort. The key to this is that respondents determines which question they answer using some probability device, such as a coin flip or a roll of the dice. In this book, one of the world''s leading experts on the subject summarizes the curren', 12392, NULL, NULL, 1293944400, 2011083, 2),
(15799, 2, 'Applied Probability (2nd Edition)', 'Kenneth Lange', 2010, 'Springer', 'Applied Probability presents a unique blend of theory and applications, with special emphasis on mathematical modeling, computational techniques, and examples from the biological sciences. It can serve as a textbook for graduate students in applied mathematics, biostatistics, computational biology, computer science, physics, and statistics. Readers should have a working knowledge of multivariate calculus, linear algebra, ordinary differential equations, and elementary probability theory. Chapter', 12346, NULL, 'For Alyson', 1293944400, 2011037, 0),
(15801, NULL, 'Statistical Programming in SAS', 'Professor A John Bailer, PhD, John A Bailer', 2010, 'SAS Publishing', 'In Statistical Programming in SAS, author A. John Bailer integrates SAS tools with interesting statistical applications and uses SAS 9.2 as a platform to introduce programming ideas for statistical analysis, data management, and data display and simulation. Written using a reader-friendly and narrative style, the book includes extensive examples and case studies to present a well-structured introduction to programming issues. This book has two parts. The first part addresses the nuts and bolts o', 12348, NULL, 'For Alyson', 1293944400, 2011039, 1),
(15802, NULL, 'Elementary Statistics Using SAS', 'Sandra Schlotzhauer', 2009, 'SAS Publishing', 'Bridging the gap between statistics texts and SAS documentation, Elementary Statistics Using SAS is written for those who want to perform analyses to solve problems. The first section of the book explains the basics of SAS data sets and shows how to use SAS for descriptive statistics and graphs. The second section discusses fundamental statistical concepts, including normality and hypothesis testing. The remaining sections of the book show analyses for comparing two groups, comparing multiple gr', 12349, NULL, '', 1293944400, 2011040, 1),
(15835, NULL, 'Monte Carlo Simulation for the Pharmaceutical Industry: Concepts, Algorithms, and Case Studies', 'Mark Chang', 2010, 'CRC Press', 'Helping you become a creative, logical thinker and skillful "simulator," Monte Carlo Simulation for the Pharmaceutical Industry: Concepts, Algorithms, and Case Studies provides broad coverage of the entire drug development process, from drug discovery to preclinical and clinical trial aspects to commercialization. It presents the theories and methods needed to carry out computer simulations efficiently, covers both descriptive and pseudocode algorithms that provide the basis for implementation o', 12380, NULL, NULL, 1293944400, 2011071, 2),
(15833, 2, 'Probability Theory An Analytic View, 2nd edition', 'Daniel W. Stroock', 2011, 'Cambridge', NULL, 12378, NULL, NULL, 1293944400, 2011069, NULL),
(16182, NULL, 'Genomic Clinical Trials and Predictive Medicine', 'Simon, Richard M.', 2013, 'Cambridge', 'Genomics is majorly impacting therapeutics development in medicine. This book contains up-to-date information on the use of genomics in the design and analysis of therapeutic clinical trials with a focus on novel approaches that provide a reliable basis for identifying which patients are most likely to benefit from each treatment. It is oriented to both clinical investigators and statisticians. For clinical investigators, it includes background information on clinical trial design and statistica', 12721, NULL, NULL, 1361396104, 2013014, 1),
(16190, NULL, 'Statistical Methods With Applications to Demography and life insurance', 'Estate Khmaladze', 2013, 'CRC Press', 'Suitable for statisticians, mathematicians, actuaries, and students interested in the problems of insurance and analysis of lifetimes, Statistical Methods with Applications to Demography and Life Insurance presents contemporary statistical techniques for analyzing life distributions and life insurance problems. It not only contains traditional material but also incorporates new problems and techniques not discussed in existing actuarial literature.\nThe book mainly focuses on the analysis of an i', 12729, NULL, NULL, 1365015849, 2013022, 2),
(15808, 2, 'Survival Analysis Using SAS: A Practical Guide, 2nd edition', 'Paul D. Allison', 2010, 'Cary, NC: SAS Publishing', 'Easy to read and comprehensive, Survival Analysis Using SAS: A Practical Guide, Second Edition, by Paul D. Allison, is an accessible, data-based introduction to methods of survival analysis. Researchers who want to analyze survival data with SAS will find just what they need with this fully updated new edition that incorporates the many enhancements in SAS procedures for survival analysis in SAS 9. Although the book assumes only a minimal knowledge of SAS, more experienced users will learn new t', 12355, NULL, '', 1293944400, 2011046, 2),
(15809, 3, 'Common Statistical Methods for Clinical Research with SAS Examples, Third Edition', 'Glenn Walker, Jack Shostak', 2010, 'SAS Publishing', 'Glenn Walker and Jack Shostak''s Common Statistical Methods for Clinical Research with SAS Examples, Third Edition, is a thoroughly updated edition of the popular introductory statistics book for clinical researchers. This new edition has been extensively updated to include the use of ODS graphics in numerous examples as well as a new emphasis on PROC MIXED. Straightforward and easy to use as either a text or a reference, the book is full of practical examples from clinical research to illustrate', 12356, NULL, 'For Alyson', 1293944400, 2011047, 2);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(15812, NULL, 'An introduction to scientific computation and programming', 'Daniel Kaplan', 2004, 'Thomson-Brooks/Cole', 'This book provides students with the modern skills and concepts needed to be able to use the computer expressively in scientific work. The author takes an integrated approach by covering programming, important methods and techniques of scientific computation (graphics, the organization of data, data acquisition, numerical methods, etc.) and the organization of software. Balancing the best of the teach-a-package and teach-a-language approaches, the book teaches general-purpose language skills and', 12359, NULL, 'For Alyson', 1293944400, 2011050, 0),
(15813, NULL, 'Finitary Probabilistic Methods in Econophysics', 'Ubaldo Garibaldi, Enrico Scalas', 2010, 'Cambridge University Press', 'Econophysics applies the methodology of physics to the study of economics. However, whilst physicists have good understanding of statistical physics, they may be unfamiliar with recent advances in statistical conjectures, including Bayesian and predictive methods. Equally, economists with knowledge of probabilities do not have a background in statistical physics and agent-based models. Proposing a unified view for a dynamic probabilistic approach, this book is useful for advanced undergraduate a', 12360, NULL, 'For Alyson', 1293944400, 2011051, 1),
(15814, NULL, 'Cross-Cultural Research Methods in Psychology', 'David Matsumoto, Fons J. R. van de Vijver', 2011, 'Cambridge University Press', '"Cross-cultural research is now an undeniable part of mainstream psychology and has had a major impact on conceptual models of human behavior. Although it is true that the basic principles of social psychological methodology and data analysis are applicable to cross-cultural research, there are a number of issues that are distinct to it, including managing incongruities of language and quantifying cultural response sets in the use of scales. Cross-Cultural Research Methods in Psychology provides', 12361, NULL, 'For Alyson', 1293944400, 2011052, 1),
(15815, NULL, 'Biplots in Practice', 'Michael Greenacre', 0, 'Fundacion BBVA', 'Biplots in Practice', 12362, NULL, 'For Alyson', 1293944400, 2011053, 0),
(15816, NULL, 'Digital Nets and Sequences: Discrepancy Theory and Quasi-Monte Carlo Integration', 'Josef Dick, Friedrich Pillichshammer', 2010, 'Cambridge University Press', 'Indispensable for students, invaluable for researchers, this comprehensive treatment of contemporary quasi-Monte Carlo methods, digital nets and sequences, and discrepancy theory starts from scratch with detailed explanations of the basic concepts and then advances to current methods used in research. As deterministic versions of the Monte Carlo method, quasi-Monte Carlo rules have increased in popularity, with many fruitful applications in mathematical practice. These rules require nodes with g', 12363, NULL, 'For Alyson', 1293944400, 2011054, 0),
(15817, NULL, 'Data Management Using Stata: A Practical Handbook', 'Michael N. Mitchell', 2010, 'Stata Press', 'Using simple language and illustrative examples, this book comprehensively covers data management tasks that bridge the gap between raw data and statistical analysis. Rather than focus on clusters of commands, the author takes a modular approach that enables readers to quickly identify and implement the necessary task without having to access background information first. Each section in the chapters presents a self-contained lesson that illustrates a particular data management task via examples', 12364, NULL, NULL, 1293944400, 2011055, 0),
(15818, NULL, 'Experimental Political Science and the Study of Causality: From Nature to the lab', 'Rebecca B. Morton, Kenneth C. Williams', 2010, 'Cambridge University Press', '"Increasingly, political scientists use the term ''experiment'' or ''experimental'' to describe their empirical research. One of the primary reasons for doing so is the advantage of experiments in establishing causal inferences. In this book, Rebecca B. Morton and Kenneth C. Williams discuss in detail how experiments and experimental reasoning with observational data can help researchers determine causality. They explore how control and random assignment mechanisms work, examining both the Rubin cau', 12365, NULL, 'For Alyson', 1293944400, 2011056, 1),
(15819, NULL, 'Design and Analyse Your Experiment Using Minitab', 'Tony Greenfield, and Andrew V. Metcalfe', 2007, 'John Wiley &amp; Sons', 'Progress in engineering and the physical sciences, agriculture and the biological sciences, and to some extent social science, depends on experiments. The design of such experiments is crucial. If they are poorly designed they will be inefficient and may lead to misleading conclusions. Nevertheless, many investigators and researchers in industry and universities are expected to design and analyze their own experiments. Even if investigators do have access to statistical advice, they will be expe', 12366, NULL, 'For Alyson', 1293944400, 2011057, 1),
(15820, NULL, 'Statistical Programming with SAS/IML Software', 'Rick Wicklin, PhD, SAS Publishing', 2010, 'SAS Publishing', 'SAS/IML software is a powerful tool for data analysts because it enables implementation of statistical algorithms that are not available in any SAS procedure. Rick Wicklin''s Statistical Programming with SAS/IML Software is the first book to provide a comprehensive description of the software and how to use it. He presents tips and techniques that enable you to use the IML procedure and the SAS/IML Studio application efficiently. In addition to providing a comprehensive introduction to the softwa', 12367, NULL, 'For Alyson', 1293944400, 2011058, 2),
(15836, NULL, 'Statistical and Econometric Methods for Transportation Data Analysis, 2nd Edition', 'Simon P. Washington, Matthew G. Karlaftis, Fred L. Mannering', 2009, 'CRC Press', 'The complexity, diversity, and random nature of transportation problems necessitates a broad analytical toolbox. Describing tools commonly used in the field, Statistical and Econometric Methods for Transportation Data Analysis, Second Editionprovides an understanding of a broad range of analytical tools required to solve transportation problems. It includes a wide breadth of examples and case studies covering applications in various aspects of transportation planning, engineering, safety, and ec', 12381, NULL, NULL, 1293944400, 2011072, 0),
(15822, NULL, 'Practical Data Analysis with Jmp', 'Robert Carver', 2010, 'SAS Publishing', 'Being an effective analyst or a well-informed consumer of analyses requires that you know how to properly define the problem, apply suitable statistical techniques, and clearly and honestly communicate the results. Being a well-informed consumer of analyses requires the same skills so that you can recognize them in action. Robert Carver''s Practical Data Analysis with JMP uses the powerful interactive and visual approach of JMP to introduce readers to the logic and methods of statistical thinking', 12369, NULL, 'For Alyson', 1293944400, 2011060, 0),
(15823, NULL, 'JMP Means Business: Statistical Models for Management', 'Josef Schmee, Josef Schmee and Jane Oppenlander, Jane E. Oppenlander', 2010, 'SAS Publishing', 'JMP Means Business: Statistical Models for Management, by Josef Schmee and Jane Oppenlander, covers basic methods and models of classical statistics. Designed for business and MBA students, as well as industry professionals who need to use and interpret statistics, JMP Means Business covers data collection, descriptive statistics, distributions, confidence intervals and hypothesis tests, analysis of variance, contingency tables, simple and multiple regression, and exponential smoothing of time s', 12370, NULL, 'For Alyson', 1293944400, 2011061, 2),
(15824, NULL, 'Nonparametric Statistical Inference, Fifth Edition', 'Jean Dickinson Gibbons, Subhabrata Chakraborti', 2011, 'Taylor and Francis', 'Proven Material for a Course on the Introduction to the Theory and/or on the Applications of Classical Nonparametric MethodsSince its first publication in 1971, Nonparametric Statistical Inference has been widely regarded as the source for learning about nonparametric statistics. The fifth edition carries on this tradition while thoroughly revising at least 50 percent of the material.New to the Fifth EditionUpdated and revised contents based on recent journal articles in the literature A new sec', 12371, NULL, 'For Alyson', 1293944400, 2011062, 2),
(15826, 4, 'Fundamentals of Clinical Trials (4th Edition)', 'Lawrence M. Friedman, Curt D. Furberg, David L. Demets', 2010, 'Springer', 'This is the fourth edition of very successful textbook on clinical trials methodology, written by three recognized experts who have long and extensive experience in all areas of clinical trials. Most chapters have been revised considerably from the third edition. A chapter on ethics has been added and topics such as noninferiority and adaptive designs now receive considerable discussion. There is much new material on adverse events, adherence, data monitoring, and issues in analysis.This book in', 12373, NULL, 'For Alyson', 1293944400, 2011064, 2),
(16180, NULL, 'Chi-Squared Goodness of Fit Tests With Applications', 'N. Balakrishnan, Vassilly Voinov, M. S. Nikulin', 2013, 'Academic Press', 'Chi-Squared Goodness of Fit Tests with Applications provides a thorough and complete context for the theoretical basis and implementation of Pearson''s monumental contribution and its wide applicability for chi-squared goodness of fit tests. The book is ideal for researchers and scientists conducting statistical analysis in processing of experimental data as well as to students and practitioners with a good mathematical background who use statistical methods. The historical context, especially Ch', 12719, NULL, NULL, 1360014578, 2013012, 1),
(15828, NULL, 'Unthinking: The Surprising Forces Behind What We Buy', 'Harry Beckwith', 2011, 'Hachette Digital', 'What do Howard Hughes and 50 Cent have in common, and what do they tell us about Americans and our desires? Why did Sean Connery stop wearing a toupee, and what does this tell us about American customers for any product? What one thing did the Beatles, Malcolm Gladwell and Nike all notice about Americans that helped them win us over? Which uniquely American traits may explain the plights of Krispy Kreme, Ford, and GM, and the risks faced by Starbuck''s? Why, after every other plea failed, did "Cl', 12375, NULL, 'For Alyson', 1293944400, 2011066, 0),
(15844, NULL, 'Biosurveillance: Methods and Case Studies', 'Taha Kass-Hout, Xiaohui Zhang', 2011, 'Taylor and Francis', 'Biosurveillance: A Health Protection Priority addresses the problems and promise of timely biosurveillance, with a particular focus on the role it must play. It describes a general concept of operations with reference information system architecture and investigates the primary assumptions that are needed to assure the success of a biosurveillance initiative. Numerous case studies focus on local, regional, and national implementation. The book also explores future innovations in biosurveillance,', 12393, NULL, NULL, 1293944400, 2011084, 2),
(15845, NULL, 'Handbook of Fitting Statistical Distributions with R', 'Zaven A. Karian, Edward J. Dudewicz', 2011, 'Taylor and Francis', 'With the development of new fitting methods, their increased use in applications, and improved computer languages, the fitting of statistical distributions to data has come a long way since the introduction of the generalized lambda distribution (GLD) in 1969. Handbook of Fitting Statistical Distributions with R presents the latest and best methods, algorithms, and computations for fitting distributions to data. It also provides in-depth coverage of cutting-edge applications. The book begins wit', 12394, NULL, '1/27/12 Jim Albert will try to find a reviewer within next few months', 1293944400, 2011085, 1),
(15846, NULL, 'Mathematics for the Environment', 'Martin Walter', 2011, 'Taylor &amp; Francis', 'Suitable for a general studies course on mathematics, this textbook deals with the mathematics of the environment. It presents the mathematics by building patterns in numbers, arithmetic, and algebra and by using axioms as building blocks. A truly interdisciplinary study of mathematics, the text explores examples in population models, DNA computing, epidemics, financial mathematics, and more. It encourages students to use Excel spreadsheets to solve many of the open-ended problems. Along with nu', 12395, NULL, NULL, 1293944400, 2011086, 0),
(15847, NULL, 'Bias and Causation: Models and Judgment for Valid Comparisons', 'Herbert I. Weisberg', 2010, 'John Wiley and Sons', 'A one-of-a-kind resource on identifying and dealing with bias in statistical research on causal effectsDo cell phones cause cancer? Can a new curriculum increase student achievement? Determining what the real causes of such problems are, and how powerful their effects may be, are central issues in research across various fields of study. Some researchers are highly skeptical of drawing causal conclusions except in tightly controlled randomized experiments, while others discount the threats posed', 12396, NULL, NULL, 1293944400, 2011087, 0),
(15848, NULL, 'Statistical Process Control for Real-World Applications', 'William A. Levinson', 2010, 'Taylor &amp; Francis', '"Picking up where the textbooks usually leave off, this book equips readers to deal with non-normal applications scientifically and to explain the methodology to suppliers and customers. It shows how to handle uncooperative real-world processes that do not follow textbook assumptions. The text explains how to set realistic control limits and calculate meaningful process capability indices for non-normal applications. Higlighting the pitfalls of assuming normality for all processes, the book addr', 12397, NULL, NULL, 1293944400, 2011088, 0),
(15849, 7, 'A Second Course in Statistics: Regression Analysis, 7th edition', 'William Mendenhall, Terry Sincich', 2012, 'Pearson Education', 'A Second Course in Statistics: Regression Analysis, Seventh Edition, focuses on building linear statistical models and developing skills for implementing regression analysis in real situations. This text offers applications for engineering, sociology, psychology, science, and business. The authors use real data and scenarios extracted from news articles, journals, and actual consulting problems to show how to apply the concepts. In addition, seven case studies, now located throughout the text af', 12398, NULL, NULL, 1293944400, 2011089, 2),
(15850, 5, 'An Introduction to Mathematical Statistics and Its Applications', 'Richard J. Larsen, Morris L. Marx', 2012, 'Pearson Education', 'Noted for its integration of real-world data and case studies, this text offers sound coverage of the theoretical aspects of mathematical statistics. The authors demonstrate how and when to use statistical methods, while reinforcing the calculus that students have mastered in previous courses. Throughout theFifth Edition,the authors have added and updated examples and case studies, while also refining existing features that show a clear path from theory to practice.', 12399, NULL, NULL, 1293944400, 2011090, NULL),
(15851, 4, 'Probability and Statistics, 4th edition', 'Morris H. DeGroot, Mark J. Schervish', 2012, 'Pearson Education', 'The revision of this well-respected text presents a balanced approach of the classical and Bayesian methods and now includes a chapter on simulation (including Markov chain Monte Carlo and the Bootstrap), coverage of residual analysis in linear models, and many examples using real data. Calculus is assumed as a prerequisite, and a familiarity with the concepts and elementary properties of vectors and matrices is a plus.', 12400, NULL, NULL, 1293944400, 2011091, 2),
(15852, 9, 'Probability and Statistics for Engineers and Scientists, Ninth Edition', 'Ronald E. Walpole, Sharon L. Myers, Raymond H. Myers, Keying Ye', 2011, 'Prentice Hall', 'This classic text provides a rigorous introduction to basic probability theory and statistical inference, with a unique balance of theory and methodology. Interesting, relevant applications use real data from actual studies, showing how the concepts and methods can be used to solve problems in the field. This revision focuses on improved clarity and deeper understanding.', 12401, NULL, NULL, 1293944400, 2011092, 2),
