(15855, NULL, 'Stats: Data and Models, 3rd edition', 'Richard DeVeaux, Paul Velleman, David Bock', NULL, 'Addison Wesley/Pearson', NULL, 12404, NULL, NULL, 1293944400, 2011095, NULL),
