(15858, 4, 'Statistics for the Life Sciences, 4th edition', 'Samuels, Witmer, Schaffner', NULL, 'Prentice', 'Statistics for the Life Sciences, Fourth Edition, covers the key concepts of statistics as applied to the life sciences, while incorporating the tools and themes of modern data analysis. This text uses an abundance of real data in the exercises and examples, and minimizes computation, so that readers can focus on the statistical concepts and issues, not the mathematics. Basic algebra is assumed as a prerequisite.\n\n', 12407, NULL, NULL, 1293944400, 2011098, 0),
(15886, NULL, 'Hungarian Problem Book IV', 'Robert Barrington Leigh and Andy Liu', NULL, 'Mathematical Association of America', 'The EÃƒÂ¶tvÃƒÂ¶s Mathematics Competition is the oldest high school mathematics competition in the world, dating back to 1894. This book is a continuation of Hungarian Problem Book III and takes the contest through 1963. Forty-eight problems in all are presented in this volume. Problems are classified under combinatorics, graph theory, number theory, divisibility, sums and differences, algebra, geometry, tangent lines and circles, geometric inequalities, combinatorial geometry, trigonometry and s', 12435, NULL, NULL, 1293944400, 2011126, 0),
(15860, NULL, 'Statistics for Management and Economics (9th edition)', 'Gerald Keller', 2011, 'Cengage Learning', 'This worldwide best-selling business statistics book teaches readers how to apply statistics to real business problems through the author''s unique three-step approach to problem solving. Readers learn to IDENTIFY the right technique by focusing on the problem objective and data type. They then learn to COMPUTE the statistics either by hand, using Excel, or using MINITAB. Finally, they INTERPRET the results in the context of the problem. Keller''s approach enhances user comprehension as well as pr', 12409, NULL, 'ISBN is for the non-instructors edition.', 1293944400, 2011100, 1),
(15887, NULL, 'Hands-on Intermediate Econometrics Using R', 'Hrishikesh D Vinod', 2008, 'World Scientific', 'This book explains how to use R software to teach econometrics by providing interesting examples, using actual data applied to important policy issues. It helps readers choose the best method from a wide array of tools and packages available. The data used in the examples along with R program snippets, illustrate the economic theory and sophisticated statistical methods extending the usual regression. The R program snippets are not merely given as black boxes, but include detailed comments which', 12436, NULL, NULL, 1293944400, 2011127, 1),
(15862, NULL, 'Evaluating Learning Algorithms: A Classification Perspective', 'Nathalie Japkowicz, Mohak Shah', 2011, 'Cambridge University Press', 'This book offers a solid basis for conducting performance evaluations of learning algorithms in practical settings with an emphasis on classification algorithms. The authors describe several techniques designed to deal with performance measures and methods, error estimation or re-sampling techniques, statistical significance testing, data set selection, and evaluation benchmark design.', 12411, NULL, NULL, 1293944400, 2011102, 0),
(15863, NULL, 'Chaos: The Science of Predictable Random Motion', 'Richard Kautz', 2010, 'Oxford University Press', 'Based on only elementary mathematics, this engaging account of chaos theory bridges the gap between introductions for the layman and college-level texts. It develops the science of dynamics in terms of small time steps, describes the phenomenon of chaos through simple examples, and concludes with a close look at a homoclinic tangle, the mathematical monster at the heart of chaos. The presentation is enhanced by many figures, animations of chaotic motion (available on a companion CD), and biograp', 12412, NULL, NULL, 1293944400, 2011103, 0),
(15896, 3, 'Introductory Statistics, 3rd edition', 'Sheldon M. Ross', 2010, 'Academic Press', 'This updated text provides a superior introduction to applied probability and statistics for engineering or science majors. Ross emphasizes the manner in which probability yields insight into statistical problems; ultimately resulting in an intuitive understanding of the statistical procedures most often used by practicing engineers and scientists. Real data sets are incorporated in a wide variety of exercises and examples throughout the book, and this emphasis on data motivates the probability ', 12445, NULL, NULL, 1293944400, 2011136, 1),
(15895, NULL, 'Statistical bioinformatics with R', 'Sunil K. Mathur', 2010, 'Academic Press', 'Designed for a one or two semester senior undergraduate or graduate bioinformatics course, Statistical Bioinformatics takes a broad view of the subject - not just gene expression and sequence analysis, but a careful balance of statistical theory in the context of bioinformatics applications. The inclusion of R code as well as the development of advanced methodology such as Bayesian and Markov models provides students with the important foundation needed to conduct bioinformatics. Ancillary list:', 12444, NULL, NULL, 1293944400, 2011135, 0),
(15894, 4, 'Statistical Distributions, 4th edition', 'Merran Evans, Catherine Forbes, Nicholas Hastings, Brian Peacock', 2010, 'John Wiley &amp; Sons', 'This new edition continues to illustrate the application of statistical methods to research across various disciplines, including medicine, engineering, business/finance, and the social sciences. Thoroughly revised and updated, the authors have refreshed this book to reflect the changes and current trends in statistical distibution theory that have occurred since the publication of the previous edition eight years ago. The introductory chapters introduce the fundamental concepts of the distribut', 12443, NULL, NULL, 1293944400, 2011134, 1),
(15893, NULL, 'Optimal High-Throughput Screening: Practical Experimental Design and Data Analysis for Genome-Scale RNAi Research', 'Xiaohua Douglas Zhang', 2011, 'Cambridge University Press', 'Optimal High-Throughput Screening: Practical Experimental Design and Data Analysis for Genome-Scale RNAi Research', 12442, NULL, NULL, 1293944400, 2011133, 1),
(15891, NULL, 'IBM SPSS Statistics 18 Made Simple', 'Paul R. Kinnear, Colin D. Gray', 2011, 'Taylor &amp; Francis Ltd.', 'This two-colour new edition of one of the most widely read textbooks in its field introduces the reader to data analysis with the most versatile statistical package on the market: IBM SPSS Statistics 18 . Although each new release of SPSS Statistics features new options and improvements, there remains a core of fundamental operating principles which apply to all the versions issued in recent years.This friendly and informal book combines simplicity and clarity of presentation with a comprehensiv', 12440, NULL, 'Could not find on Psy Press website for pricing! New version already out.', 1293944400, 2011131, 2),
(15888, NULL, 'Handbook of Ethics in Quantitative Methodology: A Handbook for Researchers', 'Abigail T. Panter, Sonya K. Sterba', 2011, 'Taylor &amp; Francis', 'This comprehensive Handbook is the first to provide a practical, interdisciplinary review of ethical issues as they relate to quantitative methodology including how to present evidence for reliability and validity, what comprises an adequate tested population, and what constitutes scientific knowledge for eliminating biases. The book uses an ethical framework that emphasizes the human cost of quantitative decision making to help researchers understand the specific implications of their choices. ', 12437, NULL, NULL, 1293944400, 2011128, 2),
(15890, NULL, 'Cross-Cultural Analysis Methods and Applications', 'Eldad Davidov, Peter Schmidt and Jaak Billiet', 2011, 'Routledge', 'Intended to bridge the gap between the latest methodological developments and cross-cultural research, this interdisciplinary resource presents the latest strategies for analyzing cross-cultural data. Techniques are demonstrated through the use of applications that employ cross national data sets such as the latest European Social Survey. With an emphasis on the generalized latent variable approach, internationallyâ€“prominent researchers from a variety of fields explain how the methods work, ho', 12439, NULL, NULL, 1293944400, 2011130, 1),
(15892, 2, 'Encyclopaedic Companion to Medical Statistics', 'Brian S. Everitt, Christopher Palmer', 2011, 'John Wiley &amp; Sons', 'The Encyclopaedic Companion to Medical Statistics, contains a readable accounts of almost 400 statistical topics central to current medical research. Each entry has been written by an individual chosen for both their expertise in the field and their ability to communicate statistical concepts successfully to medical researchers. Real examples from the biomedical literature and relevant illustrations feature in many entries, and extensive cross-referencing signposts the reader to related entries.', 12441, NULL, NULL, 1293944400, 2011132, 1),
(15889, NULL, 'Categorical Data Analysis for the Behavioral Sciences', 'Razia Azen and Cindy M. Walker', 2011, 'Routledge', 'eaturing a practical approach with numerous examples, this book focuses on helping the reader develop a conceptual, rather than technical, understanding of categorical methods, making it a much more accessible text than others on the market. The authors cover common categorical analyses and emphasize specific research questions that can be addressed by each analytic procedure so that readers are able to address the research questions they wish to answer.  To achieve this goal, the authors:\n\nRevi', 12438, NULL, NULL, 1293944400, 2011129, 2),
(15899, NULL, 'Essential Statistical Methods for Medical Statistics', 'C.R. Rao, J. Philip Miller & D.C. Rao', 2011, 'Elsevier Science &amp; Technology', 'Essential Statistical Methods for Medical Statistics presents only key contributions which have been selected from the volume in the Handbook of Statistics: Medical Statistics, Volume 27 (2009). While the use of statistics in these fields has a long and rich history, the explosive growth of science in general, and of clinical and epidemiological sciences in particular, has led to the development of new methods and innovative adaptations of standard methods. This volume is appropriately focused f', 12448, NULL, NULL, 1293944400, 2011139, 1),
(15900, NULL, 'Essential Methods for Design Based Sample Surveys', 'Danny Pfeffermann, C. R. Rao', 2011, 'Elsevier Science &amp; Technology', 'Essential Methods for Design Based Sample Surveys presents key method contributions selected from the volume in the Handbook of Statistics: Sample Surveys: Design, Methods and Applications, Vol. 29a (2009). This essential reference provides specific aspects of sample survey design, with references to important contributions and available software. The content is aimed at researchers and practitioners who use statistical methods in design based sample surveys and market research. This book presen', 12449, NULL, NULL, 1293944400, 2011140, 2),
(15901, NULL, 'Clinical Trial Data Analysis Using R', 'Ding-Geng Chen, Karl E. Peace', 2011, 'Taylor &amp; Francis', 'With examples based on the authors'' 30 years of real-world experience in many areas of clinical drug development, this book provides a thorough presentation of clinical trial methodology. It presents detailed step-by-step illustrations on the implementation of the open-source software R. Case studies demonstrate how to select the appropriate clinical trial data. The authors introduce the corresponding biostatistical analysis methods, followed by the step-by-step data analysis using R. They also ', 12450, NULL, NULL, 1293944400, 2011141, 2),
(15902, NULL, 'Game Theory and the Humanities: Bridging Two Worlds', 'Steven J. Brams', 2011, 'MIT Press', 'Game theory models are ubiquitous in economics, common in political science, and increasingly used in psychology and sociology; in evolutionary biology, they offer compelling explanations for competition in nature. But game theory has been only sporadically applied to the humanities; indeed, we almost never associate mathematical calculations of strategic choice with the worlds of literature, history, and philosophy. And yet, as Steven Brams shows, game theory can illuminate the rational choices', 12451, NULL, NULL, 1293944400, 2011142, 0),
(15903, NULL, 'Dose Finding by the Continual Reassessment Method', 'Ying Kuen Cheung', 2011, 'Taylor and Francis', 'This book presents the continual reassessment method (CRM) as a tool for dose-finding studies. With a focus on the implementation and practice of the CRM and its variations, it explains how the CRM may be calibrated and extended to suit common clinical settings. The book includes examples of real clinical trials data to illustrate the calibration techniques and shows how R can be used to carry out the techniques. It reviews the literature, related methodology, and theoretical properties of the C', 12452, NULL, NULL, 1293944400, 2011143, 2),
(15904, NULL, 'Modelling and Quantitative Methods in Fisheries, Second Edition', 'Malcolm Haddon, Malcolm Haddon Haddon', 2011, 'Chapman & Hall/CRC Press', 'Revised and restructured, Modeling and Quantitative Methods in Fisheries, Second Edition provides an accessible introduction to quantitative methods in fisheries. This book features new material on tests and comparisons as well as new chapters on length-based models and estimating uncertainty using Bayesian methods. It presents a structured, step-by-step approach that introduces the material in a logical sequence. This text covers a range of topics such as simple linear regression, complex nonli', 12453, NULL, NULL, 1293944400, 2011144, 2),
(15905, NULL, 'Wizardry: Baseball''s All-Time Greatest Fielders Revealed', 'Michael A. Humphreys', 2011, 'Oxford University Press US', 'The systematic analysis of baseball statistics, often called "sabermetrics," has evolved in recent years to resemble something of a science, attracting fans from diverse professional and educational backgrounds, all fascinated by the analysis itself and its insights into the game. But one problem has defied solution: estimating runs saved by fielders throughout history. Traditional statistics include errors and plays made, but not hits that could or should have been prevented. The latter can now', 12454, NULL, NULL, 1293944400, 2011145, 1),
(15906, NULL, 'Quantitative Risk Assessment: The Scientific Platform', 'Terje Aven', 2011, 'Cambridge University Press', '"Quantitative risk assessments cannot eliminate risk, nor can they resolve trade-offs. They can, however, guide principled risk management and reduction - if the quality of assessment is high and decision makers understand how to use it. This book buildsa unifying scientific framework for discussing and evaluating the quality of risk assessments and whether they are fit for purpose. Uncertainty is a central topic. In practice, uncertainties about inputs are rarely reflected in assessments, with ', 12455, NULL, NULL, 1293944400, 2011146, 2),
(15907, NULL, 'Statistical Learning for Biomedical Data', 'James D. Malley, Karen G. Malley, Sinisa Pajevic', 2011, 'Cambridge University Press', 'Biomedical researchers need machine learning techniques to make predictions such as survival/death or response to treatment when data sets are large and complex. This highly motivating introduction to these machines explains underlying principles in nontechnical language, using many examples and figures, and connects these new methods to familiar techniques.', 12456, NULL, NULL, 1293944400, 2011147, 0),
(15908, 2, 'Numerical Methods of Statistics, 2nd edition', 'John F. Monahan', 2011, 'Cambridge University Press', 'This book explains how computer software is designed to perform the tasks required for sophisticated statistical analysis. For statisticians, it examines the nitty-gritty computational problems behind statistical methods. For mathematicians and computer scientists, it looks at the application of mathematical tools to statistical problems. The first half of the book offers a basic background in numerical analysis that emphasizes issues important to statisticians. The next several chapters cover a', 12457, NULL, NULL, 1293944400, 2011148, 0),
(15909, NULL, 'Practical Statistical Methods: A Sas Programming Approach', 'Lakshmi Padgett', 2011, 'CRC', 'Practical Statistical Methods: A Sas Programming Approach', 12458, NULL, NULL, 1293944400, 2011149, 2),
(15910, NULL, 'Multivariate Generalized Linear Mixed Models Using R', 'Damon M. Berridge, Robert Crouchley', 2011, 'CRC Press', 'To provide researchers with the ability to analyze large and complex data sets using robust models, this book presents a unified framework for a broad class of models that can be applied using a dedicated R package (Sabre). The first five chapters cover the analysis of multilevel models using univariate generalized linear mixed models (GLMMs). The next few chapters extend to multivariate GLMMs and the last chapters address more specialized topics, such as parallel computing for large-scale analy', 12459, NULL, NULL, 1293944400, 2011150, 2),
(15919, NULL, 'Data Clustering in C++: An Object-Oriented Approach', 'Guojun Gan', 2011, 'Taylor &amp; Francis', 'Data clustering is a highly interdisciplinary field, the goal of which is to divide a set of objects into homogeneous groups such that objects in the same group are similar and objects in different groups are quite distinct. Thousands of theoretical papers and a number of books on data clustering have been published over the past 50 years. However, few books exist to teach people how to implement data clustering algorithms. This book was written for anyone who wants to implement or improve their', 12468, NULL, NULL, 1293944400, 2011159, 2),
