(15913, NULL, 'Expeditions in Mathematics', 'Tatiana Shubin, David F. Hayes & Gerald L. Alexanderson, Eds.', 2011, 'MAA Spectrum', 'This book is the second volume based on lectures for pre-college students given by prominent mathematicians in the Bay Area Mathematical Adventures (BAMA). This book reflects the flavor of the BAMA lectures and the excitement they have generated among the high school and middle school students in the Silicon Valley. The topics cover a wide range of mathematical subjects each treated by a leading proponent of the subject at levels designed to challenge and attract students whose mathematical inte', 12462, NULL, NULL, 1293944400, 2011153, 0),
(15914, NULL, 'Hadamard Expansions and Hyperasymptotic Evaluation: An Extension of the ...', 'R. B. Paris', 2011, 'Cambridge University Press', '"The author describes the recently developed theory of Hadamard expansions applied to the high-precision (hyperasymptotic) evaluation of Laplace and Laplace-type integrals. This brand new method builds on the well-known asymptotic method of steepest descents, of which the opening chapter gives a detailed account illustrated by a series of examples of increasing complexity. A discussion of uniformity problems associated with various coalescence phenomena, the Stokes phenomenon and hyperasymptotic', 12463, NULL, NULL, 1293944400, 2011154, 0),
(15915, NULL, 'Handbook of Markov Chain Monte Carlo: Methods and Applications', 'Steve Brooks, Andrew Gelman, Galin Jones, Xiao-Li Meng, eds.', 2011, 'Chapman & Hall/CRC', 'Since their popularization in the 1990s, Markov chain Monte Carlo (MCMC) methods have revolutionized statistical computing and have had an especially profound impact on the practice of Bayesian statistics. Furthermore, MCMC methods have enabled the development and use of intricate models in an astonishing array of disciplines as diverse as fisheries science and economics. The wide-ranging practical importance of MCMC has sparked an expansive and deep investigation into fundamental Markov chain t', 12464, NULL, NULL, 1293944400, 2011155, 2),
(15916, NULL, 'Statistical Approaches to Measurement Invariance', 'Roger Millsap', 2011, 'Taylor and Francis', 'This book reviews the statistical procedures used to detect measurement bias. Measurement bias is examined from a general latent variable perspective so as to accommodate different forms of testing in a variety of contexts including cognitive or clinical variables, attitudes, personality dimensions, or emotional states. Measurement models that underlie psychometric practice are described, including their strengths and limitations. Practical strategies and examples for dealing with bias detection', 12465, NULL, NULL, 1293944400, 2011156, 2),
(15917, NULL, 'From Measures to ITO Integrals', 'Ekkehard Kopp', 2011, 'Cambridge University Press', 'gives a clear account of measure theory, leading via L2-theory to Brownian motion, IT0Â¯Â integrals and a brief look at martingale calculus. Modern probability theory and the applications of stochastic processes rely heavily on an understanding of basic measure theory. This text is ideal preparation for graduate-level courses in mathematical finance and perfect for any reader seeking a basic understanding of the mathematics underpinning the various applications.', 12466, NULL, NULL, 1293944400, 2011157, 0),
(15918, NULL, 'Optimal Experimental Design with R', 'Dieter Rasch, Jurgen Pilz, Petr Simecek', 2011, 'Taylor and Francis', 'Optimal Experimental Design with R introduces experimenters to the philosophy of experimentation and the need for good design and data collection for experiments. It gives experimenters and statisticians guidance on how to construct optimum experimental designs and calculate the sample size needed using R programs. The book contains many detailed real-world examples that show how the R programs should be used. The authors discuss variations of the regression model, including linear and nonlinear', 12467, NULL, NULL, 1293944400, 2011158, 2),
(15991, NULL, 'SAS Essentials: A Guide to Mastering SAS for Research', 'Alan C. Elliott, Wayne A. Woodward', 2010, 'John Wiley and Sons', 'SAS Essentials provides an introduction to SAS statistical software, the premiere statistical data analysis tool for scientific research. Through its straightforward approach, the text presents SAS with step-by-step examples. With over fifteen years of teaching SAS courses and over fifty combined years of teaching and consulting by the authors, this valuable reference presents data manipulation and statistical techniques, including a website with examples. This textbook is essential for teachers', 12537, NULL, NULL, 1320778739, 2011228, 2),
(15921, NULL, 'Principles of Uncertainty', 'Joseph B. Kadane', 2011, 'Taylor &amp; Francis', 'An intuitive and mathematical introduction to subjective probability and Bayesian statistics.\n\nAn accessible, comprehensive guide to the theory of Bayesian statistics, Principles of Uncertainty presents the subjective Bayesian approach, which has played a pivotal role in game theory, economics, and the recent boom in Markov Chain Monte Carlo methods. Both rigorous and friendly, the book contains:\n\nIntroductory chapters examining each new concept or assumption\nJust-in-time mathematics â€“ the pre', 12470, NULL, NULL, 1293944400, 2011161, 2),
(15989, NULL, 'An R Companion to Linear Statistical Models', 'Christopher Hay-Jahans', 2011, 'CRC/Chapman & Hall', 'Focusing on user-developed programming,An R Companion to Linear Statistical Models serves two audiences: Those who are familiar with the theory and applications of linear statistical models and wish to learn or enhance their skills in R; and those who are enrolled in an R-based course on regression and analysis of variance. For those who have never used R, the book begins with a self-contained introduction to R that lays the foundation for later chapters. This book includes extensive and careful', 12535, NULL, NULL, 1319816950, 2011226, 1),
(15933, NULL, 'Basic Pharmacokinetics and Pharmacodynamics: An Integrated Textbook and ...', 'Sara E. Rosenbaum', 2011, 'John Wiley and Sons', 'With its clear, straightforward presentation, this text enables you to grasp all the fundamental concepts of pharmacokinetics and pharmacodynamics. This will allow you to understand the time course of drug response and dosing regimen design. Clinical models for concentration and response are described and built from the basic concepts presented in earlier chapters. Your understanding of the material will be enhanced by guided computer exercises conducted on a companion website. Simulations will ', 12480, NULL, NULL, 1293944400, 2011171, 1),
(15925, NULL, 'Statistical Inference: The Minimum Distance Approach', 'Ayanendranath Basu, Wen-tao Huang, Hiroyuki Shioya, Chanseok Park', 2011, 'Taylor and Francis', 'In many ways, estimation by an appropriate minimum distance method is one of the most natural ideas in statistics. However, there are many different ways of constructing an appropriate distance between the data and the model: the scope of study referred to by "Minimum Distance Estimation" is literally huge. Filling a statistical resource gap,Statistical Inference: The Minimum Distance Approachcomprehensively overviews developments in density-based minimum distance inference for independently and', 12473, NULL, NULL, 1293944400, 2011164, 2),
(15926, 6, 'Practical Business Statistics, 6th Edition', 'Andrew F. Siegel', 2012, 'Academic Press', 'Practical Business Statistics, Sixth Edition, is a conceptual, realistic, and matter-of-fact approach to managerial statistics that carefully maintains-but does not overemphasize-mathematical correctness. The book offers a deep understanding of how to learn from data and how to deal with uncertainty while promoting the use of practical computer applications. This teaches present and future managers how to use and understand statistics without an overdose of technical detail, enabling them to bet', 12474, NULL, NULL, 1293944400, 2011165, 1),
(15938, NULL, 'Targeted Learning: Causal Inference for Observational and Experimental Data', 'Mark van der Laan, Sherri Rose', 2011, 'Springer', 'The statistics profession is at a unique point in history. The need for valid statistical tools is greater than ever; data sets are massive, often measuring hundreds of thousands of measurements for a single subject. The field is ready to move towards clear objective benchmarks under which tools can be evaluated. Targeted learning allows (1) the full generalization and utilization of cross-validation as an estimator selection tool so that the subjective choices made by humans are now made by the', 12485, NULL, NULL, 1311623899, 2011176, 1),
(15928, NULL, 'Designing Diagrams: Making Information Accessible Through Design', 'Jan Gauguin, Aaron Marcus', 2011, 'BIS Publishers', 'A guide to the world of diagrammatic presentation of facts, figures, thoughts, processes, and relations. The effective design of a diagram is an art form in itself in that the creator must decipher complex information and put it into an easy-to-understand format that is accessible and visually pleasing to the end user. This book presents the information and inspiration that will allow designers to put the art into practice.This book will serve as a visual resource and course manual for designers', 12476, NULL, 'NO ruman numeral pages', 1293944400, 2011167, 1),
(15929, NULL, 'Gaussian Process Regression Analysis for Functional Data', 'Jian Qing Shi, Taeryon Choi', 2011, 'Taylor &amp; Francis', 'A Gaussian process is a type of stochastic process that is particularly useful for Bayesian inference of complex problems. This book presents an overview of Gaussian process regression, all of the necessary theory, and real-world applications from the fields of medicine and engineering. It covers the required background in regression and examines key aspects of the modeling process, including model selection as well as more advanced topics, such as mixture models and kernel-based methods. For im', 12477, NULL, NULL, 1293944400, 2011168, 2),
(15930, 5, 'Practical Multivariate Analysis, Fifth Edition', 'Abdelmonem Afifi, Virginia A. Clark, Susanne May', 2012, 'Taylor &amp; Francis', 'This classic textbook introduces multivariate analysis to non-statisticians in the biomedical, social, and management sciences. Each chapter in this fifth edition features an updated discussion and listing of computer software packages, including S-PLUS, SAS, SPSS, Stata, and STATISTICA. In addition to new references, new data sets, and new problems with solutions, this edition offers a brief discussion of R and provides a new chapter on multilevel analysis, which includes coverage of random- an', 12478, NULL, NULL, 1293944400, 2011169, 2),
(15931, NULL, 'Spatio-Temporal Heterogeneity: Concepts and Analyses', 'Pierre R. L. Dutilleul', 2011, 'Cambridge University Press', '"Attempts by ecologists to establish models for predicting the growth of a population or the fluctuations of a natural resource can be confounded by environmental heterogeneity. Spatio-Temporal Heterogeneity explores a range of available statistical methods to help ecologists in the attempt to unravel complexities, demonstrating how to place these changes into an understandable statistical framework. It addresses several key questions, including how to interpret the parameters of statistical mod', 12479, NULL, NULL, 1293944400, 2011170, 1);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(15935, NULL, 'Design and Analysis of Non-Inferiority Trials', 'Mark Rothmann, Ivan Chan, Brian Wiens', 2011, 'Taylor and Francis', 'The increased use of non-inferiority analysis has been accompanied by a proliferation of research on the design and analysis of non-inferiority studies. Design and Analysis of Non-Inferiority Trials brings together this body of research and confronts the issues involved in the design of a non-inferiority trial. Using examples from real clinical trials, the book discusses general and regulatory issues and illustrates how they affect analysis. Each chapter begins with a non-technical introduction,', 12482, NULL, NULL, 1293944400, 2011173, 2),
(15936, NULL, 'Methods for Estimation and Inference in Modern Econometrics', 'Stanislav Anatolyev, Nikolay Gospodinov', 2011, 'Taylor &amp; Francis', 'Methods for Estimation and Inference in Modern Econometrics provides a comprehensive introduction to a wide range of emerging topics, such as generalized empirical likelihood estimation and alternative asymptotics under drifting parameterizations, which have not been discussed in detail outside of highly technical research papers. The book also addresses several problems often arising in the analysis of economic data, including weak identification, model misspecification, and possible nonstation', 12483, NULL, NULL, 1293944400, 2011174, 2),
(15937, NULL, 'Smoothing Splines Methods and Applications', 'Yuedong Wang', 2011, 'Taylor and Francis', 'Driven by many sophisticated applications and fuelled by modern computing power, many powerful and flexible nonparametric and semiparametric modeling techniques have been developed to relax traditional parametric models and exploit possible hidden structure. As one of the most popular nonparametric techniques, the smoothing spline model has attracted a great deal of research attention in recent years. This book covers basic nonparametric spline models, such as polynomial spline, periodic spline,', 12484, NULL, NULL, 1293944400, 2011175, 2),
(15939, NULL, 'The Physics of Foraging: An Introduction to Random Searches and Biological ...', 'Gandhimohan. M. Viswanathan, Marcos G. E. da Luz, Ernesto P. Raposo, H. Eugene Stanley', 2011, 'Cambridge University Press', '"Do the movements of animals, including humans, follow patterns that can be described quantitatively by simple laws of motion? If so, then why? These questions have attracted the attention of scientists in many disciplines, and stimulated debates rangingfrom ecological matters to queries such as ''how can there be free will if one follows a law of motion?'' This is the first book on this rapidly evolving subject, introducing random searches and foraging in a way that can be understood by readers w', 12486, NULL, NULL, 1311624122, 2011177, 1),
(15940, NULL, 'Introduction to the Theory of Statistical Inference', 'Silvelyn Zwanzig, Hannelore Liero', 2012, 'Taylor and Francis', '', 12487, NULL, NULL, 1311875925, 2011178, 2),
(15957, NULL, 'Handbook of Statistical Bioinformatics', 'Henry Horng-Shing Lu', 2011, 'Springer', 'Numerous fascinating breakthroughs in biotechnology have generated large volumes and diverse types of high throughput data that demand the development of efficient and appropriate tools in computational statistics integrated with biological knowledge and computational algorithms. This volume collects contributed chapters from leading researchers to survey the many active research topics and promote the visibility of this research area. This volume is intended to provide an introductory and refer', 12502, NULL, NULL, 1314037651, 2011193, 1),
(15994, NULL, 'Applied Meta-Analysis for Social Science Research', 'Noel A. Card', 2012, 'Guilford Press', 'Offering pragmatic guidance for planning and conducting a meta-analytic review, this book is written in an engaging, nontechnical style that makes it ideal for graduate course use or self-study. The author shows how to identify questions that can be answered using meta-analysis, retrieve both published and unpublished studies, create a coding manual, use traditional and unique effect size indices, and write a meta-analytic review. An ongoing example illustrates meta-analytic techniques. In addit', 12539, NULL, 'Alyson has one copy and I have one copy. Denise', 1321483941, 2011231, 3),
(15943, NULL, 'Synthetic Datasets for Statistical Disclosure Control: Theory and Implementation', 'Jorg Drechsler', 2011, 'Springer', 'The aim of this book is to give the reader a detailed introduction to the different approaches to generating multiply imputed synthetic datasets. It describes all approaches that have been developed so far, provides a brief history of synthetic datasets, and gives useful hints on how to deal with real data problems like nonresponse, skip patterns, or logical constraints. Each chapter is dedicated to one approach, first describing the general concept followed by a detailed application to a real d', 12489, NULL, NULL, 1313087142, 2011180, 0),
(15944, NULL, 'Modern Statistics for the Social and Behavioral Sciences: A Practical Introduction', 'Rand Wilcox', 2012, 'CRC Press', 'Designed for a two-semester, introductory course for graduate students in the social sciences, this text introduces three major advances in the field: 1) sample size estimation needed to justify normality via the central limit theorem, 2) the impact of outliers and heavy-tailed distributions on power and our ability to obtain an accurate assessment of how groups differ and variables are related, and 3) the deleterious effects of heteroscedasticity on conventional ANOV A and regression methods. F', 12490, NULL, NULL, 1313173921, 2011181, 2),
(15945, NULL, 'Advanced Bayesian Methods for Medical Test Accuracy', 'Lyle D. Broemeling', 2012, 'Taylor &amp; Francis', 'This reference presents advanced techniques for assessing medical test accuracy. After a review of the usual measures, including specificity, sensitivity, positive predictive value, negative predictive value, and the area under the ROC curve, the book expands its scope to cover the more advanced topics of verification bias, diagnostic tests with imperfect gold standards, and medical tests where no gold standard is available. The author offers a practical treatment by including R and WinBugs code', 12491, NULL, NULL, 1313174087, 2011182, 2),
(15946, NULL, 'Statistical Thinking in Epidemiology', 'Yu-Kang Tu, Mark S. Gilthorpe', 2012, 'Taylor and Francis', 'Addressing issues that have plagued researchers throughout the last decade, this book provides new insights into the many existing problems in statistical modeling and offers several alternative strategies to approach these problems. Emphasizing the importance of statistical thinking behind all analyses, the authors use specific examples in epidemiology to illustrate different model specifications that can imply different sets of causal relationships between variables. Each model is interpreted ', 12492, NULL, NULL, 1313174186, 2011183, 2),
(15947, NULL, 'Statistical Evaluation of Diagnostic Performance Topics in ROC Analysis', 'Kelly H. Zou, Aiyi Liu, Andriy Bandos, Lucila Ohno-machado, Howard Rockette', 2012, 'CRC/Chapman & Hall', 'Statistical evaluation of diagnostic performance in general and Receiver Operating Characteristic (ROC) analysis in particular are important for assessing the performance of medical tests and statistical classifiers, as well as for evaluating predictive models or algorithms. This book presents innovative approaches in ROC analysis, which are relevant to a wide variety of applications, including medical imaging, cancer research, epidemiology, and bioinformatics. Statistical Evaluation of Diagnost', 12493, NULL, NULL, 1313174445, 2011184, 2),
(15948, NULL, 'A Career in Statistics: Beyond the Numbers', 'Gerald J. Hahn, Necip Doganaksoy', 2011, 'John Wiley and Sons', 'A valuable guide to a successful career as a statisticianA Career in Statistics: Beyond the Numbers prepares readers for careers in statistics by emphasizing essential concepts and practices beyond the technical tools provided in standard courses and texts. This insider''s guide from internationally recognized applied statisticians helps readers decide whether a career in statistics is right for them, provides hands-on guidance on how to prepare for such a career, and shows how to succeed on the ', 12494, NULL, NULL, 1313174709, 2011185, 1),
(15949, NULL, 'Data Analysis: What Can Be Learned From the Past 50 Years', 'Peter J. Huber', 2011, 'John Wiley &amp; Sons', '"This book explores the many provocative questions concerning the fundamentals of data analysis. It is based on the time-tested experience of one of the gurus of the subject matter. Why should one study data analysis? How should it be taught? What techniques work best, and for whom? How valid are the results? How much data should be tested? Which machine languages should be used, if used at all? Emphasis on apprenticeship (through hands-on case studies) and anecdotes (through real-life applicati', 12495, NULL, 'There are 9 more unnumbered pages at the end of this book which list other wiley books...these pages are not included in the above count. Denise', 1313174862, 2011186, 1),
(15950, NULL, 'Quantitative Data Analysis With IBM Spss 17, 18 & 19: A Guide for Social Scientists', 'Alan Bryman, Duncan Cramer', 2011, 'Taylor and Francis', 'This latest edition has been fully updated to accommodate the needs of users of SPSS Releases 17, 18 and 19 while still being applicable to users of SPSS Releases 15 and 16. As with previous editions, Alan Bryman and Duncan Cramer continue to offer a comprehensive and user-friendly introduction to the widely used IBM SPSS Statistics. The simple, non-technical approach to quantitative data analysis enables the reader to quickly become familiar with SPSS and with the tests available to them. No pr', 12496, NULL, NULL, 1313174989, 2011187, 2),
(15951, 5, 'Handbook of Parametric and Nonparametric Statistical Procedures, 5th edition', 'David J. Sheskin', 2011, 'Chapman & Hall', 'Following in the footsteps of its bestselling predecessors, the Handbook of Parametric and Nonparametric Statistical Procedures, Fifth Editionprovides researchers, teachers, and students with an all-inclusive reference on univariate, bivariate, and multivariate statistical procedures. New in the Fifth Edition: Substantial updates and new material throughout New chapters on path analysis, meta-analysis, and structural equation modeling Index numbers and time series analysis applications in busine', 12497, NULL, NULL, 1313176602, 2011188, 2),
(15952, 2, 'R Graphics, 2nd edition', 'Paul Murrell', 2011, 'CRC Press', 'Extensively updated to reflect the evolution of statistics and computing, the second edition of the bestselling R Graphics comes complete with new packages and new examples. Paul Murrell, widely known as the leading expert on R graphics, has developed an in-depth resource that helps both neophyte and seasoned users master the intricacies of R graphics. New in the Second Edition: Updated information on the core graphics engine, the traditional graphics system, the grid graphics system, and the la', 12498, NULL, NULL, 1313176712, 2011189, 2),
(15974, NULL, 'Cognitive Methods in Social Psychology', 'Karl Christoph Klauer, Andreas Voss, Christoph Stahl', 2011, 'Guilford Press', 'Researchers are increasingly applying cognitive methods to investigate social psychological phenomena. This book provides a comprehensive introduction to widely used social cognitive methods and offers practical, nuts-and-bolts guidance for implementing them. Leading authorities present attentional paradigms, priming paradigms, and response interference tasks; psychobiological approaches, such as neuroimaging; applications of mathematical models; and other methods. Detailed procedural informatio', 12522, NULL, NULL, 1317672251, 2011213, 1),
(15954, NULL, 'Phase Transitions in Machine Learning', 'Lorenza Saitta, Attilio Giordana, Antoine Cornuejols', 2011, 'Cambridge University Press', 'Phase transitions typically occur in combinatorial computational problems and have important consequences, especially with the current spread of statistical relational learning as well as sequence learning methodologies. In Phase Transitions in Machine Learning the authors begin by describing in detail this phenomenon, and the extensive experimental investigation that supports its presence. They then turn their attention to the possible implications and explore appropriate methods for tackling t', 12499, NULL, NULL, 1313424240, 2011190, 1),
(15955, NULL, 'Statistical Physics of Liquids at Freezing and Beyond', 'Shankar Prasad Das', 2011, 'Cambridge University Press', '"Exploring important theories for understanding freezing and the liquid-glass transition, this book is useful for graduate students and researchers in soft-condensed matter physics, chemical physics and materials science. It details recent ideas and key developments, providing an up-to-date view of current understanding. The standard tools of statistical physics for the dense liquid state are covered. The freezing transition is described from the classical density functional approach. Classical ', 12500, NULL, NULL, 1313606104, 2011191, 1),
(15956, NULL, 'Reversibility and Stochastic Networks', 'F. P. Kelly', 2011, 'Cambridge University Press', 'This classic in stochastic network modelling broke new ground when it was published in 1979, and it remains a superb introduction to reversibility and its applications. The book concerns behaviour in equilibrium of vector stochastic processes or stochastic networks. When a stochastic network is reversible its analysis is greatly simplified, and the first chapter is devoted to a discussion of the concept of reversibility. The rest of the book focuses on the various applications of reversibility a', 12501, NULL, NULL, 1313784313, 2011192, 1),
(15958, NULL, 'Cosmic Numbers: The Numbers That Define Our Universe', 'James D. Stein', 2011, 'Basic Books', '"Our fascination with numbers begins when we are children, and continues, for most of us, throughout our lives. We start counting our fingers and toes, and end up balancing check books and calculating risk. So powerful is the appeal of numbers that many people ascribe to them a mystical significance. And there are some numbers whose importance even transcends the supernatural--these numbers work to explain our universe and how it behaves. In Cosmic Numbers, mathematics professor James Stein trac', 12503, NULL, NULL, 1314720606, 2011194, 1),
(15959, 3, 'Applied Reliability, third edition', 'Paul A. Tobias, David C. Trindade', 2011, 'CHAPMAN &amp; HALL', '"It''s been over 15 years since the publication of the 2nd edition of Applied Reliability. We continue to receive positive feedback from old users, and each year hundreds of engineers, quality specialists, and statisticians discover the book for the first time and become new fans. So why a 3rd edition? There are always new methods and techniques that update and improve upon older methods, but that was not the primary reason we felt the need to write a new edition. In the last 15 years, the ready ', 12506, NULL, NULL, 1315432298, 2011197, 2),
(15960, NULL, 'Analysis of Questionnaire Data with R', 'Bruno Falissard', 2012, 'Taylor and Francis', 'Addressing the problem of inefficient collection and analysis of questionnaire data, this book proposes a methodology that uses R software. The author takes a practical approach to the subject, presenting principles first followed by detailed examples of their application to real data. He discusses principles of good questionnaire design, data management, capture, and manipulation and covers descriptive statistics, scoring, reliability, and missing data. The book focuses on R packages that are r', 12507, NULL, NULL, 1317157864, 2011198, 2),
(15961, NULL, 'Understanding the New Statistics: Effect Sizes, Confidence Intervals, and Meta-Analysis', 'Geoff Cumming', 2012, 'Taylor & Francis (Psychology Press)', 'This is the first book to provide readers with an introductory yet deep understanding of the new statistics in behavioral sciences-- effect sizes (ESs), confidence intervals (CIs), and meta-analysis (MA). Practical in nature, the book provides examples and tips on how to use the new statistics to analyse and report research results and/or to understand journal articles that reference the new statistics. The author employs statistical cognition techniques to help demonstrate how researchers think', 12508, NULL, NULL, 1317157972, 2011199, 2),
(15962, NULL, 'Applied Matrix Algebra', 'Lawrence Harvill', 2011, 'Xlibris Corporation', 'Applied Matrix Algebra&nbsp;(Google eBook)', 12509, NULL, 'goes from xi, blank page, then 13-567 pagewise. so more like xi+555?', 1317158176, 2011200, 1),
(15976, NULL, 'The Art of R Programming', 'Norman Matloff', 2011, 'No Starch Press', 'R is the world''s most popular programming language for statistical computing. Drug developers use it to evaluate clinical trials and determine which medications are safe and effective; archaeologists use it to sift through mounds of artifacts and track the spread of ancient civilizations; and actuaries use it to assess financial risks and keep economies running smoothly. In The Art of R Programming, veteran author Norman Matloff takes readers on a guided tour of this powerful language, from', 12524, NULL, NULL, 1318262368, 2011215, 2),
(15993, NULL, 'Informative Hypotheses: Theory and Practice for Behavioral and Social Scientists', 'Herbert Hoijtink', 2012, 'CRC Press', 'When scientists formulate their theories, expectations, and hypotheses, they often use statements like: &#39;&#39;I expect mean A to be bigger than means B and C&quot;; &#39;&#39;I expect that the relation between Y and both X1 and X2 is positive&quot;; and &#39;&#39;I expect the relation between Y and X1 to be stronger than the relation between Y and X2&quot;. Stated otherwise, they formulate their expectations in terms of inequality constraints among the parameters in which they are interested', 12538, NULL, NULL, 1321483787, 2011230, 2),
(15965, NULL, 'IBM SPSS Statistics 19 Made Simple', 'Colin Gray, Paul R. Kinnear', 2012, 'Taylor and Francis', 'This new edition of one of the most widely read textbooks in its field introduces the reader to data analysis with the most powerful and versatile statistical package on the market: IBM SPSS Statistics 19. Each new release of SPSS Statistics features new options and other improvements. There remains, nevertheless, a core of fundamental operating principles and techniques which have continued to apply to all releases issued in recent years and have been proved to be worth communicating in a small', 12510, NULL, NULL, 1317158836, 2011201, 1),
(15966, NULL, 'Principles of Applied Statistics', 'D. R. Cox, Christl A. Donnelly', 2011, 'Cambridge University Press', 'Applied statistics is more than data analysis, but it is easy to lose sight of the big picture. David Cox and Christl Donnelly distil decades of scientific experience into usable principles for the successful application of statistics, showing how good statistical strategy shapes every stage of an investigation. As you advance from research or policy question, to study design, through modelling and interpretation, and finally to meaningful conclusions, this book will be a valuable guide. Over a ', 12511, NULL, NULL, 1317158990, 2011202, 1),
(15967, NULL, 'Longitudinal Data Analysis - A Practical Guide for Researchers in Aging, Health, & Social Sciences', 'Jason Newsom, Richard N. Jones, Scott M. Hofer', 2012, 'Taylor &amp; Francis Group', 'This book provides accessible treatment to state-of-the-art approaches to analyzing longitudinal studies. Comprehensive coverage of the most popular analysis tools allows readers to pick and choose the techniques that best fit their research. The analyses are illustrated with examples from major longitudinal data sets including practical information about their content and design. Illustrations from popular software packages offer tips on how to interpret the results. Each chapter features sugge', 12512, NULL, '', 1317159091, 2011203, 1),
(16186, NULL, 'In All Likelihood: Statistical Modelling and Inference Using Likelihood', 'Yudi Pawitan', 2013, 'OUP Oxford', 'Based on a course in the theory of statistics this text concentrates on what can be achieved using the likelihood/Fisherian method of taking account of uncertainty when studying a statistical problem. It takes the concept ot the likelihood as providing the best methods for unifying the demands of statistical modelling and the theory of inference. Every likelihood concept is illustrated by realistic examples, which are not compromised by computational problems. Examples range from a simile compar', 12725, NULL, NULL, 1363292461, 2013018, 1),
(15969, NULL, 'The R Primer', 'Claus Thorn Ekstrom', 2012, 'Taylor &amp; Francis', 'An ideal introduction for readers from all disciplines, this book provides examples and solutions (including code) to technical problems that are commonly encountered by beginners and intermediate users of the R statistical programming package. Unlike most existing texts, this one is not meant to teach statistics; rather, it shows readers how they can perform various tasks using the R program. The author explores problems with importing data, transforming data, making statistical analyses, creat', 12517, NULL, 'CRC Press\nBoca Raton, FL', 1317412984, 2011208, 1),
(15970, NULL, 'Bayesian Analysis Made Simple: An Excel Gui for Winbugs', 'Phil Woodward', 2012, 'Taylor &amp; Francis', 'Although the popularity of the Bayesian approach to statistics has been growing for years, many still think of it as somewhat esoteric, not focused on practical issues, or generally too difficult to understand.\n\nBayesian Analysis Made Simple is aimed at those who wish to apply Bayesian methods but either are not experts or do not have the time to create WinBUGS code and ancillary files for every analysis they undertake. Accessible to even those who would not routinely use Excel, this book provid', 12518, NULL, 'CRC Press\nBoca Raton, FL \n', 1317413089, 2011209, 1),
(15971, NULL, 'A Practitioner''s Guide to Resampling for Data Analysis, Data Mining, and Modeling', 'Philip Good', 2012, 'CRC Press', 'Distribution-free resampling methodsâ€”permutation tests, decision trees, and the bootstrapâ€”are used today in virtually every research area. A Practitionerâ€™s Guide to Resampling for Data Analysis, Data Mining, and Modeling explains how to use the bootstrap to estimate the precision of sample-based estimates and to determine sample size, data permutations to test hypotheses, and the readily-interpreted decision tree to replace arcane regression methods.\n\nHighlights\n\nEach chapter contains doze', 12519, NULL, 'CRC Press\nBoca Raton, FL', 1317413206, 2011210, 1),
(15972, NULL, 'Practical Spreadsheet Risk Modeling for Management', 'Dale Lehman, Huybert Groenendaal, Greg Nolder', 2012, 'Taylor &amp; Francis', 'Risk analytics is developing rapidly, and analysts in the field need material that is theoretically sound as well as practical and straightforward. A one-stop resource for quantitative risk analysis, Practical Spreadsheet Risk Modeling for Management dispenses with the use of complex mathematics, concentrating on how powerful techniques and methods can be used correctly within a spreadsheet-based environment.\n\nHighlights\n\nCovers important topics for modern risk analysis, such as frequency-severi', 12520, NULL, 'Chapman & Hall/CRC\nBoca Raton, FL', 1317413311, 2011211, 1),
(15973, NULL, 'Adaptive and Flexible Clinical Trials', 'Richard Chin', 2012, 'Taylor and Francis', 'Adaptive clinical trial designs, unlike traditional fixed clinical trial designs, enable modification of studies in response to the data generated in the course of the trial. This often results in studies that are substantially faster, more efficient, and more powerful. Recent developments in web-based real-time data entry and advances in statistical methods have made adaptive clinical trials much more popular because they have become both more practical and attractive. However, there is paucity', 12521, NULL, 'CRC Press\nBoca Raton', 1317413417, 2011212, 1),
(15978, 4, 'IBM SPSS for Intermediate Statistics: Use and Interpretation', 'Nancy L. Leech, George A. Morgan, Karen C. Barrett', 2011, 'Taylor &amp; Francis Group', 'Designed to help readers analyze and interpret research data using IBM SPSS, this user-friendly book shows readers how to choose the appropriate statistic based on the design; perform intermediate statistics, including multivariate statistics; interpret output; and write about the results. The book reviews research designs and how to assess the accuracy and reliability of data: whether data meet the assumptions of statistical tests; how to calculate and interpret effect sizes for intermediate st', 12526, NULL, NULL, 1318365478, 2011217, 2),
(15979, NULL, 'Introduction to Statistical Field Theory', 'Edouard Brezin', 2010, 'Cambridge University Press', '"Knowledge of the renormalization group and field theory is a key part of physics, and is essential in condensed matter and particle physics. Written for advanced undergraduate and beginning graduate students, this textbook provides a concise introduction to this subject. The textbook deals directly with the loop-expansion of the free-energy, also known as the background field method. This is a powerful method, especially when dealing with symmetries, and statistical mechanics. In focussing on f', 12527, NULL, NULL, 1318365788, 2011218, 2),
(16188, NULL, 'Introduction to Statistical Methods for Biosurveillance', 'Ronald D. Fricker', 2013, 'Cambridge University Press', 'Bioterrorism is not a new threat, but in an increasingly interconnected world, the potential for catastrophic outcomes is greater today than ever. The medical and public health communities are establishing biosurveillance systems designed to proactively monitor populations for possible disease outbreaks as a first line of defense. The ideal biosurveillance system should identify trends not visible to individual physicians and clinicians in near-real time. Many of these systems use statistical al', 12727, NULL, NULL, 1364243953, 2013020, 1),
(15981, NULL, 'Bayesian Time Series Models', 'David Barber, A. Taylan Cemgil and Silvia Chiappa ', 2011, 'Cambridge University Press', '''What''s going to happen next?'' Time series data hold the answers, and Bayesian methods represent the cutting edge in learning what they have to say. This ambitious book is the first unified treatment of the emerging knowledge-base in Bayesian time series techniques. Exploiting the unifying framework of probabilistic graphical models, the book covers approximation schemes, both Monte Carlo and deterministic, and introduces switching, multi-object, non-parametric and agent-based models in a variet', 12529, NULL, NULL, 1318441170, 2011220, 1),
(16028, NULL, 'A Computational Approach to Statistical Arguments in Ecology and Evolution', 'George Estabrook', 2011, 'Cambridge University Press', 'Scientists need statistics. Increasingly this is accomplished using computational approaches. Freeing readers from the constraints, mysterious formulas and sophisticated mathematics of classical statistics, this book is ideal for researchers who want to take control of their own statistical arguments. It demonstrates how to use spreadsheet macros to calculate the probability distribution predicted for any statistic by any hypothesis. This enables readers to use anything that can be calculated (o', 12573, NULL, NULL, 1325876670, 2011261, 1),
(15983, NULL, 'SAS and R: Data Management, Statistical Analysis, and Graphics', 'Ken Kleinman, Nicholas J. Horton', 2010, 'CRC Press', 'An All-in-One Resource for Using SAS and R to Carry out Common Tasks Provides a path between languages that is easier than reading complete documentation SAS and R: Data Management, Statistical Analysis, and Graphicspresents an easy way to learn how to perform an analytical task in both SAS and R, without having to navigate through the extensive, idiosyncratic, and sometimes unwieldy software documentation. The book covers many common tasks, such as data management, descriptive summaries, infere', 12530, NULL, 'found on shelf where it has gone out to AE, but wasn''t in system. Hmmmm?', 1318532219, 2011221, NULL),
(15985, NULL, 'Structural Equation Modeling With Mplus: Basic Concepts, Applications, and Programming', 'Barbara Byrne', 2012, 'Taylor and Francis', 'Modeled after Barbara Byrne''s other best-selling structural equation modeling (SEM) books, this practical guide reviews the basic concepts and applications of SEM using MplusVersion 6. The author reviews SEM applications based on actual data taken from her own research. Using non-mathematical language, it is written for the novice SEM user. With each application chapter, the author "walks" the reader through all steps involved in testing the SEM model including: an explanation of the issues add', 12531, NULL, NULL, 1318883942, 2011225, 2),
(15986, NULL, 'Statistics for Spatio-Temporal Data', 'Noel A. C. Cressie, Christopher K. Wikle', 2011, 'John Wiley and Sons', 'A state-of-the-art presentation of spatio-temporal processes, bridging classic ideas with modern hierarchical statistical modeling concepts and the latest computational methodsFrom understanding environmental processes and climate trends to developing new technologies for mapping and public-health data and the spread of invasive-species, there is a high demand for statistical analyses of data that take spatial, temporal, and spatio-temporal information into account. "Statistics for Spatio-Tempor', 12532, NULL, 'PLUS 9 pages of Series authors after 588', 1319052996, 2011222, 1),
(15987, NULL, 'Inductive Logic', 'Dov M. Gabbay, John Woods, Stephan Hartmann', 2011, 'Elsevier', 'This volume is number ten in the 11-volume Handbook of the History of Logic. While there are many examples were a science split from philosophy and became autonomous (such as physics with Newton and biology with Darwin), and while there are, perhaps, topics that are of exclusively philosophical interest, inductive logic - as this handbook attests - is a research field where philosophers and scientists fruitfully and constructively interact. This handbook covers the rich history of scientific tur', 12533, NULL, NULL, 1319053171, 2011223, 1),
(15988, NULL, 'Measurement in Medicine: A Practical Guide', 'Henrica C. W. de Vet, Caroline B. Terwee, Lidwine B. Mokkink, Dirk L. Knol', 2011, 'Cambridge University Press', 'The success of the Apgar score demonstrates the astounding power of an appropriate clinical instrument. This down-to-earth book provides practical advice, underpinned by theoretical principles, on developing and evaluating measurement instruments in all fields of medicine. It equips you to choose the most appropriate instrument for specific purposes. The book covers measurement theories, methods and criteria for evaluating and selecting instruments. It provides methods to assess measurement prop', 12534, NULL, NULL, 1319053538, 2011224, 1),
(16025, NULL, 'Stochastic Processes', 'Richard F. Bass', 2011, 'Cambridge University Press', '"In a first course on probability one typically works with a sequence of random variables X1,X2,... For stochastic processes, instead of indexing the random variables by the non-negative integers, we index them by t G [0, oo) and we think of Xt as being the value at time t. The random variable could be the location of a particle on the real line, the strength of a signal, the price of a stock, and many other possibilities as well. We will also work with increasing families of s -fields {J-t}, kn', 12571, NULL, NULL, 1325876486, 2011258, 1),
(15996, NULL, 'Elements of Distribution Theory', 'Thomas A. Severini', 2005, 'Cambridge University Press', 'This detailed introduction to distribution theory is designed as a text for the probability portion of the first year statistical theory sequence for Master''s and PhD students in statistics, biostatistics, and econometrics. The text uses no measure theory, requiring only a background in calculus and linear algebra. Topics range from the basic distribution and density functions, expectation, conditioning, characteristic functions, cumulants, convergence in distribution and the central limit theor', 12541, NULL, 'This is the paperback version of the 2005 hardcover book.', 1321556161, 2011233, 1),
(15997, NULL, 'Data Driven Business Decisions', 'Chris J. Lloyd', 2011, 'John Wiley &amp; Sons', 'Grounded in a solid business context with an emphasis on data-driven decision making, &lt;i&gt;Data and Decisions for MBA&#39;s&lt;/i&gt; presents a down-to-earth treatment of the essentials of statistics. The book introduces chapters with a deeply contextual motivating example, followed by further details, raw data, and motivating insights. The author includes algebraic notation only when necessary and/or useful and presents both the pros and cons of statistical methods. Excel, StatPro, and Tre', 12542, NULL, NULL, 1321557019, 2011234, 1),
(15998, NULL, 'Dynamic Prediction in Clinical Survival Analysis', 'Hans Van Houwelingen, Hein Putter', 2012, 'CRC Press', 'There is a huge amount of literature on statistical models for the prediction of survival after diagnosis of a wide range of diseases like cancer, cardiovascular disease, and chronic kidney disease. Current practice is to use prediction models based on the Cox proportional hazards model and to present those as static models for remaining lifetime after diagnosis or treatment. In contrast, Dynamic Prediction in Clinical Survival Analysis focuses on dynamic models for the remaining lifetime at lat', 12543, NULL, NULL, 1321557184, 2011235, 2),
(15999, 2, 'Stochastic Modelling for Systems Biology, 2nd edition', 'Darren J. Wilkinson', 2012, 'Chapman & Hall/CRC Press', 'Since the first edition of Stochastic Modelling for Systems Biology, there have been many interesting developments in the use of "likelihood-free" methods of Bayesian inference for complex stochastic models. Re-written to reflect this modern perspective, this second edition covers everything necessary for a good appreciation of stochastic kinetic modelling of biological networks in the systems biology context. Keeping with the spirit of the first edition, all of the new theory is presented in a ', 12544, NULL, NULL, 1321557364, 2011236, 2),
(16000, NULL, 'Models of network reliability: analysis, combinatorics, and Monte Carlo', 'Ilya B. Gertzbakh, Yoseph Shpungin', 2010, 'CRC Press', 'Unique in its approach, Models of Network Reliability: Analysis, Combinatorics, and Monte Carlo provides a brief introduction to Monte Carlo methods along with a concise exposition of reliability theory ideas. From there, the text investigates a collection of principal network reliability models, such as terminal connectivity for networks with unreliable edges and/or nodes, network lifetime distribution in the process of its destruction, network stationary behavior for renewable components, impo', 12545, NULL, NULL, 1321980624, 2011237, 1),
(16035, 2, 'Statistics Explained: An Introductory Guide for Life Scientists', 'Steve McKillup', 2012, 'Cambridge University Press', 'An understanding of statistics and experimental design is essential for life science studies, but many students lack a mathematical background and some even dread taking an introductory statistics course. Using a refreshingly clear and encouraging reader-friendly approach, this book helps students understand how to choose, carry out, interpret and report the results of complex statistical analyses, critically evaluate the design of experiments and proceed to more advanced material. Taking a stra', 12580, NULL, NULL, 1327079121, 2011268, 1),
(16187, NULL, 'Bayesian Theory and Applications', 'Damien, Dellaportas, Polson & Stephens, eds.', 2013, 'Oxford University Press', 'The development of hierarchical models and Markov chain Monte Carlo (MCMC) techniques forms one of the most profound advances in Bayesian analysis since the 1970s and provides the basis for advances in virtually all areas of applied and theoretical Bayesian statistics.  This volume guides the reader along a statistical journey that begins with the basic structure of Bayesian theory, and then provides details on most of the past and present advances in this field. The book has a unique format. Th', 12726, NULL, NULL, 1364243162, 2013019, 1),
(16003, NULL, 'The Fundamentals of Modern Statistical Genetics', 'Nan M. Laird, Christoph Lange', 2011, 'Springer', 'This book covers the statistical models and methods that are used to understand human genetics, following the historical and recent developments of human genetics. Starting with Mendel ''s first experiments to genome-wide association studies, the book describes how genetic information can be incorporated into statistical models to discover disease genes. All commonly used approaches in statistical genetics (e.g. aggregation analysis, segregation, linkage analysis, etc), are used, but the focus of', 12548, NULL, NULL, 1322507352, 2011240, 2),
(16004, NULL, 'In Pursuit of the Unknown', 'Ian Stewart', 2012, 'Basic Books', 'not yet published', 12550, NULL, NULL, 1323379653, 2011241, 1),
(16005, NULL, '20% Chance of Rain: Exploring the Concept of Risk', 'Richard B. Jones', 2011, 'John Wiley &amp; Sons', 'Risk applications require a robust knowledge of many attributes of this seemingly simple subject. Using examples and case studies, this book teaches the reader the fundamental and subtle aspects of risk, regardless of the specific situation. The text allows the reader to understand risk analysis while not getting too involved in mathematics. The second edition includes new examples from NASA and several other industries as well as new case studies from legal databases. The many real-life discuss', 12551, NULL, NULL, 1323380079, 2011242, 1),
(16052, NULL, 'Statistical Graphics Procedures by Example: Effective Graphs Using SAS', 'Sanjay Matange and Dan Heath', 2011, 'SAS Publishing', 'Shows the innumerable capabilities of SAS Statistical Graphics (SG) procedures. It begins with a general discussion of the principles of effective graphics, ODS Graphics, and the SG procedures, then moves on to show examples of the procedures'' many features.', 12597, NULL, NULL, 1328904935, 2011285, 2),
(16007, NULL, 'Advances in Economic Forecasting', 'Higgins, Matthew L. (editor)', 2011, 'W E Upjohn Inst for Employment Research', 'Higgins presents six chapters that focus on how the reliability of economic forecasts can be improved. Three of the chapters focus on forecasting in real time while predicting turning points for macro aggregate measures such as GNP, inflation, growth, and unemployment. Authors of two chapters argue that data can be more efficiently exploited through model and forecast combination. they, along with authors of another chapter, also advocate for using models that are adaptive and perform well in th', 12553, NULL, 'Amazon Book Price', 1323380383, 2011244, 1),
(16008, 2, 'Adaptive Design Methods in Clinical Trials', 'Shein-Chung Chow, Mark Chang', 2012, 'CRC Press', 'This acclaimed book covers the principles and methodologies in adaptive design and analysis that pertain to adaptations made to trial or statistical procedures based on accrued data of ongoing clinical trials. It presents a well-balanced summary of current regulatory perspectives, recently developed statistical methods, and statistical tests for seamless phase II/III adaptive designs. This edition features two new chapters as well as a complete rewrite of the chapter on computer simulation. It a', 12554, NULL, NULL, 1323380563, 2011245, 1),
(16009, NULL, 'Statistical Computing in C++ and R', 'Randall L. Eubank, Ana Kupresanin', 2012, 'CRC Press', 'Parallel processing can be ideally suited for the solving of more complex problems in statistical computing. This book discusses code development in C++ and R, before going beyond to look at the valuable use of these two languages in unison. It covers linear equation solution with regression and linear models motivation, optimization with maximum likelihood and nonlinear least squares motivation, and random number generation. While the text does require a working knowledge of both the basic conc', 12555, NULL, NULL, 1323380655, 2011246, 1),
(16051, NULL, 'SAS Statistics by Example', 'Ron Cody', 2011, 'SAS Publishing', 'In SAS Statistics by Example, Ron Cody offers up a cookbook approach for doing statistics with SAS. Structured specifically around the most commonly used statistical tasks or techniques--for example, comparing two means, ANOVA, and regression--this book provides an easy-to-follow, how-to approach to statistical analysis not found in other books. For each statistical task, Cody includes heavily annotated examples using ODS Statistical Graphics procedures such as SGPLOT, SGSCATTER, and SGPANEL tha', 12596, NULL, NULL, 1328904842, 2011284, 2),
(16024, NULL, 'Extreme Value Methods with Applications to Finance', 'Serguei Y. Novak', 2012, 'Taylor &amp; Francis', 'Extreme value theory is a branch of statistics dealing with extreme deviations from the median of probability distributions, and it is important for assessing the risk of highly unusual events, such as financial market crashes. There has been a huge amount of research in this area during the last 20 years, and this book presents a synthesis of that research, with emphasis on dependent observations. It covers several modern topics, such as compound Poisson approxomation, that have not been focuse', 12570, NULL, NULL, 1325876401, 2011257, 2),
(16012, 2, 'Effect Sizes for Research: Univariate and Multivariate Applications', 'Robert J. Grissom, John J. Kim', 2012, 'Taylor and Francis', 'Noted for its comprehensive coverage, this greatly expanded new edition now covers the use of univariate and multivariate effect sizes. A variety of measures and estimators are reviewed along with their application, interpretation, and limitations. Noted for its practical approach, the book features numerous examples using real data for a variety of variables and designs, to help readers apply the material to their own data. Tips on the use of SPSS, SAS, R, And S-Plus are provided for the more t', 12558, NULL, 'This is correct', 1323957430, 2011249, 2),
(16013, 2, 'Single-case and Small-n Experimental Designs: A Practical Guide to Randomization Tests', 'Pat Dugard, Jonathan Todman, Portia File', 2012, 'Routledge/Taylor & Francis Group', 'This book is a practical guide to help researchers draw valid causal inferences from small-scale clinical intervention studies. It should be of interest to teachers of, and students in, courses with an experimental clinical component, as well as clinical researchers. Inferential statistics used in the analysis of group data are frequently invalid for use with data from single-case experimental designs. Even non-parametric rank tests provide, at best, approximate solutions for only some single-ca', 12559, NULL, NULL, 1323968276, 2011250, 2),
(16014, NULL, 'Introduction to Probability with Texas Hold Em Examples', 'Frederic Paik Schoenberg', 2012, 'CRC Press', 'Introduction to Probability with Texas Hold''em Examples illustrates both standard and advanced probability topics using the popular poker game of Texas Hold''em, rather than the typical balls in urns. The author uses students'' natural interest in poker to teach important concepts in probability. This classroom-tested book covers the main subjects of a standard undergraduate probability course, including basic probability rules, standard models for describing collections of data, and the laws of l', 12560, NULL, 'sent book to:\n\nBruce McCullough\n128 Cedar St\nJenkintown, PA  19046\n', 1323968504, 2011251, 1),
(16015, NULL, 'Undocumented Secrets of Matlab-JAVA Programming', 'Yair M. Altman', 2012, 'Taylor &amp; Francis Group', 'Many people know that Java forms the background and functionality of the MatLab software package, but fewer people know how to manipulate Java to achieve improved appearance and performance and thus heighten MatLab software "s applicability to real world, modern situations. Organized by related functionality/usage and ordered from facile to complex, this book presents examples, instruction, and code snippets in stand-alone, self-contained chapters. Requiring no prior Java knowledge, this book pr', 12561, NULL, NULL, 1323969389, 2011252, 1),
(16016, NULL, 'A Whistle-Stop Tour of Statistics', 'Brian Everitt', 2012, 'CRC Press/Taylor & Francis', '', 12562, NULL, NULL, 1323969824, 2011253, 2),
(16023, NULL, 'Applied Operational Research with SAS', 'Ali Emrouznejad, William Ho', 2012, 'Chapman & Hall/CRC', 'Designed specifically for SAS users in operational research, this book focuses on the most recent development in SAS/OR optimization, PROC OPTMODEL. It contains a wide range of OR optimization problems that demonstrate how the SAS/OR procedures work. It includes single criterion, project management decision, printed circuit board assembly, and multiple criteria decision making problems. Quite possibly the first book to cover the application of SAS/OR procedures to OR problems, it formulates OR p', 12569, NULL, NULL, 1324501652, 2011256, 1),
(16029, NULL, 'Regression for Categorical Data', 'Gerhard Tutz', 2012, 'Cambridge University Press', 'This book introduces basic and advanced concepts of categorical regression with a focus on the structuring constituents of regression, including regularization techniques to structure predictors. In addition to standard methods such as the logit and probit model and extensions to multivariate settings, the author presents more recent developments in flexible and high-dimensional regression, which allow weakening of assumptions on the structuring of the predictor and yield fits that are closer to', 12574, NULL, NULL, 1325876774, 2011262, 1),
(16027, NULL, 'Randomized Clinical Trials of Nonpharmacologic Treatments', 'Isabelle Boutron, Philippe Ravaud, David Moher', 2012, 'CRC/Chapman & Hall', 'Nonpharmacological Treatments include a wide variety of treatments such as surgery, technical procedures, implantable devices, nonimplantable devices, rehabilitation, psychoteherapy, and behavioral interventions. This book focuses on the methods of assessing nonpharmacological treatments, highlighting specific issues and discussing all possible design of trials. It provides practical examples to underline the issues and solutions in assessing nonpharmacological treatment in trials. Arguably the ', 12572, NULL, NULL, 1325876576, 2011260, 1),
(16030, NULL, 'Who''s #1?: The Science of Rating and Ranking', 'Amy N Langville, C. D. Meyer', 2012, 'Princeton University Press', 'A website''s ranking on Google can spell the difference between success and failure for a new business. NCAA football ratings determine which schools get to play for the big money in postseason bowl games. Product ratings influence everything from the clothes we wear to the movies we select on Netflix. Ratings and rankings are everywhere, but how exactly do they work? Who''s #1? offers an engaging and accessible account of how scientific rating and ranking methods are created and applied to a vari', 12575, NULL, 'Have hardback and paperback....will send hardback to referee and paperback to AE...Paperback is "uncorrected not for resale" and only has xv pages!', 1325876873, 2011263, 2),
(16031, NULL, 'Taking Sudoku Seriously: The Math Behind the World''s Most Popular Pencil Puzzle', 'Jason Rosenhouse, Laura Taalman', 2011, 'Oxford University Press', 'Packed with more than a hundred color illustrations and a wide variety of puzzles and brainteasers, Taking Sudoku Seriously uses this popular craze as the starting point for a fun-filled introduction to higher mathematics.   How many Sudoku solution squares are there? What shapes other than three-by-three blocks can serve as acceptable Sudoku regions? What is the fewest number of starting clues a sound Sudoku puzzle can have? Does solving Sudoku require mathematics? Jason Rosenhouse and Laura Ta', 12576, NULL, NULL, 1325877092, 2011264, 1),
(16032, NULL, 'Statistics of Medical Imaging', 'Tianhu Lei', 2012, 'Taylor and Francis', 'Extensive work is being done in the statistical aspects of medical imaging, and this book fills the gap in the literature to provide a unified framework of study. It presents a complete look at medical imaging and statistics, from the statistical aspects of imaging technology to the statistical analysis of images. It provides technicians and students with the statistical principles that underlay medical imaging and offers reference material for researchers involved in the design of new technolog', 12577, NULL, NULL, 1325878991, 2011265, 4),
(16033, NULL, 'Nonparametric Statistical Tests: A Computational Approach', 'Markus Neuhauser', 2012, 'CRC Press/Taylor & Francis', 'The book describes classical nonparametric tests, as well as novel and little-known methods such as the Baumgartner-Weiss-Schindler and the Cucconi tests. The book presents SAS and R programs, allowing readers to carry out the different statistical methods, such as permutation and bootstrap tests. The author considers example data sets in each chapter to illustrate methods. Numerous real-life data from various areas, including the bible, and their analyses provide for greatly diversified reading', 12578, NULL, NULL, 1325879091, 2011266, 2);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(16034, NULL, 'Statistical Learning and Data Science', 'Mireille Gettler Summa (Editor), Leon Bottou (Editor), Bernard Goldfarb (Editor), Fionn Murtagh (Editor), Catherine Pardoux (Editor), Myriam Touati (Editor) ', 2012, 'Taylor and Francis', 'Driven by a vast range of applications, data analysis and learning from data are vibrant areas of research. Various methodologies, including unsupervised data analysis, supervised machine learning, and semisupervised techniques, have continued to develop to cope with the increasing amount of data collected through modern technology. With a focus on applications, this volume presents contributions from some of the leading researchers in the different fields of data analysis. Synthesizing the meth', 12579, NULL, NULL, 1325879262, 2011267, 2),
(16036, NULL, 'Order Statistics in Wireless Communications: Diversity, Adaptation, and Scheduling in MIMO and OFDM Systems', 'Hong-Chuan Yang, Mohamed-Slim Alouini', 2011, 'Cambridge University Press', '"Covering fundamental principles through to practical applications, this self-contained guide describes indispensable mathematical tools for the analysis and design of advanced wireless transmission and reception techniques in MIMO and OFDM systems. The analysis-oriented approach develops a thorough understanding of core concepts and discussion of various example schemes shows how to apply these concepts in practice. The book focuses on techniques for advanced diversity combining, channel adapti', 12581, NULL, NULL, 1327079458, 2011269, 1),
(16053, NULL, 'Teaching Elementary Statistics with JMP', 'Chris Olsen', 2011, 'SAS Publishing', 'Teaching Elementary Statistics with JMP, by Chris Olsen, demonstrates this powerful software, offering the latest research on "best practice" in teaching statistics and how JMP can facilitate it. Intended for high school- and college-level instructors who use JMP in teaching elementary statistics, the book uniquely provides a wide variety of data sets that are of interest to a broad range of teachers and students.', 12598, NULL, NULL, 1328905023, 2011286, 2),
(16038, 12, 'Statistics, 12th edition', 'McClave and Sincich', 2012, 'Pearson', NULL, 12583, NULL, 'This is the Instructor''s Review Copy ISBN and information.', 1327079752, 2011271, 2),
(16039, 11, 'A First Course in Statistics, 11th Edition', 'James McClave and Terry Sincich', 2012, 'Pearson', NULL, 12584, NULL, 'This is the Instructor''s Review Copy ISBN & info.', 1327080261, 2011272, 2),
(16040, 3, 'Statistics The Art and Science of Learning from Data, 3rd edition', 'Alan Agresti and Christine Franklin', 2012, 'Pearson', 'KEY MESSAGE: Alan Agresti and Chris Franklin have merged their research and classroom experience to develop this successful introductory statistics text. Statistics: The Art and Science of Learning from Data helps readers become statistically literate by encouraging them to ask and answer interesting statistical questions. It takes the ideas that have turned statistics into a central science in modern life and makes them accessible and engaging to readers without compromising necessary rigor.', 12585, NULL, 'This is the Instructor''s Review Copy ISBN & info...Note extra page numbering on left Notes.', 1327080496, 2011273, 2),
(16041, 4, 'Statistics Informed Decisions Using Data, 4th edition', 'Michael Sullivan III', 2012, 'Pearson', NULL, 12586, NULL, 'This is Instructor''s Edition ISBN & info. Note extra page numbering on Left Notes', 1327080806, 2011274, 2),
(16042, NULL, 'Introductory Statistics exploring the world through data', 'Robert Gould and Colleen Ryan', 2012, 'Pearson', 'We live in a data-driven world, and this is a book about understanding and working with that data. In order to be informed citizens, authors Rob Gould and Colleen Ryan believe that learning statistics extends beyond the classroom to an essential life skill.  They teach students of all math backgrounds how to think about data, how to reason using data, and how to make decisions based on data.\n\n \nWith a clear, unintimidating writing style and carefully chosen pedagogy, Introductory Statistics: Exp', 12587, NULL, 'This is the Instructor''s Edition ISBN & info.', 1327081481, 2011275, 2),
(16043, NULL, 'Essentials of Probability and Statistics for Engineers and Scientists', 'Ronald E. Walpole, Raymond Meyers, Sharon L. Myers and Keying Ye', 2013, 'Prentice Hall PTR', 'For junior/senior undergraduates taking a one-semester probability and statistics course as applied to engineering, science, or computer science.\n \nThis text covers the essential topics needed for a fundamental understanding of basic statistics and its applications in the fields of engineering and the sciences. Interesting, relevant applications use real data from actual studies, showing how the concepts and methods can be used to solve problems in the field. Students using this text should have', 12588, NULL, NULL, 1327081858, 2011276, 2),
(16044, NULL, 'Practicing Statistics Guided Investigations for the Second Course', 'Shonda Kuiper and Jeff Sklar', 2013, 'Pearson', 'Building on the introductory course, Practicing Statistics: Guided Investigations for the Second Course presents a variety of compelling topics for a second course in statistics, such as multiple regression, nonparametric methods, and survival analysis. Every topic is introduced in the context of a real-world research question, asking students to explore the concepts firsthand with guided activities and research projects.\n \nThe number of students taking AP Statistics continues to rise, and the n', 12589, NULL, NULL, 1327082289, 2011277, 2),
(16054, 3, 'Web Development With Sas by Example, 3rd edition', 'Frederick E. Pratter', 2011, 'SAS Publishing', 'null', 12599, NULL, NULL, 1328905111, 2011287, 2),
(16046, 7, 'Introduction to Mathematical Statistics, 7th edition', 'Robert V. Hogg,  Joseph W. McKean and Allen T. Craig', 2013, 'Pearson', 'Introduction to Mathematical Statistics, Seventh Edition, provides students with a comprehensive introduction to mathematical statistics. Continuing its proven approach, the Seventh Edition has been updated with new examples, exercises, and content for an even stronger presentation of the material.\n New To This Edition\n\nNew examples and exercises added throughout the Seventh Edition help clarify the exposition and promote studentsâ€™ understanding of the concepts.\nThe discussion on some properti', 12591, NULL, NULL, 1327435182, 2011279, 2),
(16047, NULL, 'Biostatistics: A Computing Approach', 'Stewart Anderson', 2012, 'CRC Press - Taylor and Francis', 'The emergence of high-speed computing has facilitated the development of many exciting statistical and mathematical methods in the last 25 years, broadening the landscape of available tools in statistical investigations of complex data. Biostatistics: A Computing Approachfocuses on visualization and computational approaches associated with both modern and classical techniques. Furthermore, it promotes computing as a tool for performing both analyses and simulations that can facilitate such under', 12592, NULL, NULL, 1328041433, 2011280, 2),
(16048, NULL, 'Time Series Modeling of Neuroscience Data', 'Tohru Ozaki', 2012, 'Chapman & Hall/CRC', '"Recent advances in brain science measurement technology have given researchers access to very large-scale time series data such as EEG/MEG data (20 to 100 dimensional) and fMRI (140,000 dimensional) data. To analyze such massive data, efficient computational and statistical methods are required. Time Series Modeling of Neuroscience Data shows how to efficiently analyze neuroscience data by the Wiener-Kalman-Akaike approach, in which dynamic models of all kinds, such as linear/nonlinear differen', 12593, NULL, NULL, 1328124931, 2011281, 2),
(16049, NULL, 'Handbook of Statistical Systems Biology', 'Michael Stumpf, David J. Balding, Mark Girolami', 2011, 'John Wiley &amp; Sons', 'Systems Biology is moving away from the mathematical modeling and subsequent analysis of systems to a full statistical analysis and probabilistic reasoning over the inferences that can be made from these modeling exercises. There is a need for a comprehensive handbook covering the major themes in the area. This book provides a full and detailed treatment of important and emerging fields of statistical systems biology, with focus on characterising uncertainty and stochastic effects in mathematica', 12594, NULL, NULL, 1328210687, 2011282, 1),
(16055, 2, 'Multiple Comparisons and Multiple Tests Using SAS, 2nd ed.', 'Peter H. Westfall, Randall D. Tobias and Russell D. Wolfinger', 2011, 'SAS Publishing', 'New and extensively updated for SAS 9 and later! Have you ever felt that there was no multiple inference method that fit the particular constraints of your data? Or been overwhelmed by the many choices of procedures? Multiple Comparisons and Multiple Tests Using SAS, Second Edition, written by Peter Westfall, Randall Tobias, and Russell Wolfinger, solves both problems for you by providing cutting-edge methods, specialized macros, and proven "best bet" procedures. The specialized macros and dozen', 12600, NULL, NULL, 1328905339, 2011288, 2),
(16056, 2, 'Customer Segmentation and Clustering Using SAS Enterprise Miner, Second Edition', 'Randall S. Collica', 2011, 'SAS Publishing', 'Understanding the customer is critical to your company''s success. In this book, Randy Collica employs SAS Enterprise Miner and the most commonly available techniques for customer relationship management (CRM). You will learn how to segment customers more intelligently and to achieve, or at least get closer to, the one-to-one customer relationship that today''s businesses want.', 12601, NULL, NULL, 1328905628, 2011289, 2),
(16057, NULL, 'Quantitative Operational Risk Models', 'Catalina Bolance, Montserrat Guillen, Jim Gustafsson, Jens Perch Nielsen', 2012, 'crc/chapman & hall (boca raton)', 'Measuring operational risk requires both knowledge of quantitative tools and comprehension of financial activities in a very broad sense. Presenting a nonparametric approach to modeling operational risk data, this book offers a practical perspective that combines statistical analysis and management orientations. It covers the statistical theory prerequisites and summarizes important contributions made in the past decade. The authors explain how to implement the new density estimation methods for', 12602, NULL, NULL, 1329841595, 2011290, 2),
(16058, 3, 'Design and Analysis of Experiments, Special Designs and Applications, Volume 3', 'Klaus Hinkelmann, ed.', 2012, 'John Wiley &amp; Sons', 'This book discusses special modifications and extensions of designs that arise in certain fields of application such as genetics, bioinformatics, agriculture, medicine, manufacturing, marketing, etc.& & Well-known and highly-regarded contributors have written& individual chapters that have been extensively reviewed by the Editor to ensure& that each& individual contribution relates to material found in& Volumes 1 and 2 of this book series.& & The& chapters in Volume 3& have an introductory/histo', 12603, NULL, 'There are more un-numbered pages at the end but they are just listing other books, so not counting them.', 1329938471, 2011291, 1),
(16110, 3, 'Statistics in Medicine, 3rd ed.', 'Robert H. Riffenburgh', 2012, 'Academic Press', 'Key Features\n\n*User-friendly format includes medical examples, step-by-step methods, and check-yourself exercises.\n*Facilitates stand-alone methods rather than a required sequence of reading and references to prior text.\n* Covers trial randomization, treatment ethics in medical research, imputation of missing data, evidence-based medical decisions, how to interpret medical articles, noninferiority testing, meta-analysis, screening number needed to treat, and epidemiology.\nNew in this Edition:\n* ', 12652, NULL, NULL, 1346097707, 2011342, 2),
(16060, NULL, 'Handbook of Research Methods for Studying Daily Life', 'Matthias R. Mehl, Tamlin S. Conner eds.', 2012, 'New York, NY: Guilford Press', 'Bringing together leading authorities, this unique handbook reviews the breadth of current approaches for studying how people think, feel, and behave in everyday environments, rather than in the laboratory. The volume thoroughly describes experience sampling methods, diary methods, physiological measures, and other self-report and non-self-report tools that allow for repeated, real-time measurement in natural settings. Practical guidance is provided to help the reader design a high-quality study', 12604, NULL, 'Alyson has one copy and Denise has one copy.', 1330460990, 2011293, 3),
(16061, NULL, 'The Shape of Inner Space: String Theory and the Geometry of the Universe''s ...', 'Shing-Tung Yau, Steve Nadis', 2012, 'Basic Books', 'String theory says we live in a ten-dimensional universe, but that only four are accessible to our everyday senses. According to theorists, the missing six are curled up in bizarre structures known as Calabi-Yau manifolds. In The Shape of Inner Space, Shing-Tung Yau, the man who mathematically proved that these manifolds exist, argues that not only is geometry fundamental to string theory, it is also fundamental to the very nature of our universe.\nTime and again, where Yau has gone, physics has ', 12605, NULL, 'Hardback edition came out in 2010 and this is just the paperback edition coming out 2012.', 1330706801, 2011294, 2),
(16062, NULL, 'Density Ratio Estimation in Machine Learning', 'Masashi Sugiyama, Taiji Suzuki, Takafumi Kanamori', 2012, 'New York, NY: Cambridge University Press', 'Machine learning is an interdisciplinary field of science and engineering that studies mathematical theories and practical applications of systems that learn. This book introduces theories, methods and applications of density ratio estimation, which is a newly emerging paradigm in the machine learning community. Various machine learning problems such as non-stationarity adaptation, outlier detection, dimensionality reduction, independent component analysis, clustering, classification and conditi', 12606, NULL, NULL, 1331140797, 2011295, 1),
(16063, NULL, 'Handbook of Developmental Research Methods', 'Brett Laursen, Todd D. Little, Noel A. Card editors', 2012, 'New York, NY: Guilford Press', 'This is the first methods handbook specifically designed to meet the needs of those studying development. Leading developmental methodologists present cutting-edge analytic tools and describe how and when to use them in accessible, nontechnical language. They also provide valuable guidance for strengthening developmental research with designs that anticipate potential sources of bias. Sections typically begin with an overview chapter on foundational issues. Subsequent chapters delve into specifi', 12607, NULL, 'One copy with Denise, one copy with Alyson', 1332275891, 2011296, 3),
(16064, NULL, 'Probability, Random Processes, and Statistical Analysis: Applications to Communications, Signal Processing, Queueing Theory and Mathematical Finance', 'Hisashi Kobayashi, Brian L. Mark, William Turin', 2011, 'Cambridge University Press', '"Together with the fundamentals of probability, random processes and statistical analysis, this insightful book also presents a broad range of advanced topics and applications. There is extensive coverage of Bayesian vs. frequentist statistics, time series and spectral representation, inequalities, bound and approximation, maximum-likelihood estimation and the expectation-maximization (EM) algorithm, geometric Brownian motion and It''s process. Applications such as hidden Markov models (HMM), the', 12608, NULL, NULL, 1332276032, 2011297, 0),
(16065, NULL, 'Economic Time Series: Modeling and Seasonality', 'William R. Bell, Scott H. Holan, Tucker S. McElroy eds.', 2012, 'Boca Raton, FL: CRC Press', 'Economic Time Series: Modeling and Seasonalityis a focused resource on analysis of economic time series as pertains to modeling and seasonality, presenting cutting-edge research that would otherwise be scattered throughout diverse peer-reviewed journals. This compilation of 21 chapters showcases the cross-fertilization between the fields of time series modeling and seasonal adjustment, as is reflected both in the contents of the chapters and in their authorship, with contributors coming from aca', 12609, NULL, NULL, 1332790751, 2011298, 2),
(16066, 2, 'A Course in Real Analysis, 2nd edition', 'John McDonald and Neil A. Weiss,', 2013, 'Academic Press', 'Description\n\nThe second edition of A Course in Real Analysis provides a solid foundation of real analysis concepts and principles, presenting a broad range of topics in a clear and concise manner. The book is excellent at balancing theory and applications with a wealth of examples and exercises. The authors take a progressive approach of skill building to help students learn to absorb the abstract. Real world applications, probability theory, harmonic analysis, and dynamical systems theory are i', 12610, NULL, NULL, 1332790927, 2011299, 1),
(16067, NULL, 'Practical Text Mining and Statistical Analysis for Non-structured Text Data Applications', 'Gary Miner, Dursun Delen, John Elder, Andrew Fast, Thomas Hill, Robert Nisbet', 2012, 'Academic Press', 'The world contains an unimaginably vast amount of digital information which is getting ever vaster ever more rapidly. This makes it possible to do many things that previously could not be done: spot business trends, prevent diseases, combat crime and so on. Managed well, the textual data can be used to unlock new sources of economic value, provide fresh insights into science and hold governments to account. As the Internet expands and our natural capacity to process the unstructured text that it', 12611, NULL, 'that is x ell (40)', 1332961322, 2011300, 1),
(16068, NULL, 'Statistics for Physical Sciences: An Introduction', 'B.R. Martin', 2012, 'Academic Press', 'Statistical Methods for the Physical Sciences is an informal, relatively short, but systematic, guide to the more commonly used ideas and techniques in statistical analysis, as used in physical sciences, together with explanations of their origins. It steers a path between the extremes of a recipe of methods with a collection of useful formulas, and a full mathematical account of statistics, while at the same time developing the subject in a logical way. The book can be read in its entirety by a', 12612, NULL, NULL, 1333043807, 2011301, 1),
(16069, 2, 'Probability and Random Processes: With Applications to Signal Processing and Communications', 'Scott Miller and Donald Childers', 2012, 'Academic Press', 'Miller and Childers have focused on creating a clear presentation of foundational concepts with specific applications to signal processing and communications, clearly the two areas of most interest to students and instructors in this course. It is aimed at graduate students as well as practicing engineers, and includes unique chapters on narrowband random processes and simulation techniques. The appendices provide a refresher in such areas as linear algebra, set theory, random variables, and mor', 12613, NULL, NULL, 1333044174, 2011302, 1),
(16070, NULL, 'Introduction to Robust Estimation and Hypothesis Testing, 3rd edition', 'Rand R. Wilcox', 2012, 'Academic Press', 'This revised book provides a thorough explanation of the foundation of robust methods, incorporating the latest updates on R and S-Plus, robust ANOVA (Analysis of Variance) and regression. It guides advanced students and other professionals through the basic strategies used for developing practical solutions to problems, and provides a brief background on the foundations of modern methods, placing the new methods in historical context. Author Rand Wilcox includes chapter exercises and many real-', 12614, NULL, NULL, 1333728929, 2011303, 1),
(16071, NULL, 'Quantitative data analysis: doing social research to test ideas', 'Donald J. Treiman', 2009, 'Jossey-Bass - San Francisco - Wiley Imprint', 'This book is an accessible introduction to quantitative data analysis, concentrating on the key issues facing those new to research, such as how to decide which statistical procedure is suitable, and how to interpret the subsequent results. Each chapter includes illustrative examples and a set of exercises that allows readers to test their understanding of the topic. The book, written for graduate students in the social sciences, public health, and education, offers a practical approach to makin', 12615, NULL, 'Rec''d 4/6/12 but is a 2009 book!', 1333729073, 2011304, 1),
(16072, NULL, 'Flexible Imputation of Missing Data', 'Stef Van Buuren', 2012, 'Boca Raton; Chapman & Hall/CRC Press', 'A practical guide for handling missing data, this book provides a flexible and accessible framework for multiple imputation along with strategies for obtaining effective solutions to these problems. The text is supported by many examples using real data taken from the author s vast research involving missing data. All of the analyses can be replicated in R using the dedicated package MICE, which was developed by the author. Topics covered include multiple imputation, multivariate and univariate ', 12616, NULL, NULL, 1333729306, 2011305, 2),
(16073, NULL, 'An Information Theoretic Approach to Econometrics', 'George G. Judge, Ron C. Mittelhammer', 2012, 'Cambridge University Press', '"This book is intended to provide the reader with a firm conceptual and empirical understanding of basic information-theoretic models and methods. Because most data are observational, practitioners work with indirect noisy observation and ill-posed econometric in the form of stochastic inverse problems. Consequently, traditional econometric methods in many cases are not applicable for answering many of the quantitative questions that analysts wish to ask. After initial chapters deal with paramet', 12617, NULL, NULL, 1333735257, 2011306, 1),
(16074, NULL, 'Event History Analysis With R', 'Goran Brostrom', 2012, 'CRC Press', 'With an emphasis on social science applications, this book presents an introduction to survival and event history analysis. It focuses on practical applications in the fields of demography, epidemiology, and econometrics. The text includes a wide range of real examples, with data available online and supported by a dedicated R package for performing all of the analyses. Keeping mathematical details to a minimum, the author covers key topics, including both discrete and continuous time data, para', 12618, NULL, NULL, 1333741774, 2011307, 2),
(16075, 4, 'Statistical Concepts: A Second Course, 4th edition', 'Richard G. Lomax, Debbie L. Hahs-Vaughn', 2012, 'Routledge/Taylor & Francis', '"Statistical Concepts consists of the last 9 chapters of An Introduction to Statistical Concepts, 3rd ed. Designed for the second course in statistics it is one of the few texts that focuses just on intermediate statistics. The flexible coverage allows instructors to select the topics that are most appropriate for their course. Its conceptual approach helps students more easily understand the concepts and interpret SPSS and research results. Key concepts are simply stated and reintroduced and re', 12619, NULL, NULL, 1333741949, 2011308, 2),
(16076, 3, 'An Introduction to Statistical Concepts: Third Edition', 'Richard G. Lomax, Debbie L. Hahs-Vaughn', 2012, 'Routledge/Taylor and Francis', 'This comprehensive, flexible text is used in both one- and two-semester courses to review introductory through intermediate statistics. Instructors select the topics that are most appropriate for their course. Its conceptual approach helps students more easily understand the concepts and interpret SPSS and research results. Key concepts are simply stated and occasionally reintroduced and related to one another for reinforcement. Numerous examples demonstrate their relevance. This edition feature', 12620, NULL, NULL, 1333742225, 2011309, 2),
(16077, NULL, 'Bayesian Reasoning and Machine Learning', 'David Barber', 2012, 'New York, NY: Cambridge University Press', '"Machine learning methods extract value from vast data sets quickly and with modest resources. They are established tools in a wide range of industrial applications, including search engines, DNA sequencing, stock market analysis, and robot locomotion, and their use is spreading rapidly. People who know the methods have their choice of rewarding jobs. This hands-on text opens these opportunities to computer science students with modest mathematical backgrounds. It is designed for final-year unde', 12621, NULL, NULL, 1334085285, 2011310, 1),
(16078, NULL, 'Machine Learning in Non-Stationary Environments: Introduction to Covariate Shift Adaptation', 'Masashi Sugiyama, Motoaki Kawanabe', 2012, 'Cambridge, MA: MIT Press', 'As the power of computing has grown over the past few decades, the field of machine learning has advanced rapidly in both theory and practice. Machine learning methods are usually based on the assumption that the data generation mechanism does not change over time. Yet real-world applications of machine learning, including image recognition, natural language processing, speech recognition, robot control, and bioinformatics, often violate this common assumption. Dealing with non-stationarity is o', 12622, NULL, NULL, 1335206248, 2011311, 2),
(16079, NULL, 'A Wealth of Numbers: An Anthology of 500 Years of Popular Mathematics Writing', 'Benjamin Wardhaugh', 2012, 'Princeton University Press', 'Despite what we may sometimes imagine, popular mathematics writing didn''t begin with Martin Gardner. In fact, it has a rich tradition stretching back hundreds of years. This entertaining and enlightening anthology--the first of its kind--gathers nearly one hundred fascinating selections from the past 500 years of popular math writing, bringing to life a little-known side of math history. Ranging from the late fifteenth to the late twentieth century, and drawing from books, newspapers, magazines,', 12623, NULL, NULL, 1336057363, 2011312, 2),
(16080, NULL, 'Data Analysis and Data Mining: An Introduction', 'Adelchi Azzalini, Bruno Scarpa', 2012, 'Oxford University Press', 'An introduction to statistical data mining, Data Analysis and Data Mining is both textbook and professional resource. Assuming only a basic knowledge of statistical reasoning, it presents core concepts in data mining and exploratory statistical models to students and professional statisticians-both those working in communications and those working in a technological or scientific capacity-who have a limited knowledge of data mining. This book presents key statistical concepts by way of case stud', 12624, NULL, NULL, 1336057470, 2011313, 1),
(16081, NULL, 'When to Use What Research Design', 'W. Paul Vogt, Dianne C. Gardner, Lynne Haeffele', 2012, 'Guilford Press', 'null', 12625, NULL, NULL, 1336767960, 2011314, 2),
(16191, NULL, 'Getting Started With Business Analytics: Insightful Decision- Making', 'David Roi Hardoon, Galit Shmueli', 2013, 'Taylor &amp; Francis Group', 'Assuming no prior knowledge or technical skills, Getting Started with Business Analytics: Insightful Decision-Making explores the contents, capabilities, and applications of business analytics. It bridges the worlds of business and statistics and describes business analytics from a non-commercial standpoint. The authors demystify the main concepts and terminologies and give many examples of real-world applications. The first part of the book introduces business data and recent technologies that ', 12730, NULL, NULL, 1365016039, 2013023, 2),
(16083, NULL, 'Discrete Models of Financial Markets', 'Marek Capinski, Ekkehard Kopp', 2012, 'Cambridge University Press', '&quot;This book explains in simple settings the fundamental ideas of financial market modelling and derivative pricing, using the no-arbitrage principle. Relatively elementary mathematics leads to powerful notions and techniques - such as viability, completeness, self-financing and replicating strategies, arbitrage and equivalent martingale measures - which are directly applicable in practice. The general methods are applied in detail to pricing and hedging European and American options within t', 12627, NULL, NULL, 1337200366, 2011316, 1),
(16084, 3, 'Clinical Trials in Oncology, Third Edition', 'Stephanie Green, Jacqueline Benedetti, Angela Smith, John Crowley', 2012, 'CRC Press/Taylor & Francis', 'Studies that are unimpeachably thorough, non-political, unbiased, and properly designed&#380; These are the standards to which everyone in clinical research aspires. Yet, the difficulties in designing trials and interpreting data are subtle and ever present. The new edition of Clinical Trials in Oncology provides a concise, nontechnical, and now thoroughly up-to-date review of methods and issues related to clinical trials. The authors emphasize the importance of proper study design, analysis, an', 12628, NULL, NULL, 1337970189, 2011317, 2),
(16085, 2, 'Simulating Nature: A Philosophical Study of Computer-Simulation Uncertainties and Their Role in Climate Science and Policy, 2nd edition', 'Arthur C. Petersen', 2012, 'Taylor &amp; Francis', '&lt;p&gt;Computer simulation has become an important means for obtaining knowledge about nature. The practice of scientific simulation and the frequent use of uncertain simulation results in public policy raise a wide range of philosophical questions. Most prominently highlighted is the field of anthropogenic climate change are humans currently changing the climate? &lt;p&gt;Referring to empirical results from science studies and political science, Simulating Nature: A Philosophical Study of Com', 12629, NULL, 'Simulating Nature: A Philosophical Study of Computer-Simulation Uncertainties and Their Role in Climate Science and Policy Advice', 1337970407, 2011318, 2),
(16086, NULL, 'R for Statistics', 'Pierre-Andre Cornillon, Arnaud Guyader, Francois Husson, Nicolas Jegou, Julie Josse, Maela Kloareg, Eric Matzner-Lober', 2012, 'CRC Press/Taylor & Francis', '&lt;p&gt;Although there are currently a wide variety of software packages suitable for the modern statistician, R has the triple advantage of being comprehensive, widespread, and free. Published in 2008, the second edition of Statistiques avec R enjoyed great success as an R guidebook in the French-speaking world. Translated and updated, R for Statistics includes a number of expanded and additional worked examples. &lt;p&gt;Organized into two sections, the book focuses first on the R software, t', 12630, NULL, NULL, 1337971039, 2011319, 2),
(16087, NULL, 'Maximum Likelihood Estimation for  Sample Surveys', 'R.L. Chambers, D.G. Steel,  Suojin Wang, A.H. Welsh,', 2012, 'CRC Press/Taylor & Francis', '&lt;p&gt;Sample surveys provide data used by researcher in a large range of disciplines to analyze important relationships using well-established and widely-used likelihood methods. The methods used to select samples often result in the sample differing in important ways from the target population and standard application of likelihood methods can lead to biased and inefficient estimates. &lt;p&gt;Maximum Likelihood Estimation for Sample Surveys presents an overview of likelihood methods for the', 12631, NULL, NULL, 1337971136, 2011320, 2),
(16088, NULL, 'Statistical Methods for Stochastic Differential Equations', 'Mathieu Kessler, Alexander Lindner, Michael Sorensen, eds.', 2012, 'CRC Press/Taylor & Francis', ' presents current research trends and recent developments in statistical methods for stochastic differential equations. Written to be accessible to both new students and seasoned researchers, each self-contained chapter starts with introductions to the topic at hand and builds gradually towards discussing recent research.\n\nThe book covers Wiener-driven equations as well as stochastic differential equations with jumps, including continuous-time ARMA processes and COGARCH processes. It presents a ', 12632, NULL, NULL, 1337971335, 2011321, 1),
(16089, NULL, 'Multivariate Survival Analysis and Competing Risks', 'Martin J. Crowder', 2012, 'CRC Press/Taylor & Francis', '&quot;Preface This book is an outgrowth of Classical Competing Risks (2001). I was very pleased to be encouraged by Rob Calver and Jim Zidek to write a second, expanded edition. Among other things it gives the opportunity to correct the many errors that creptinto the first edition. This edition has been typed in Latex by my own fair hand, so the inevitable errors are now all down to me. The book is now divided into four sections but I won&#39;t go through describing them in detail here since the', 12633, NULL, NULL, 1337971476, 2011322, 2),
(16178, NULL, 'Analysis of Mixed Data', 'A. R. De Leon, K. C. Carriere', 2013, 'CRC PressINC', 'A comprehensive source on mixed data analysis, Analysis of Mixed Data: Methods & Applications summarizes the fundamental developments in the field. Case studies are used extensively throughout the book to illustrate interesting applications from economics, medicine and health, marketing, and genetics. Carefully edited for smooth readability and seamless transitions between chaptersAll chapters follow a common structure, with an introduction and a concluding summary, and include illustrative exam', 12718, NULL, NULL, 1360014462, 2013010, 2),
(16092, NULL, 'Boosting: Foundations and Algorithms', 'Robert E. Schapire, Yoav Freund', 2012, 'MIT Press', '&lt;p&gt;Boosting is an approach to machine learning based on the idea of creating a highly accurate predictor by combining many weak and inaccurate &quot;rules of thumb.&quot; A remarkably rich theory has evolved around boosting, with connections to a range of topics, including statistics, game theory, convex optimization, and information geometry. Boosting algorithms have also enjoyed practical success in such fields as biology, vision, and speech processing. At various times in its history, b', 12635, NULL, NULL, 1339101439, 2011324, 1),
(16093, NULL, 'Statistics Translated: A Step-By-Step Guide to Analyzing and Interpreting Data', 'Steven R. Terrell', 2012, 'Guilford Press', 'Written in a humorous and encouraging style, this text shows how the most common statistical tools can be used to answer interesting real-world questions, presented as mysteries to be solved. Engaging research examples lead the reader through a series of six steps, from identifying a researchable problem to stating a hypothesis, identifying independent and dependent variables, and selecting and interpreting appropriate statistical tests. All techniques are demonstrated both manually and with the', 12636, NULL, NULL, 1339531093, 2011325, 2),
(16094, NULL, 'Programming Graphical User Interfaces With R', 'John Verzani, Michael Lawrence', 2012, 'CRC Press/Taylor & Francis', '&lt;p&gt;Programming Graphical User Interfaces with R introduces each of the major R packages for GUI programming: RGtk2, qtbase, Tcl/Tk, and gWidgets. With examples woven through the text as well as stand-alone demonstrations of simple yet reasonably complete applications, the book features topics especially relevant to statisticians who aim to provide a practical interface to functionality implemented in R. The book offers: &lt;p&gt; &lt;ul&gt; &lt;p&gt; &lt;li&gt;A how-to guide for developing', 12637, NULL, NULL, 1339784463, 2011326, 2),
(16095, NULL, 'Nonparametric Inference on Manifolds: With Applications to Shape Spaces', 'Abhishek Bhattacharya, Rabi Bhattacharya', 2012, 'Cambridge University Press', 'This book introduces in a systematic manner a general nonparametric theory of statistics on manifolds, with emphasis on manifolds of shapes. The theory has important and varied applications in medical diagnostics, image analysis, and machine vision. An early chapter of examples establishes the effectiveness of the new methods and demonstrates how they outperform their parametric counterparts. Inference is developed for both intrinsic and extrinsic FrÃ©chet means of probability distributions on m', 12638, NULL, NULL, 1340205740, 2011327, 2),
(16096, NULL, 'Handbook of Structural Equation Modeling', 'Rick H. Hoyle', 2012, 'Guilford Press', '&lt;p&gt;The first comprehensive structural equation modeling (SEM) handbook, this accessible volume presents both the mechanics of SEM and specific SEM strategies and applications. The editor, contributors, and editorial advisory board are leading methodologists who have organized the book to move from simpler material to more statistically complex modeling approaches. Sections cover the foundations of SEM; statistical underpinnings, from assumptions to model modifications; steps in implementat', 12639, NULL, NULL, 1340205948, 2011328, 2),
(16097, NULL, 'The Oxford Handbook of Quantitative Asset Management', 'Bernd Scherer, Kenneth Winston', 2012, 'Oxford University Press', 'Quantitative portfolio management has become a highly specialized discipline. Computing power and software improvements have advanced the field to a level that would not have been thinkable when Harry Markowitz began the modern era of quantitative portfolio management in 1952. In addition to raw computing power, major advances in financial economics and econometrics have shaped academia and the financial industry over the last 60 years. While the idea of a general theory of finance is still only', 12640, NULL, NULL, 1341343071, 2011329, 1),
(16098, NULL, 'Practical Statistics for Astronomers', 'J. V. Wall, C. R. Jenkins', 2012, 'Cambridge University Press', '&quot;Astronomy needs statistical methods to interpret data, but statistics is a many-faceted subject which is difficult for non-specialists to access. This handbook helps astronomers analyze the complex data and models of modern astronomy. This second edition has been revised to feature many more examples using Monte Carlo simulation, and now also includes Bayesian inference, Bayes factors and Markov Chain Monte Carlo integration. Chapters cover basic probability, correlation analysis, hypothes', 12641, NULL, NULL, 1341343177, 2011330, 1),
(16099, NULL, 'Normal Approximations With Malliavin Calculus: From Stein''s Method to Uncertainty', 'Ivan Nourdin, Giovanni Peccati', 2012, 'Cambridge University Press', '&quot;Stein&#39;s method is a collection of probabilistic techniques that allow one to assess the distance between two probability distributions by means of differential operators. In 2007, the authors discovered that one can combine Stein&#39;s method with the powerful Malliavin calculus of variations, in order to deduce quantitative central limit theorems involving functionals of general Gaussian fields. This book provides an ideal introduction both to Stein&#39;s method and Malliavin calculus', 12642, NULL, NULL, 1342707948, 2011331, 2),
(16100, NULL, 'Predicting Presidential Elections and Other Things, Second Edition', 'Ray Fair', 2011, 'Stanford University Press', '&quot;It&#39;s the economy, stupid,&quot; as Democratic strategist James Carville would say. After many years of study, Ray C. Fair has found that the state of the economy has a dominant influence on national elections. Just in time for the 2012 presidential election, this new edition of his classic text, Predicting Presidential Elections and Other Things, provides us with a look into the likely future of our nation&#39;s political landscape?but Fair doesn&#39;t stop there.Fair puts other nation', 12643, NULL, NULL, 1342708064, 2011332, 0),
(16101, 5, 'IBM SPSS for Introductory Statistics: Use and Interpretation, Fifth Edition', 'George A. Morgan, Nancy L. Leech, Gene W. Gloeckner, Karen C. Barrett', 2013, 'Taylor &amp; Francis', 'Designed to help students analyze and interpret research data using IBM SPSS, this user-friendly book, written in easy-to-understand language, shows readers how to choose the appropriate statistic, based on the design, and to interpret outputs appropriately. The authors prepare readers for all of the steps in the research process: design, entering and checking data, testing assumptions, assessing reliability and validity, computing descriptive and inferential parametric and nonparametric statist', 12644, NULL, NULL, 1343749260, 2011333, 4),
(16102, NULL, 'Handbook of Statistics: Time Series Analysis: Methods and Applications, Vol. 30', 'T. Subba Rao, S. Subba Rao, C. R. Rao, editors', 2012, 'Elsevier', 'The field of statistics not only affects all areas of scientific activity, but also many other matters such as public policy. It is branching rapidly into so many different subjects that a series of handbooks is the only way of comprehensively presenting the various aspects of statistical methodology, applications, and recent developments. The Handbook of Statistics is a series of self-contained reference books. Each volume is devoted to a particular topic in statistics, with Volume 30 dealing w', 12645, NULL, NULL, 1343749479, 2011334, 1),
(16103, NULL, 'Principles of Brain Dynamics: Global State Interactions', 'Mikhail I. Rabinovich, Karl J. Friston, Pablo Varona', 2012, 'MIT Press', 'The consideration of time or dynamics is fundamental for all aspects of mental activity--perception, cognition, and emotion--because the main feature of brain activity is the continuous change of the underlying brain states even in a constant environment. The application of nonlinear dynamics to the study of brain activity began to flourish in the 1990s when combined with empirical observations from modern morphological and physiological observations. This book offers perspectives on brain dynam', 12646, NULL, NULL, 1344008315, 2011335, 1),
(16104, NULL, 'Understanding Probability', 'Henk Tijms', 2012, 'Cambridge University Press', 'Understanding Probability is a unique and stimulating approach to a first course in probability. The first part of the book demystifies probability and uses many wonderful probability applications from everyday life to help the reader develop a feel for probabilities. The second part, covering a wide range of topics, teaches clearly and simply the basics of probability. This fully revised third edition has been packed with even more exercises and examples and it includes new sections on Bayesian', 12647, NULL, NULL, 1344279128, 2011336, 1),
(16105, NULL, 'Experimental Human-computer Interaction: A Practical Guide With Visual Examples', 'Helen C. Purchase', 2012, 'Cambridge University Press', 'Experiments that require the use of human participants are time consuming and costly: it is important to get the process right the first time. Planning and preparation are key to success. This practical book takes the human-computer interaction researcher through the complete experimental process, from identifying a research question to designing and conducting an experiment, and then to analyzing and reporting the results. The advice offered in this book draws on the author''s twenty years of ex', 12648, NULL, NULL, 1344279485, 2011337, 1),
(16106, NULL, 'Clinical Trial Design: Bayesian and Frequentist Adaptive Methods', 'Guosheng Yin', 2012, 'John Wiley &amp; Sons', 'A balanced treatment of the theories, methodologies, and design issues involved in clinical trials using statistical methodsThere has been enormous interest and development in Bayesian adaptive designs, especially for early phases of clinical trials. However, for phase III trials, frequentist methods still play a dominant role through controlling type I and type II errors in the hypothesis testing framework. From practical perspectives, Clinical Trial Design: Bayesian and Frequentist Adaptive Me', 12649, NULL, NULL, 1344279569, 2011338, 2),
(16109, NULL, 'Modern Statistical Methods for Astronomy: With R Applications', 'Eric D. Feigelson, G. Jogesh Babu', 2012, 'Cambridge University Press', 'Modern astronomical research is beset with a vast range of statistical challenges, ranging from reducing data from megadatasets to characterizing an amazing variety of variable celestial objects or testing astrophysical theory. Linking astronomy to the world of modern statistics, this volume is a unique resource, introducing astronomers to advanced statistics through ready-to-use code in the public domain R statistical software environment. The book presents fundamental results of probability th', 12651, NULL, NULL, 1346097602, 2011341, 1),
(16108, NULL, 'Golden Holocaust: Origins of the Cigarette Catastrophe and the Case for Abolition', 'Robert N. Proctor', 2011, 'University of California Press', 'The cigarette is the deadliest artifact in the history of human civilization. It is also one of the most beguiling, thanks to more than a century of manipulation at the hands of tobacco industry chemists. In Golden Holocaust, Robert N. Proctor draws on reams of formerly-secret industry documents to explore how the cigarette came to be the most widely-used drug on the planet, with six trillion sticks sold per year. He paints a harrowing picture of tobacco manufacturers conspiring to block the rec', 12650, NULL, NULL, 1344615672, 2011340, 1),
(16177, NULL, 'A Course on Statistics for Finance', 'Stanley L. Sclove', 2013, 'CRC PressINC', 'Taking a data-driven approach, A Course on Statistics for Finance presents statistical methods for financial investment analysis. The author introduces regression analysis, time series analysis, and multivariate analysis step by step using models and methods from finance.The book begins with a review of basic statistics, including descriptive statistics, kinds of variables, and types of data sets. It then discusses regression analysis in general terms and in terms of financial investment models,', 12717, NULL, NULL, 1360014174, 2013009, 1),
(16112, NULL, 'Principles of Business Forcasting (with Crystal Ball Pro 2000)', 'Keith Ord, Robert Fildes', 2013, 'Cengage Learning', 'Description\nOrd/Fildes PRINCIPLES OF BUSINESS FORECASTING, 1E gives you the tools and insight to make the most effective forecasts whether you are a student or an experienced forecaster. Ord and Fildes have designed PRINCIPLES OF BUSINESS FORECASTING for users who have taken a first course in applied statistics or who have an equivalent background. The book introduces you to standard and advanced forecasting methods and their underlying models, and also includes general principles to guide and s', 12654, NULL, NULL, 1346268609, 2011344, 1),
(16113, 3, 'Multilevel and Longitudinal Modeling Using Stata: Continuous Responses, 3rd edition', 'Sophia Rabe-Hesketh, Anders Skrondal', 2012, 'Stata Press', 'Volume I is devoted to continuous Gaussian linear mixed models and has nine chapters. The chapters are organized in four parts. The first part provides a review of the methods of linear regression. The second part provides an in-depth coverage of the two-level models, the simplest extensions of a linear regression model. The mixed-model foundation and the in-depth coverage of the mixed-model principles provided in volume I for continuous outcomes, make it straightforward to transition to general', 12655, NULL, 'A review of a previous edition appeared in TAS Vol. 6, No. 3 (Aug., 2006)', 1346783816, 2011345, 2),
(16114, 2, 'Logistic Regression Using Sas: Theory and Application, Second Edition', 'D Allison Paul, Paul Allison', 2012, 'SAS Institute', 'If you are a researcher or student with experience in multiple linear regression and want to learn about logistic regression, Paul Allison''s Logistic Regression Using SAS: Theory and Application, Second Edition, is for you! Informal and nontechnical, this book both explains the theory behind logistic regression, and looks at all the practical details involved in its implementation using SAS. Several real-world examples are included in full detail. This book also explains the differences and simi', 12656, NULL, NULL, 1347043248, 2011346, 2),
(16115, NULL, 'Generalized Linear and Nonlinear Models for Correlated Data: Theory and Applications Using SAS', 'Edward F. Vonesh', 2012, 'SAS Publishing', 'Edward F. Vonesh''s Generalized Linear and Nonlinear Models for Correlated Data: Theory and Applications Using SAS is devoted to the analysis of correlated response data using SAS, with special emphasis on applications that require the use of generalized linear models or generalized nonlinear models. Written in a clear, easy-to-understand manner, it provides applied statisticians with the necessary theory, tools, and understanding to conduct complex analyses of continuous and/or discrete correlat', 12657, NULL, NULL, 1347043497, 2011347, 2),
(16116, NULL, 'Overdispersion Models in Sas', 'Jorge Morel, Nagaraj Neerchal', 2012, 'SAS Institute', 'Overdispersion Models in SAS provides a friendly methodology-based introduction to the ubiquitous phenomenon of overdispersion. A basic yet rigorous introduction to the several different overdispersion models, an effective omnibus test for model adequacy, and fully functioning commented SAS codes are given for numerous examples. The examples, many of which use the GLIMMIX, GENMOD, and NLMIXED procedures, cover a variety of fields of application, including pharmaceutical, health care, and consume', 12658, NULL, NULL, 1347043700, 2011348, 2);
INSERT INTO `book` (`book_id`, `edition_number`, `title`, `authors`, `year`, `publisher`, `synopsis`, `book_marketing_info_id`, `extra_book_marketing_info_id`, `notes`, `date_added`, `book_num`, `copies_on_hand`) VALUES
(16117, 5, 'Jmp Start Statistics: a Guide to Statistics and Data Analysis Using Jmp, 5th edition ...', 'John Sall, Ann Lehman, Mia Stephens, Lee Creighton', 2012, 'SAS Institute', 'JMP Start Statistics: A Guide to Statistics and Data Analysis Using JMP, Fifth Edition, is the perfect mix of software manual and statistics text. Authors John Sall, Ann Lehman, Mia Stephens, and Lee Creighton provide hands-on tutorials with just the right amount of conceptual and motivational material to illustrate how to use the intuitive interface for data analysis in JMP. Each chapter features concept-specific tutorials, examples, brief reviews of concepts, step-by-step illustrations, and ex', 12659, NULL, NULL, 1347043901, 2011349, 2),
(16118, NULL, 'Jsl Companion: Applications of the Jmp Scripting Language', 'Theresa Utlaut, Kevin Anderson, Georgia Morgan', 2011, 'SAS Institute', 'JSL Companion: Applications of the JMP Scripting Language provides novice scripters with a resource that helps them go beyond the basics of the JMP Scripting Language (JSL) and serves as a companion to writing applications. Taking a task-oriented approach rather than focusing on showing the syntax, the authors help users with much more than the basic task of capturing a script. The book starts with an introduction that is suitable for someone who is just beginning to learn JSL. It quickly moves ', 12660, NULL, NULL, 1347044167, 2011350, 2),
(16119, NULL, 'Machine Learning: A Probabilistic Perspective', 'Kevin P. Murphy', 2012, 'Mit Press', 'Today''s Web-enabled deluge of electronic data calls for automated methods of data analysis. Machine learning provides these, developing methods that can automatically detect patterns in data and then use the uncovered patterns to predict future data. This textbook offers a comprehensive and self-contained introduction to the field of machine learning, a unified, probabilistic approach. The coverage combines breadth and depth, offering necessary background material on such topics as probability, ', 12661, NULL, NULL, 1348083092, 2011351, 1),
