(16123, NULL, 'Large Sample Inference for Long Memory Processes', 'Liudas Giraitis, Hira L. Koul, Donatas Surgailis', 2012, 'World Scientific Publishing Company Incorporated', 'Box and Jenkins (1970) made the idea of obtaining a stationary time series by differencing the given, possibly nonstationary, time series popular. Numerous time series in economics are found to have this property. Subsequently, Granger and Joyeux (1980) and Hosking (1981) found examples of time series whose fractional difference becomes a short memory process, in particular, a white noise, while the initial series has unbounded spectral density at the origin, i.e. exhibits long memory. Further e', 12664, NULL, NULL, 1348683486, 2011355, 2),
(16124, NULL, 'Sandlot Stats: Learning Statistics with Baseball', 'Stanley Rothman', 2012, 'JHU Press', 'As Derek Jeter strolls toward the plate, the announcer tosses out a smattering of statistics-from hitting streaks to batting averages. But what do the numbers mean? And how can America''s favorite pastime be a model for learning about statistics? Sandlot Stats is an innovative textbook that explains the mathematical underpinnings of baseball so that students can understand the world of statistics and probability. \n\nCarefully illustrated and filled with exercises and examples, this book teaches th', 12665, NULL, NULL, 1348683864, 2011356, 1),
