(16132, NULL, 'Statistical Geoinformatics for Human Environment Interface', 'Wayne L. Myers, Ganapati P Patil', 2013, 'CRC Press', 'Statistical Geoinformatics for Human Environment Interface presents two paradigms for studying both space and interface with regard to human/environment: localization and multiple indicators. The first approach localizes thematic targets by treating space as a pattern of vicinities, with the pattern being a square grid and the placement of vicinities centrically referenced. The second approach explores human/environment interface as an abstraction through indicators, neutralizing the common conu', 12673, NULL, NULL, 1349383777, 2011364, 2),
