(16137, 3, 'Scientific Papers and Presentations, 3rd edition', 'Martha Davis, Kaaron Joann Davis, Marion Dunagan', 2012, 'Academic Press', 'Electronic publishing and electronic means of text and data presentation have changed enormously since the first edition of this book was published in 1997. The third edition of Scientific Papers and Presentations applies traditional principles to today''s modern techniques and the changing needs of up-and-coming academia. Topics include designing visual aids, writing first drafts, reviewing and revising, communicating clearly and concisely, adhering to stylistic principles, presenting data in ta', 12678, NULL, NULL, 1350326761, 2011369, 1),
