(16148, 2, 'The Theory of Gambling and Statistical Logic, 2nd edition', 'Richard A. Epstein', 2013, 'Academic Press', 'Early in his rise to enlightenment, man invented a concept that has since been variously viewed as a vice, a crime, a business, a pleasure, a type of magic, a disease, a folly, a weakness, a form of sexual substitution, an expression of the human instinct. He invented gambling.\nRecent advances in the field, particularly Parrondo''s paradox, have triggered a surge of interest in the statistical and mathematical theory behind gambling. This interest was acknowledge in the motion picture, "21," insp', 12688, NULL, NULL, 1352233341, 2011380, 1),
