(16153, NULL, 'Stationary Stochastic Process: Theory and Applications', 'Georg Lindgren', 2013, 'CRC Press/Chapman & Hall', '"Preface This book has grown out of my own experiences as teacher and researcher at a department in mathematical statistics with responsibilities both to an engineering and a science community. The spirit of the text reflects those double responsibilities. The background The book Stationary and Related Stochastic Processes [34] appeared in 1967. Written by Harald Cramaer and M.R. Leadbetter, it drastically changed the life of PhD students in Mathematical statistics with an interest in stochastic', 12693, NULL, NULL, 1352234436, 2011385, 2),
(16154, NULL, 'Methodology in Robust and Nonparametric Statistics', 'Jana Jureckova, Pranab Kumar Sen, Jan Picek', 2013, 'CRC Press/Chapman & Hall', 'Robust and nonparametric statistical methods have their foundation in fields ranging from agricultural science to astronomy, from biomedical sciences to the public health disciplines, and, more recently, in genomics, bioinformatics, and financial statistics. These disciplines are presently nourished by data mining and high-level computer-based algorithms, but to work actively with robust and nonparametric procedures, practitioners need to understand their background. Explaining the underpinnings', 12694, NULL, NULL, 1352234532, 2011386, 2),
(16155, NULL, 'Risk Assessment and Decision Analysis With Bayesian Networks', 'Norman Fenton, Martin Neil', 2013, 'CRC PressI', 'Although many Bayesian Network (BN) applications are now in everyday use, BNs have not yet achieved mainstream penetration. Focusing on practical real-world problem solving and model building, as opposed to algorithms and theory, Risk Assessment and Decision Analysis with Bayesian Networks explains how to incorporate knowledge with data to develop and use (Bayesian) causal models of risk that provide powerful insights and better decision making.Provides all tools necessary to build and run reali', 12695, NULL, NULL, 1352833121, 2011387, 2),
