(16157, NULL, 'Visions of Infinity: The Great Mathematical Problems', 'Ian Stewart', 2013, 'Basic Books', 'For every problem mathematicians solve, another waits to perplex and galvanize them. Such challenges offer a tantalizing glimpse of the field''s unlimited potential, and keep mathematicians looking toward the horizons of intellectual possibility. In Visions of Infinity, celebrated mathematician Ian Stewart explains why these problems exist, what drives mathematicians to solve them, and why their efforts matter in the context of science as a whole. Stewart describes solved problems like Fermat', 12698, NULL, 'This is the Advance Uncorrected Proof paperback and a good version.', 1352833343, 2011389, 2),
