(16169, 2, 'A Primer of Ecological Statistics, 2nd edition', 'Nicholas J. Gotelli, Aaron M. Ellison', 2013, 'Sinauer', 'null', 12710, NULL, NULL, 1357319980, 2013003, 2),
(16170, 2, 'Generalized Estimating Equations, Second Edition', 'James W. Hardin, Joseph M. Hilbe', 2013, 'CRC PressINC', 'Generalized Estimating Equations, Second Edition updates the best-selling previous edition, which has been the standard text on the subject since it was published a decade ago. Combining theory and application, the text provides readers with a comprehensive discussion of GEE and related models. Numerous examples are employed throughout the text, along with the software code used to create, run, and evaluate the models being examined. Stata is used as the primary software for running and displayi', 12711, NULL, NULL, 1357335053, 2013004, 2),
(16192, 2, 'Beyond Significance Testing: Statistics Reform in the Behavioral Sciences, 2nd edition', 'Rex B. Kline', 2013, 'American Psychological Association', 'Traditional education in statistics that emphasizes significance testing leaves researchers and students ill prepared to understand what their results really mean. Specifically, most researchers and students who do not have strong quantitative backgrounds have difficulty understanding outcomes of statistical tests.\nAs more and more people become aware of this problem, the emphasis on statistical significance in the reporting of results is declining. Increasingly, researchers are expected to desc', 12731, NULL, NULL, 1365016131, 2013024, 1),
(16195, NULL, 'Doing Statistical Mediation and Moderation', 'Paul E. Jose', 2013, 'Guilford Publications', 'Written in a friendly, conversational style, this book offers a hands-on approach to statistical mediation and moderation for both beginning researchers and those familiar with modeling. Starting with a gentle review of regression-based analysis, Paul Jose covers basic mediation and moderation techniques before moving on to advanced topics in multilevel modeling, structural equation modeling, and hybrid combinations, such as moderated mediation. User-friendly features include numerous graphs and', 12734, NULL, NULL, 1367337065, 2013027, 1),
(16196, NULL, 'A History of Mathematics: From Mesopotamia to Modernity', 'Luke Hodgkin', 2013, 'OUP Oxford', 'A History of Mathematics: From Mesopotamia to Modernity covers the evolution of mathematics through time and across the major Eastern and Western civilizations. It begins in Babylon, then describes the trials and tribulations of the Greek mathematicians. The important, and often neglected, influence of both Chinese and Islamic mathematics is covered in detail, placing the description of early Western mathematics in a global context. The book concludes with modern mathematics, covering recent dev', 12735, NULL, 'Published in hardback 2005....paperback 2013...same book', 1367337146, 2013028, 1),
(16197, 9, 'Sociological Theory, 9th ed.', 'George Ritzer', 2013, 'McGraw-Hill Education', 'The ninth edition of Sociological Theory by George Ritzer gives readers a comprehensive overview of the major theorists and schools of sociological thought. Key theories are integrated with biographical sketches of theorists, and are placed in their historical and intellectual context. Written by one of the foremost authorities on sociological theory, this text helps students better understand the original works of classical and modern theorists, and enables them to compare and contrast the late', 12736, NULL, NULL, 1367337635, 2013029, 1),
(16198, NULL, 'Understanding and Interpreting Educational Research', 'Ronald C. Martella, J. Ron Nelson, Robert L. Morgan, Nancy E. Marchand-Martella', 2013, 'Guilford Publications', 'This user-friendly text takes a learn-by-doing approach to exploring research design issues in education and psychology, offering evenhanded coverage of quantitative, qualitative, mixed-methods, and single-case designs. Readers learn the basics of different methods and steps for critically examining any study''s design, data, and conclusions, using sample peer-reviewed journal articles as practice opportunities. The text is unique in featuring full chapters on survey methods, evaluation, reliabil', 12737, NULL, NULL, 1368042702, 2013030, 1),
(16199, NULL, 'Longitudinal Structural Equation Modeling', 'Todd D. Little', 2013, 'Guilford Press', 'Featuring actual datasets as illustrative examples, this book reveals numerous ways to apply structural equation modeling (SEM) to any repeated-measures study. Initial chapters lay the groundwork for modeling a longitudinal change process, from measurement, design, and specification issues to model evaluation and interpretation. Covering both big-picture ideas and technical "how-to-do-it" details, the author deftly walks through when and how to use longitudinal confirmatory factor analysis, long', 12738, NULL, NULL, 1368637158, 2013031, 1),
(16200, NULL, 'Econophysics of Income and Wealth Distributions', 'Anirban Chakraborti, Satya R. Chakravarty, Arnab Chatterjee', 2013, 'Cambridge University Press', '"The distribution of wealth and income is never uniform, and philosophers and economists have tried for years to understand the reasons and formulate remedies for such inequalities. This book introduces the elegant and intriguing kinetic exchange models that physicists have developed to tackle these issues. This is the first monograph in econophysics focussed on the analyses and modelling of these distributions, and is ideal for physicists and economists. It is written in simple, lucid language,', 12739, NULL, NULL, 1368637225, 2013032, 1),
(16206, NULL, 'New Book', 'Last, First', NULL, NULL, 'Add Synopsis Here', NULL, NULL, NULL, 1370281438, 2013037, 0),
(16207, NULL, 'Statistics for the Life Sciences', 'Myra L. Samuels, Jeffrey A. Witmer, Andrew A. Schaffner', 2012, 'Pearson Education', 'Statistics for the Life Sciences, Fourth Edition, covers the key concepts of statistics as applied to the life sciences, while incorporating the tools and themes of modern data analysis. This text uses an abundance of real data in the exercises and examples, and minimizes computation, so that readers can focus on the statistical concepts and issues, not the mathematics. Basic algebra is assumed as a prerequisite.', 12741, NULL, NULL, 1370438708, 2013038, 0),
(16208, NULL, 'Mean Field Simulation for Monte Carlo Integration', 'Moral, Pierre Del', 2013, 'CRC Press', 'In the last three decades, there has been a dramatic increase in the use of interacting particle methods as a powerful tool in real-world applications of Monte Carlo simulation in computational physics, population biology, computer sciences, and statistical machine learning. Ideally suited to parallel and distributed computation, these advanced particle algorithms include nonlinear interacting jump diffusions; quantum, diffusion, and resampled Monte Carlo methods; Feynman-Kac particle models; ge', 12742, NULL, NULL, 1370550547, 2013039, 1),
(16204, NULL, 'Bayesian Modeling Using WinBUGS', 'Ioannis Ntzoufras', 2011, NULL, 'LIC "-//W3C//DTD XHTML 1.0 Strict//EN""http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">Bayesian Modeling Using WinBUGS - Ioannis Ntzoufras - Google Books(function(){(function(){function d(a){this.t={};this.tick=function(a,c,b){b=void 0!=b?b:(new Date).getTime();this.t[a]=[b,c]};this.tick("start",null,a)}var a=new d;window.jstiming={Timer:d,load:a};if(window.performance&&window.performance.timing){var a=window.performance.timing,c=window.jstiming.load,b=a.navigationStart,a=a.responseStart;0=b&', 12740, NULL, NULL, 1369765690, 2013036, 0),
(16209, 3, 'Doing Survey Research, 3rd edition', 'Peter Nardi', 2013, 'Paradigm Publishers', ' The significantly updated third edition of this short, practical book prepares students to write a questionnaire, generate a sample, conduct their own survey research, analyze data, and write up the results, while learning to read and interpret excerpts from published research. It combines statistics and survey research methods in a single book.New to the Third Edition:', 12743, NULL, NULL, 1370550775, 2013040, 1),
(16210, NULL, 'Survival Analysis in Medicine and Genetics', 'Jialiang Li, Shuangge Ma', 2013, 'Taylor &amp; Francis Group', '"Preface In modern medicine, knowledge on human lifetime and what shortens it has been gradually accumulated over years of tremendous numeric studies. All quantitative products in those studies are well supported by a system of statistical tools, namely survival analysis. This book is speci cally devoted to this important category of statistical methods. There already exist quite a number of well-written, widely used introductory texts on this subject. The rst two chapters of this book may serve', 12744, NULL, NULL, 1370893328, 2013041, 1),
(16211, NULL, 'Methods of Statistical Model Estimation', 'Joseph M. Hilbe, Andrew P. Robinson', 2013, 'Taylor &amp; Francis Group', 'Methods of Statistical Model Estimation examines the most important and popular methods used to estimate parameters for statistical models and provide informative model summary statistics. Designed for R users, the book is also ideal for anyone wanting to better understand the algorithms used for statistical model fitting.The text presents algorithms for the estimation of a variety of regression procedures using maximum likelihood estimation, iteratively reweighted least squares regression, the ', 12745, NULL, NULL, 1370893462, 2013042, 2),
(16212, NULL, 'Statistical Theory: A Concise Introduction', 'Felix Abramovich, Ya''Acov Ritov', 2013, 'Taylor &amp; Francis Group', 'Designed for a one-semester advanced undergraduate or graduate course, Statistical Theory: A Concise Introduction clearly explains the underlying ideas and principles of major statistical concepts, including parameter estimation, confidence intervals, hypothesis testing, asymptotic analysis, Bayesian inference, and elements of decision theory. It introduces these topics on a clear intuitive level using illustrative examples in addition to the formal definitions, theorems, and proofs.Based on the', 12746, NULL, NULL, 1370893549, 2013043, 2),
(16213, 2, 'Stochastic Processes With Applications to Finance, 2nd', 'Masaaki Kijima', 2013, 'CRC Press', 'Financial engineering has been proven to be a useful tool for risk management, but using the theory in practice requires a thorough understanding of the risks and ethical standards involved. Stochastic Processes with Applications to Finance, Second Edition presents the mathematical theory of financial engineering using only basic mathematical tools that are easy to understand even for those with little mathematical expertise. This second edition covers several important developments in the finan', 12747, NULL, NULL, 1370893636, 2013044, 2),
(16214, NULL, NULL, NULL, NULL, NULL, NULL, 12748, NULL, NULL, 1370896461, 2013045, 0),
(16215, NULL, 'Handbook of SAS(R) Data Step Programming', 'Arthur Li', 2013, 'CRC', 'Features\nFocuses on programming logic and algorithms, helping readers avoid common problems when creating SAS data sets\nProvides the prerequisite background for readers with minimal SAS knowledge\nImproves readersâ€™ comprehension of essential SAS programming ideas, such as the compilation and execution phases of the DATA step and the PDV during DATA step execution\nPresents programming strategies that illustrate how to begin a programming task and the steps involved for solving the problem\nOffers', 12749, NULL, NULL, 1370896563, 2013046, 2),
(16216, NULL, 'Understanding Advanced Statistical Methods', 'Peter Westfall, Kevin S. S. Henning', 2013, 'CRC Press', 'Providing a much-needed bridge between elementary statistics courses and advanced research methods courses, Understanding Advanced Statistical Methods helps students grasp the fundamental assumptions and machinery behind sophisticated statistical topics, such as logistic regression, maximum likelihood, bootstrapping, nonparametrics, and Bayesian methods. The book teaches students how to properly model, think critically, and design their own studies to avoid common errors. It leads them to think ', 12750, NULL, NULL, 1370896728, 2013047, 2),
(16217, NULL, 'Introduction to Mediation, Moderation, and Conditional Process Analysis A Regression-Based Approach', 'Andrew F. Hayes', 2013, 'Guilford', 'This engaging book explains the fundamentals of mediation and moderation analysis and their integration as "conditional process analysis." Procedures are described for testing hypotheses about the mechanisms by which causal effects operate, the conditions under which they occur, and the moderation of mechanisms. Relying on the principles of ordinary least squares regression, Andrew Hayes carefully explains the estimation and interpretation of direct and indirect effects, probing and visualizatio', 12751, NULL, NULL, 1371240287, 2013048, 1);
